(12904,141451,'A transient loss of consciousness and postural tone caused by diminished blood flow to the brain (i.e., BRAIN ISCHEMIA). Presyncope refers to the sensation of lightheadedness and loss of strength that precedes a syncopal event or accompanies an incomplete syncope. (From Adams et al., Principles of Neurology, 6th ed, pp367-9)','en',1,'2007-10-18 04:28:24',1,NULL,'12904FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12905,141452,'A drive stemming from a physiological need for water.','en',1,'2007-10-18 04:28:24',1,NULL,'12905FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12906,141453,'Emission or propagation of electromagnetic energy (waves/rays), or the waves/rays themselves; a stream of electromagnetic particles (electrons, neutrons, protons, alpha particles) or a mixture of these. The most common source is the sun.','en',1,'2007-10-18 04:28:24',1,NULL,'12906FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12907,141454,'Accidental injuries caused by brief high-voltage electrical discharges during thunderstorms. Cardiopulmonary arrest, coma and other neurologic symptoms, myocardial necrosis, and dermal burns are common. Prompt treatment of the acute sequelae, including cardiopulmonary resuscitation, is indicated for survival.','en',1,'2007-10-18 04:28:24',1,NULL,'12907FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12908,141464,'Edema of any region of the larynx from a variety of causes. In the earliest stages it may be difficult to differentiate from infection, although mucosal injection and erythema are found more often in the latter. Allergic edema may result as a response from provocation induced by foods, inhalants, and drugs. The entire respiratory tract or only an isolated portion of the larynx may be affected. Laryngeal edema may also be hereditary. Other possible causes of laryngeal edema include increased capillary pressure due to superior vena cava syndrome, internal jugular vein ligation, lowered plasma osmotic failure induced by renal failure, impaired lymphatic flow, and increased capillary permeability to proteins. (From Paparella et al., Otolaryngology, 3d ed, p2253)','en',1,'2007-10-18 04:28:24',1,NULL,'12908FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12909,141465,'Excessive amount of watery fluid accumulated in the intercellular spaces, most commonly present in subcutaneous tissue.','en',1,'2007-10-18 04:28:24',1,'2015-12-31 16:46:43','12909FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
