(12914,141487,'A disseminated vesicular-pustular eruption caused by the herpes simplex virus (HERPESVIRUS HOMINUS), the VACCINIA VIRUS, or Varicella zoster (HERPESVIRUS 3, HUMAN). It is usually superimposed on a preexisting, inactive or active, atopic dermatitis (DERMATITIS, ATOPIC).','en',1,'2007-10-18 04:28:24',1,NULL,'12914FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12915,141488,'A disseminated vesicular-pustular eruption caused by the herpes simplex virus (HERPESVIRUS HOMINUS), the VACCINIA VIRUS, or Varicella zoster (HERPESVIRUS 3, HUMAN). It is usually superimposed on a preexisting, inactive or active, atopic dermatitis (DERMATITIS, ATOPIC).','en',1,'2007-10-18 04:28:24',1,'2015-04-06 13:50:31','12915FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12916,141491,'The turning outward (eversion) of the edge of the eyelid, resulting in the exposure of the palpebral conjunctiva. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12916FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12917,141493,'Gross hypo- or aplasia of one or more long bones of one or more limbs. The concept includes amelia, hemimelia, and phocomelia.','en',1,'2007-10-18 04:28:24',1,NULL,'12917FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12918,141497,'An extra tooth, erupted or unerupted, resembling or unlike the other teeth in the group to which it belongs. Its presence may cause malposition of adjacent teeth or prevent their eruption.','en',1,'2007-10-18 04:28:24',1,NULL,'12918FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12919,141500,'A developmental defect characterized by failure of the testes to descend into the scrotum. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12919FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12920,141503,'Conditions which affect the structure or function of the pupil of the eye, including disorders of innervation to the pupillary constrictor or dilator muscles, and disorders of pupillary reflexes.','en',1,'2007-10-18 04:28:24',1,NULL,'12920FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12921,141526,'A premature contraction of the heart that is initiated somewhere other than the sinoatrial node.','en',1,'2007-10-18 04:28:24',1,NULL,'12921FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12922,141531,'A group of hereditary disorders involving tissues and structures derived from the embryonic ectoderm. They are characterized by the presence of abnormalities at birth and involvement of both the epidermis and skin appendages. They are generally nonprogressive and diffuse. Various forms exist, including anhidrotic and hidrotic dysplasias, FOCAL DERMAL HYPOPLASIA, and aplasia cutis congenita.','en',1,'2007-10-18 04:28:24',1,'2013-05-10 23:15:22','12922FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12923,141533,'A group of hereditary disorders involving tissues and structures derived from the embryonic ectoderm. They are characterized by the presence of abnormalities at birth and involvement of both the epidermis and skin appendages. They are generally nonprogressive and diffuse. Various forms exist, including anhidrotic and hidrotic dysplasias, FOCAL DERMAL HYPOPLASIA, and aplasia cutis congenita.','en',1,'2007-10-18 04:28:24',1,NULL,'12923FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12924,141534,'An idiopathic, rapidly evolving, and severely debilitating disease occurring most commonly in association with chronic ulcerative colitis. It is characterized by the presence of boggy, purplish ulcers with undermined borders, appearing mostly on the legs. The majority of cases are in people between 40 and 60 years old. Its etiology is unknown.','en',1,'2007-10-18 04:28:24',1,NULL,'12924FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12925,141535,'An ulcerative pyoderma usually caused by group A beta-hemolytic streptococcal infection at the site of minor trauma. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12925FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12926,141541,'Viral infections of the leptomeninges and subarachnoid space. TOGAVIRIDAE INFECTIONS; FLAVIVIRIDAE INFECTIONS; RUBELLA; BUNYAVIRIDAE INFECTIONS; ORBIVIRUS infections; PICORNAVIRIDAE INFECTIONS; ORTHOMYXOVIRIDAE INFECTIONS; RHABDOVIRIDAE INFECTIONS; ARENAVIRIDAE INFECTIONS; HERPESVIRIDAE INFECTIONS; ADENOVIRIDAE INFECTIONS; POLYOMAVIRUS HOMINIS 2 infections; and RETROVIRIDAE INFECTIONS may cause this form of meningitis. Clinical manifestations include fever, headache, neck pain, vomiting, PHOTOPHOBIA, and signs of meningeal irritation. (From Joynt, Clinical Neurology, 1996, Ch26, pp1-3)','en',1,'2007-10-18 04:28:24',1,NULL,'12926FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12927,141542,'Infectious disease processes, including meningitis, diarrhea, and respiratory disorders, caused by echoviruses.','en',1,'2007-10-18 04:28:24',1,NULL,'12927FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12928,141543,'Involuntary (\"parrot-like\"), meaningless repetition of a recently heard word, phrase, or song. This condition may be associated with transcortical APHASIA; SCHIZOPHRENIA; or other disorders. (From Adams et al., Principles of Neurology, 6th ed, p485)','en',1,'2007-10-18 04:28:24',1,NULL,'12928FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12929,141547,'Infection by flukes of the genus Echinostoma.','en',1,'2007-10-18 04:28:24',1,NULL,'12929FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12930,141551,'Helminth infection of the liver caused by Echinococcus granulosus or Echinococcus multilocularis.','en',1,'2007-10-18 04:28:24',1,NULL,'12930FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12931,141554,'A benign neoplasm derived from epithelial cells of sweat glands. (Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12931FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12932,141556,'A cystic form of sweat gland adenoma (ADENOMA, SWEAT GLAND). It is produced by the cystic proliferation of apocrine secretory glands. It is not uncommon, occurring in adult life in no particular age group, with males and females equally affected. The commonest site is around the eye, particularly lateral to the outer canthus. It is cured by surgical removal. (Stedman, 25th ed; Rook et al., Textbook of Dermatology, 4th ed, p2410)','en',1,'2007-10-18 04:28:24',1,NULL,'12932FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12933,141557,'A benign neoplasm derived from epithelial cells of sweat glands. (Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12933FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12934,141559,'Extravasation of blood into the skin, resulting in a nonelevated, rounded or irregular, blue or purplish patch, larger than a petechia.','en',1,'2007-10-18 04:28:24',1,NULL,'12934FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12935,141562,'Congenital downward displacement of the tricuspid valve with the septal and posterior leaflets being attached to the wall of the right ventricle.','en',1,'2007-10-18 04:28:24',1,NULL,'12935FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12936,141563,'Congenital downward displacement of the tricuspid valve with the septal and posterior leaflets being attached to the wall of the right ventricle.','en',1,'2007-10-18 04:28:24',1,NULL,'12936FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12937,141564,'A highly fatal, acute hemorrhagic fever, clinically very similar to MARBURG VIRUS DISEASE, caused by the EBOLA VIRUS, first occurring in the Sudan and adjacent northwestern (what was then) Zaire. The natural reservoir and mode of transmission of the virus are unknown, but secondary infection is by direct contact with infected blood and other body secretions. (From Dorland, 28th ed)','en',1,'2007-10-18 04:28:24',1,'2014-10-09 16:07:22','12937FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12938,141565,'A subtype of epilepsy characterized by seizures that are consistently provoked by a certain specific stimulus. Auditory, visual, and somatosensory stimuli as well as the acts of writing, reading, eating, and decision making are examples of events or activities that may induce seizure activity in affected individuals. (From Neurol Clin 1994 Feb;12(1):57-8)','en',1,'2007-10-18 04:28:24',1,NULL,'12938FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12940,141568,'A systemic non-venereal infection of the tropics caused by Treponema pallidum subspecies pertenue.','en',1,'2007-10-18 04:28:24',1,NULL,'12940FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12941,141569,'A systemic non-venereal infection of the tropics caused by Treponema pallidum subspecies pertenue.','en',1,'2007-10-18 04:28:24',1,NULL,'12941FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12942,141571,'The primary sore of syphilis, a painless indurated, eroded papule, occurring at the site of entry of the infection.','en',1,'2007-10-18 04:28:24',1,NULL,'12942FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12943,141576,'An affective disorder manifested by either a dysphoric mood or loss of interest or pleasure in usual activities. The mood disturbance is prominent and relatively persistent.','en',1,'2007-10-18 04:28:24',1,NULL,'12943FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12944,141577,'A heterogenous group of degenerative syndromes marked by progressive cerebellar dysfunction either in isolation or combined with other neurologic manifestations. Sporadic and inherited subtypes occur. Inheritance patterns include autosomal dominant, autosomal recessive, and X-linked.','en',1,'2007-10-18 04:28:24',1,NULL,'12944FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12945,141578,'Involuntary shock-like contractions, irregular in rhythm and amplitude, followed by relaxation, of a muscle or a group of muscles. This condition may be a feature of some CENTRAL NERVOUS SYSTEMS DISEASES (e.g., EPILEPSY, MYOCLONIC). Nocturnal myoclonus may represent a normal physiologic event or occur as the principal feature of the NOCTURNAL MYOCLONUS SYNDROME. (From Adams et al., Principles of Neurology, 6th ed, pp102-3).','en',1,'2007-10-18 04:28:24',1,NULL,'12945FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12946,141579,'Syphilis acquired in utero and manifested by any of several characteristic tooth (Hutchinson''s teeth) or bone malformations and by active mucocutaneous syphilis at birth or shortly thereafter. Ocular and neurologic changes may also occur.','en',1,'2007-10-18 04:28:24',1,NULL,'12946FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12947,141580,'Syphilis acquired in utero and manifested by any of several characteristic tooth (Hutchinson''s teeth) or bone malformations and by active mucocutaneous syphilis at birth or shortly thereafter. Ocular and neurologic changes may also occur.','en',1,'2007-10-18 04:28:24',1,NULL,'12947FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12948,141581,'Syphilis acquired in utero and manifested by any of several characteristic tooth (Hutchinson''s teeth) or bone malformations and by active mucocutaneous syphilis at birth or shortly thereafter. Ocular and neurologic changes may also occur.','en',1,'2007-10-18 04:28:24',1,NULL,'12948FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12949,141584,'Pain in the ear.','en',1,'2007-10-18 04:28:24',1,'2016-10-03 20:35:49','12949FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12950,141591,'A syndrome produced by severe protein deficiency, characterized by retarded growth, changes in skin and hair pigment, edema, and pathologic changes in the liver, including fatty infiltration, necrosis, and fibrosis. The word is a local name in Gold Coast, Africa, meaning \"displaced child\". Although first reported from Africa, kwashiorkor is now known throughout the world, but mainly in the tropics and subtropics. It is considered to be related to marasmus. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12950FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12951,141593,'A heterogeneous group of nonprogressive motor disorders caused by chronic brain injuries that originate in the prenatal period, perinatal period, or first few years of life. The four major subtypes are spastic, athetoid, ataxic, and mixed cerebral palsy, with spastic forms being the most common. The motor disorder may range from difficulties with fine motor control to severe spasticity (see MUSCLE SPASTICITY) in all limbs. Spastic diplegia (Little disease) is the most common subtype, and is characterized by spasticity that is more prominent in the legs than in the arms. Pathologically, this condition may be associated with LEUKOMALACIA, PERIVENTRICULAR. (From Dev Med Child Neurol 1998 Aug;40(8):520-7)','en',1,'2007-10-18 04:28:24',1,NULL,'12951FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12952,141595,'A condition characterized by focal DYSTONIA that progresses to involuntary spasmodic contractions of the muscles of the legs, trunk, arms, and face. The hands are often spared, however, sustained axial and limb contractions may lead to a state where the body is grossly contorted. Onset is usually in the first or second decade. Familial patterns of inheritance, primarily autosomal dominant with incomplete pentrance, have been identified. (Adams et al., Principles of Neurology, 6th ed, p1078)','en',1,'2007-10-18 04:28:24',1,NULL,'12952FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12953,141596,'Difficult childbirth or labor.','en',1,'2007-10-18 04:28:24',1,'2013-06-01 19:39:20','12953FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12954,141598,'Excessive functional activity of the thyroid gland.','en',1,'2007-10-18 04:28:24',1,NULL,'12954FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12955,141601,'Clinically atypical nevi (usually exceeding 5 mm in diameter and having variable pigmentation and ill defined borders) with an increased risk for development of non-familial cutaneous malignant melanoma. Biopsies show melanocytic dysplasia. Nevi are clinically and histologically identical to the precursor lesions for melanoma in the B-K mole syndrome. (Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12955FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
