(12966,141624,'Acquired or developmental conditions marked by an impaired ability to comprehend or generate spoken forms of language.','en',1,'2007-10-18 04:28:24',1,NULL,'12966FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12967,141625,'A heterogeneous group of nonprogressive motor disorders caused by chronic brain injuries that originate in the prenatal period, perinatal period, or first few years of life. The four major subtypes are spastic, athetoid, ataxic, and mixed cerebral palsy, with spastic forms being the most common. The motor disorder may range from difficulties with fine motor control to severe spasticity (see MUSCLE SPASTICITY) in all limbs. Spastic diplegia (Little disease) is the most common subtype, and is characterized by spasticity that is more prominent in the legs than in the arms. Pathologically, this condition may be associated with LEUKOMALACIA, PERIVENTRICULAR. (From Dev Med Child Neurol 1998 Aug;40(8):520-7)','en',1,'2007-10-18 04:28:24',1,NULL,'12967FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12968,141626,'An X-linked syndrome occurring predominantly in males, with onset in childhood and characterized by nail dystrophy, reticular cutaneous hyperpigmentation, mucosal leukokeratosis, and pancytopenia resembling that of Fanconi. It is also known as Zinsser-Cole-Engman syndrome. (From Dorland, 28th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12968FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12969,141628,'A condition due to congenital lack of thyroid hormone, marked by arrested physical and mental development, dystrophy of the bones and soft parts, and lowered basal metabolism. It is the congenital form of thyroid deficiency, while MYXEDEMA is the acquired form. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12969FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12970,141629,'Tumors or cancer of the OVARY.','en',1,'2007-10-18 04:28:24',1,NULL,'12970FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12971,141630,'An immunologic deficiency state characterized by selective deficiencies of one or more, but not all, classes of immunoglobulins.','en',1,'2007-10-18 04:28:24',1,NULL,'12971FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12972,141635,'Subjective cutaneous sensations (e.g., cold, warmth, tingling, pressure, etc.) that are experienced spontaneously in the absence of stimulation.','en',1,'2007-10-18 04:28:24',1,'2016-02-25 03:41:30','12972FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12973,141638,'Chronic, non-specific disorders of unknown etiology. Includes Crohn disease and ulcerative colitis. Extracolonic manifestations are often associated with Inflammatory Bowel Disease (IBD) and involve the liver, joints and skin.','en',1,'2007-10-18 04:28:24',1,NULL,'12973FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12974,141639,'Impairment of the ability to perform smoothly coordinated voluntary movements. This condition may affect the limbs, trunk, eyes, pharnyx, larnyx, and other structures. Ataxia may result from impaired sensory or motor function. Sensory ataxia may result from posterior column injury or PERIPHERAL NERVE DISEASES. Motor ataxia may be associated with CEREBELLAR DISEASES; CEREBRAL CORTEX diseases; THALAMIC DISEASES; BASAL GANGLIA DISEASES; injury to the RED NUCLEUS; and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'12974FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12975,141641,'An infectious disease of the skin caused by Treponema carateum that occurs only in the western hemisphere. Age of onset is between 10 and 20 years of age. This condition is characterized by marked changes in the skin color and is believed to be transmitted by direct person-to-person contact.','en',1,'2007-10-18 04:28:24',1,NULL,'12975FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12976,141642,'Disorders of increased melanin pigmentation that develop without preceding inflammatory disease.','en',1,'2007-10-18 04:28:24',1,NULL,'12976FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12978,141645,'Disorders of speech articulation caused by imperfect coordination of pharnyx, larnyx, tongue, or face muscles. This may result from CRANIAL NERVE DISEASES; NEUROMUSCULAR DISEASES; CEREBELLAR DISEASES; BASAL GANGLIA DISEASES; BRAIN STEM diseases; or diseases of the corticobulbar tracts (see PYRAMIDAL TRACTS). The cortical language centers are intact in this condition. (From Adams et al., Principles of Neurology, 6th ed, p489)','en',1,'2007-10-18 04:28:24',1,'2016-05-14 01:42:06','12978FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12979,141647,'Obstruction of the intestines that is functional, not mechanical.','en',1,'2007-10-18 04:28:24',1,NULL,'12979FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
