(12983,141683,'An X-linked recessive muscle disease caused by an inability to synthesize DYSTROPHIN, which is involved with maintaining the integrity of the sarcolemma. Muscle fibers undergo a process that features degeneration and regeneration. Clinical manifestations include proximal weakness in the first few years of life, pseudohypertrophy, cardiomyopathy (see MYOCARDIAL DISEASES), and an increased incidence of impaired mentation. Becker muscular dystrophy is a closely related condition featuring a later onset of disease (usually adolescence) and a slowly progressive course. (Adams et al., Principles of Neurology, 6th ed, p1415)','en',1,'2007-10-18 04:28:24',1,NULL,'12983FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12984,141685,'A benign, autosomally recessive inherited hyperbilirubinemia characterized by the presence of a dark pigment in the centrilobular region of the liver cells. There is a functional defect in biliary excretion of bilirubin, cholephilic dyes, and porphyrins. Affected persons may be asymptomatic or have vague constitutional or gastrointestional symptoms. The liver may be slightly enlarged, and oral and intravenous cholangiography fails to visualize the biliary tract.','en',1,'2007-10-18 04:28:24',1,NULL,'12984FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12985,141687,'A syndrome characterized by marked limitation of abduction of the eye, variable limitation of adduction and retraction of the globe, and narrowing of the palpebral fissure on attempted adduction. The condition is caused by aberrant innervation of the lateral rectus by fibers of the oculomotor nerve. There are three subtypes: type 1 (associated with loss of abduction), type 2 (associated with loss of adduction), and type 3 (loss of abduction and adduction). It is usually caused by congenital hypoplasia of the abducens nerve or nucleus, but may rarely represent an acquired syndrome. (Adams et al., Principles of Neurology, 6th ed, p271; Miller et al., Clinical Neuro-Ophthalmology, 4th ed, p691)','en',1,'2007-10-18 04:28:24',1,NULL,'12985FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
