(13022,141804,'A common congenital midline defect of fusion of the vertebral arch without protrusion of the spinal cord or meninges. The lesion is also covered by skin. L5 and S1 are the most common vertebrae involved. The condition may be associated with an overlying area of hyperpigmented skin, a dermal sinus, or an abnormal patch of hair. The majority of individuals with this malformation are asymptomatic although there is an increased incidence of tethered cord syndrome and lumbar SPONDYLOSIS. (From Joynt, Clinical Neurology, 1992, Ch55, p34)','en',1,'2007-10-18 04:28:24',1,NULL,'13022FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13023,141806,'A group of conditions of diverse etiologies characterized by the accumulation of insoluble fibrillar proteins (amyloid) in various organs and tissues of the body such that vital function is compromised. The associated disease states may be inflammatory, hereditary, or neoplastic, and the deposition can be localized or generalized or systemic. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13023FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13024,141807,'Hereditary conditions that feature progressive visual loss in association with optic atrophy. Relatively common forms include autosomal dominant optic atrophy and Leber hereditary optic neuropathy. The latter is a rare, maternal linked, genetic disorder that is characterized by progressive bilateral optic nerve degeneration. Male offspring are predominantly affected and develop a loss of central vision in the second or third decade of life. Retinal ganglion cells and optic nerve axons that subserve central vision degenerate. The disease is associated with missense mutations of mitochondrial DNA. In some pedigrees this condition is associated with DYSTONIA, sensory neuropathies, PRE-EXCITATION SYNDROMES, and other disorders. (From Biochim Biophys Acta 1999 Feb 9;1410(2):147-58)','en',1,'2007-10-18 04:28:24',1,NULL,'13024FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
