(13046,141876,'A group of disorders marked by progressive degeneration of motor neurons in the spinal cord resulting in weakness and muscular atrophy, usually without evidence of injury to the corticospinal tracts. Diseases in this category include Werdnig-Hoffmann disease and later onset SPINAL MUSCULAR ATROPHIES OF CHILDHOOD, most of which are hereditary. The adult onset variant of this condition is referred to as progressive muscular atrophy. (Adams et al., Principles of Neurology, 6th ed, p1089)','en',1,'2007-10-18 04:28:24',1,NULL,'13046FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13047,141877,'A rare sometimes familial disorder of the renal tubule characterized by the inability to excrete urine of normal acidity. This leads to a hyperchloremic acidosis which is often associated with one or more secondary complications such as hypercalcinuria with nephrolithiasis and nephrocalcinosis, rickets, or osteomalacia and severe potassium depletion.','en',1,'2007-10-18 04:28:24',1,NULL,'13047FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13048,141879,'A general term for a group of inherited disorders which are characterized by progressive degeneration of skeletal muscles (MUSCLE, SKELETAL).','en',1,'2007-10-18 04:28:24',1,NULL,'13048FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13050,141882,'Subjectively experienced sensations in the absence of an appropriate stimulus, but which are regarded by the individual as real. They may be of organic origin or associated with MENTAL DISORDERS.','en',1,'2007-10-18 04:28:24',1,NULL,'13050FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13051,141884,'A disorder whose predominant feature is a loss or alteration in physical functioning that suggests a physical disorder but that is actually a direct expression of a psychological conflict or need.','en',1,'2007-10-18 04:28:24',1,NULL,'13051FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13052,141885,'State in which an individual perceives or experiences a sensation of unreality concerning the self or the environment; it is seen in disorders such as schizophrenia, affection disorders, organic mental disorders, and personality disorders. (APA, Thesaurus of Psychological Index Terms, 8th ed.)','en',1,'2007-10-18 04:28:24',1,NULL,'13052FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13053,141886,'Involuntary movements of the eye that are divided into two types, jerk and pendular. Jerk nystagmus has a slow phase in one direction followed by a corrective fast phase in the opposite direction, and is usually caused by central or peripheral vestibular dysfunction. Pendular nystagmus features oscillations that are of equal velocity in both directions and this condition is often associated with visual loss early in life. (Adams et al., Principles of Neurology, 6th ed, p272)','en',1,'2007-10-18 04:28:24',1,NULL,'13053FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13054,141888,'A personality disorder whose essential feature is a pervasive pattern of disregard for, and violation of, the rights of others that begins in childhood or early adolescence and continues into adulthood. The individual must be at least age 18 and must have a history of some symptoms of CONDUCT DISORDER before age 15. (From DSM-IV, 1994)','en',1,'2007-10-18 04:28:24',1,NULL,'13054FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13055,141889,'A major deviation from normal patterns of behavior.','en',1,'2007-10-18 04:28:24',1,NULL,'13055FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13056,141891,'Infection with nematodes of the genus STRONGYLOIDES. The presence of larvae may produce pneumonitis and the presence of adult worms in the intestine could lead to moderate to severe diarrhea.','en',1,'2007-10-18 04:28:24',1,NULL,'13056FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13057,141892,'The commonest and least serious of the deep mycoses, characterized by nodular lesions of the cutaneous and subcutaneous tissues. It is caused by inhalation of contaminated dust or by infection of a wound.','en',1,'2007-10-18 04:28:24',1,NULL,'13057FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13058,141895,'A mycosis affecting the skin, mucous membranes, lymph nodes, and internal organs. It is caused by Paracoccidioides brasiliensis. It is also called paracoccidioidal granuloma. Superficial resemblance of P. brasiliensis to Blastomyces brasiliensis (BLASTOMYCES) may cause misdiagnosis.','en',1,'2007-10-18 04:28:24',1,NULL,'13058FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13059,141897,'A disease characterized by the chronic, progressive spread of lesions from New World cutaneous leishmaniasis caused by species of the L. braziliensis complex to the nasal, pharyngeal, and buccal mucosa some time after the appearance of the initial cutaneous lesion. Nasal obstruction and epistaxis are frequent presenting symptoms.','en',1,'2007-10-18 04:28:24',1,NULL,'13059FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13060,141899,'A disorder characterized by reduction in the elements involved in blood coagulation due to their utilization in widespread blood clotting within the vessels. The activation of the clotting mechanism may arise from any of a number of disorders. In the late stages, it is marked by profuse hemorrhaging. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,'2012-06-12 22:55:41','13060FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13061,141902,'An acute infectious, usually self-limited, disease believed to represent activation of latent varicella-zoster virus (HERPESVIRUS 3, HUMAN) in those who have been rendered partially immune after a previous attack of chickenpox. It involves the sensory ganglia and their areas of innervation and is characterized by severe neuralgic pain along the distribution of the affected nerve and crops of clustered vesicles over the area. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13061FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13062,141903,'A group of acute infections caused by herpes simplex virus type 1 or type 2 that is characterized by the development of one or more small fluid-filled vesicles with a raised erythematous base on the skin or mucous membrane. It occurs as a primary infection or recurs due to a reactivation of a latent infection. (Dorland, 27th ed.)','en',1,'2007-10-18 04:28:24',1,NULL,'13062FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13063,141904,'Superficial infections of the skin or its appendages by any of various fungi.','en',1,'2007-10-18 04:28:24',1,NULL,'13063FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13064,141905,'Infection with a fungus of the species CRYPTOCOCCUS NEOFORMANS.','en',1,'2007-10-18 04:28:24',1,NULL,'13064FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13065,141906,'Infection with a fungus of the genus COCCIDIOIDES, species C. immitis. The primary form is an acute, benign, self-limited respiratory infection due to inhalation of spores and varying in severity. The secondary form is a virulent, severe, chronic, progressive granulomatous disease with systemic involvement. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13065FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13066,141910,'Infection with a fungus of the genus CANDIDA. It is usually a superficial infection of the moist areas of the body and is generally caused by CANDIDA ALBICANS. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13066FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13067,141911,'A fungal infection that may appear in two forms: 1) a primary lesion characterized by the formation of a small cutaneous nodule and small nodules along the lymphatics that may heal within several months; and 2) chronic granulomatous lesions characterized by thick crusts, warty growths, and unusual vascularity and infection in the middle or upper lobes of the lung.','en',1,'2007-10-18 04:28:24',1,NULL,'13067FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13068,141916,'Splitting or dissection of an arterial wall by blood entering through an intimal tear or by interstitial hemorrhage. It is most common in the aorta.','en',1,'2007-10-18 04:28:24',1,NULL,'13068FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13069,141918,'Splitting or dissection of an arterial wall by blood entering through an intimal tear or by interstitial hemorrhage. It is most common in the aorta.','en',1,'2007-10-18 04:28:24',1,NULL,'13069FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13070,141919,'Aneurysm of a coronary vessel. A coronary artery aneurysm is rarely congenital; it is usually due to atherosclerosis, inflammatory processes, or a coronary fistula. (From Stedman, 26th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13070FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13071,141928,'An intervertebral disk in which the nucleus pulposus has protruded through surrounding fibrocartilage. This occurs most frequently in the lower lumbar region.','en',1,'2007-10-18 04:28:24',1,NULL,'13071FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
