(13073,141930,'Forward displacement of one vertebra over another.','en',1,'2007-10-18 04:28:24',1,NULL,'13073FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13074,141933,'A mental state characterized by bewilderment, emotional disturbance, lack of clear thinking, and perceptual disorientation.','en',1,'2007-10-18 04:28:24',1,NULL,'13074FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13075,141934,'A type of schizophrenia characterized by frequent incoherence; marked loosening of associations, or grossly disorganized behavior and flat or grossly inappropriate affect that does not meet the criteria for the catatonic type; associated features include extreme social withdrawal, grimacing, mannerisms, mirror gazing, inappropriate giggling, and other odd behavior. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13075FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13076,141935,'A type of schizophrenia characterized by frequent incoherence; marked loosening of associations, or grossly disorganized behavior and flat or grossly inappropriate affect that does not meet the criteria for the catatonic type; associated features include extreme social withdrawal, grimacing, mannerisms, mirror gazing, inappropriate giggling, and other odd behavior. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13076FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13078,141937,'Loss of or impaired ability to smell. This may be caused by OLFACTORY NERVE DISEASES; PARANASAL SINUS DISEASES; viral RESPIRATORY TRACT INFECTIONS; CRANIOCEREBRAL TRAUMA; SMOKING; and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'13078FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13079,141940,'Diseases of lymph or lymph vessels.','en',1,'2007-10-18 04:28:24',1,NULL,'13079FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13081,141951,'A nutritional condition produced by a deficiency of VITAMIN D in the diet, insufficient production of vitamin D in the skin, inadequate absorption of vitamin D from the diet, or abnormal conversion of vitamin D to its bioactive metabolites. It is manifested clinically as RICKETS in children and OSTEOMALACIA in adults. (From Cecil Textbook of Medicine, 19th ed, p1406)','en',1,'2007-10-18 04:28:24',1,NULL,'13081FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13082,141962,'Diseases of the tenth cranial nerve, including brain stem lesions involving its nuclei (solitary, ambiguus, and dorsal motor), nerve fascicles, and intracranial and extracranial course. Clinical manifestations may include dysphagia, vocal cord weakness, and alterations of parasympathetic tone in the thorax and abdomen.','en',1,'2007-10-18 04:28:24',1,NULL,'13082FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13083,141979,'Diseases of the urinary tract in both male and female. It does not include the male genitalia for which UROGENITAL DISEASES is used for general discussions of diseases of both the urinary tract and the genitalia.','en',1,'2007-10-18 04:28:24',1,NULL,'13083FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13084,141986,'Diseases of the parasympathetic or sympathetic divisions of the AUTONOMIC NERVOUS SYSTEM; which has components located in the CENTRAL NERVOUS SYSTEM and PERIPHERAL NERVOUS SYSTEM. Autonomic dysfunction may be associated with HYPOTHALAMIC DISEASES; BRAIN STEM disorders; SPINAL CORD DISEASES; and PERIPHERAL NERVOUS SYSTEM DISEASES. Manifestations include impairments of vegetative functions including the maintenance of BLOOD PRESSURE; HEART RATE; pupil function; SWEATING; REPRODUCTIVE AND URINARY PHYSIOLOGY; and DIGESTION.','en',1,'2007-10-18 04:28:24',1,NULL,'13084FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13086,142000,'A saclike, glandular diverticulum on each ductus deferens in male vertebrates. It is united with the excretory duct and serves for temporary storage of semen. (From McGraw-Hill Dictionary of Scientific and Technical Terms, 4th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13086FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13087,142011,'An autosomal recessive inherited disorder with multiple forms of phenotypic expression, caused by a defect in the oxidative decarboxylation of branched-chain ammino acids (AMINO ACIDS, BRANCHED-CHAIN). These metabolites accumulate in body fluids and render a \"maple syrup\" odor. The disease is divided into classic, intermediate, intermittent, and thiamine responsive subtypes. The classic form presents in the first week of life with ketoacidosis, hypoglycemia, emesis, neonatal seizures, and hypertonia. The intermediate and intermittent forms present in childhood or later with acute episodes of ataxia and vomiting. (From Adams et al., Principles of Neurology, 6th ed, p936)','en',1,'2007-10-18 04:28:24',1,NULL,'13087FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13088,142013,'A group of disorders characterized by the excessive production of porphyrins or their precursors that arises from abnormalities in the regulation of the porphyrin-heme pathway. The porphyrias are usually divided into three broad groups, erythropoietic (PORPHYRIA, ERYTHROPOIETIC), hepatic (PORPHYRIA, HEPATIC), and erythrohepatic (PORPHYRIA, ERYTHROHEPATIC), according to the major sites of abnormal porphyrin synthesis.','en',1,'2007-10-18 04:28:24',1,NULL,'13088FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13089,142017,'Disorders in the processing of phosphorus in the body: its absorption, transport, storage, and utilization.','en',1,'2007-10-18 04:28:24',1,NULL,'13089FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13090,142020,'Diseases of the parasympathetic or sympathetic divisions of the AUTONOMIC NERVOUS SYSTEM; which has components located in the CENTRAL NERVOUS SYSTEM and PERIPHERAL NERVOUS SYSTEM. Autonomic dysfunction may be associated with HYPOTHALAMIC DISEASES; BRAIN STEM disorders; SPINAL CORD DISEASES; and PERIPHERAL NERVOUS SYSTEM DISEASES. Manifestations include impairments of vegetative functions including the maintenance of BLOOD PRESSURE; HEART RATE; pupil function; SWEATING; REPRODUCTIVE AND URINARY PHYSIOLOGY; and DIGESTION.','en',1,'2007-10-18 04:28:24',1,NULL,'13090FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13091,142024,'Diseases of the parasympathetic or sympathetic divisions of the AUTONOMIC NERVOUS SYSTEM; which has components located in the CENTRAL NERVOUS SYSTEM and PERIPHERAL NERVOUS SYSTEM. Autonomic dysfunction may be associated with HYPOTHALAMIC DISEASES; BRAIN STEM disorders; SPINAL CORD DISEASES; and PERIPHERAL NERVOUS SYSTEM DISEASES. Manifestations include impairments of vegetative functions including the maintenance of BLOOD PRESSURE; HEART RATE; pupil function; SWEATING; REPRODUCTIVE AND URINARY PHYSIOLOGY; and DIGESTION.','en',1,'2007-10-18 04:28:24',1,NULL,'13091FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13092,142036,'A general term encompassing lower MOTOR NEURON DISEASE; PERIPHERAL NERVOUS SYSTEM DISEASES; and certain MUSCULAR DISEASES. Manifestations include MUSCLE WEAKNESS; FASCICULATION; muscle ATROPHY; SPASM; MYOKYMIA; MUSCLE HYPERTONIA, myalgias, and MUSCLE HYPOTONIA.','en',1,'2007-10-18 04:28:24',1,NULL,'13092FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13093,142039,'Acquired, familial, and congenital disorders of skeletal muscle (MUSCLE, SKELETAL) and smooth muscle (MUSCLE, SMOOTH).','en',1,'2007-10-18 04:28:24',1,'2013-05-10 23:23:12','13093FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13094,142047,'A nutritional condition produced by a deficiency of magnesium in the diet, characterized by anorexia, nausea, vomiting, lethargy, and weakness. Symptoms are paresthesias, muscle cramps, irritability, decreased attention span, and mental confusion, possibly requiring months to appear. Deficiency of body magnesium can exist even when serum values are normal. In addition, magnesium deficiency may be organ-selective, since certain tissues become deficient before others. (Harrison''s Principles of Internal Medicine, 12th ed, p1936)','en',1,'2007-10-18 04:28:24',1,NULL,'13094FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13096,142049,'Generic term for diseases caused by an abnormal metabolic process. It can be congenital due to inherited enzyme abnormality (METABOLISM, INBORN ERRORS) or acquired due to disease of an endocrine organ or failure of a metabolically important organ such as the liver. (Stedman, 26th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13096FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13097,142052,'Disorders of the blood and blood forming tissues.','en',1,'2007-10-18 04:28:24',1,NULL,'13097FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13098,142064,'Disorders in the processing of iron in the body: its absorption, transport, storage, and utilization. (From Mosby''s Medical, Nursing, & Allied Health Dictionary, 4th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13098FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13099,142065,'Diseases, dysfunctions, or disorders of or located in the iris.','en',1,'2007-10-18 04:28:24',1,NULL,'13099FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13100,142067,'Disorders caused by abnormal or absent immunologic mechanisms, whether humoral, cell-mediated or both.','en',1,'2007-10-18 04:28:24',1,NULL,'13100FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13101,142068,'Neoplastic, inflammatory, infectious, and other diseases of the hypothalamus. Clinical manifestations include appetite disorders; AUTONOMIC NERVOUS SYSTEM DISEASES; SLEEP DISORDERS; behavioral symptoms related to dysfunction of the LIMBIC SYSTEM; and neuroendocrine disorders.','en',1,'2007-10-18 04:28:24',1,NULL,'13101FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13102,142070,'Diseases of the twelfth cranial (hypoglossal) nerve or nuclei. The nuclei and fascicles of the nerve are located in the medulla, and the nerve exits the skull via the hypoglossal foramen and innervates the muscles of the tongue. Lower brain stem diseases, including ischemia and MOTOR NEURON DISEASES may affect the nuclei or nerve fascicles. The nerve may also be injured by diseases of the posterior fossa or skull base. Clinical manifestations include unilateral weakness of tongue musculature and lingual dysarthria, with deviation of the tongue towards the side of weakness upon attempted protrusion.','en',1,'2007-10-18 04:28:24',1,NULL,'13102FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13103,142072,'Metabolic disorders affecting amino acid metabolism. They are present at birth, although they may not become symptomatic until later in life. The majority of these disorders are inherited and present in the neonatal period with metabolic disturbances (e.g., ACIDOSIS) and neurologic manifestations.','en',1,'2007-10-18 04:28:24',1,NULL,'13103FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13105,142091,'The state of the body in relation to the intake and excretion of water and electrolytes, particularly sodium and potassium. It exists in a metabolic balance internally with BODY FLUID COMPARTMENTS, total BODY WATER, BLOOD VOLUME, EXTRACELLULAR SPACE, etc., externally through sensible and insensible SWEATING. The hypothalamus controls water balance. (Dorland, 27th ed; Mountcastle, Medical Physiology, 14th ed, 1980, p1152)','en',1,'2007-10-18 04:28:24',1,NULL,'13105FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13106,142093,'Diseases of the sweat glands.','en',1,'2007-10-18 04:28:24',1,NULL,'13106FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13108,142114,'An autosomal recessive inherited disorder with multiple forms of phenotypic expression, caused by a defect in the oxidative decarboxylation of branched-chain ammino acids (AMINO ACIDS, BRANCHED-CHAIN). These metabolites accumulate in body fluids and render a \"maple syrup\" odor. The disease is divided into classic, intermediate, intermittent, and thiamine responsive subtypes. The classic form presents in the first week of life with ketoacidosis, hypoglycemia, emesis, neonatal seizures, and hypertonia. The intermediate and intermittent forms present in childhood or later with acute episodes of ataxia and vomiting. (From Adams et al., Principles of Neurology, 6th ed, p936)','en',1,'2007-10-18 04:28:24',1,NULL,'13108FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
