(13115,142131,'Lymph glad located in the pharynx or throat.','en',1,'2007-10-18 04:28:24',1,NULL,'13115FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13116,142132,'Diseases of the vestibular and/or cochlear (acoustic) nerves, which join to form the vestibulocochlear nerve. VESTIBULAR NEURITIS, cochlear neuritis, and ACOUSTIC NEUROMAS are relatively common conditions that affect these nerves. Clinical manifestations vary with which nerve is primarily affected, and include hearing loss, vertigo, and tinnitus.','en',1,'2007-10-18 04:28:24',1,NULL,'13116FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13117,142136,'The natural enzymatic dissolution of FIBRIN.','en',1,'2007-10-18 04:28:24',1,NULL,'13117FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13118,142137,'Hereditary disorder transmitted by an autosomal dominant gene and characterized by multiple exostoses (multiple osteochondromas) near the ends of long bones. The genetic abnormality results in a defect in the osteoclastic activity at the metaphyseal ends of the bone during the remodeling process in childhood or early adolescence. The metaphyses develop benign, bony outgrowths often capped by cartilage. A small number undergo neoplastic transformation.','en',1,'2007-10-18 04:28:24',1,NULL,'13118FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13119,142138,'Abnormal increase in eosinophils in the blood, tissues or organs.','en',1,'2007-10-18 04:28:24',1,NULL,'13119FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13121,142142,'Partial or complete displacement of a tooth from its alveolar support. It is commonly the result of trauma. (From Boucher''s Clinical Dental Terminology, 4th ed, p312)','en',1,'2007-10-18 04:28:24',1,NULL,'13121FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13122,142151,'Incomplete rupture of the zonule with the displaced lens remaining behind the pupil. In dislocation, or complete rupture, the lens is displaced forward into the anterior chamber or backward into the vitreous body. When congenital, this condition is known as ECTOPIA LENTIS.','en',1,'2007-10-18 04:28:24',1,NULL,'13122FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
