(13136,142207,'A highly contagious infectious disease caused by MORBILLIVIRUS, common among children but also seen in the nonimmune of any age, in which the virus enters the respiratory tract via droplet nuclei and multiplies in the epithelial cells, spreading throughout the reticuloendothelial system. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13136FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13137,142210,'Infections with viruses of the genus HANTAVIRUS. This is associated with at least four clinical syndromes: HEMORRHAGIC FEVER WITH RENAL SYNDROME caused by viruses of the Hantaan group; a milder form of HFRS caused by Seoul and related viruses; nephropathia epidemica caused by Puumala and related viruses; and HANTAVIRUS PULMONARY SYNDROME caused by Muerto Canyon virus.','en',1,'2007-10-18 04:28:24',1,NULL,'13137FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13138,142213,'Bacteria which lose crystal violet stain but are stained pink when treated by Gram''s method.','en',1,'2007-10-18 04:28:24',1,NULL,'13138FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13139,142214,'Infection with CYTOMEGALOVIRUS, characterized by enlarged cells bearing intranuclear inclusions. Infection may be in almost any organ, but the salivary glands are the most common site in children, as are the lungs in adults.','en',1,'2007-10-18 04:28:24',1,NULL,'13139FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13142,142226,'Infection with CYTOMEGALOVIRUS, characterized by enlarged cells bearing intranuclear inclusions. Infection may be in almost any organ, but the salivary glands are the most common site in children, as are the lungs in adults.','en',1,'2007-10-18 04:28:24',1,NULL,'13142FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13144,142240,'A chronic form of cutaneous lupus erythematosus (LUPUS ERYTHEMATOSUS, CUTANEOUS) in which the skin lesions mimic those of the systemic form but in which systemic signs are rare. It is characterized by the presence of discoid skin plaques showing varying degrees of edema, erythema, scaliness, follicular plugging, and skin atrophy. Lesions are surrounded by an elevated erythematous border. The condition typically involves the face and scalp, but widespread dissemination may occur.','en',1,'2007-10-18 04:28:24',1,'2015-04-06 16:28:24','13144FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13145,142244,'Inflammation of an intervertebral disk or disk space which may lead to disk erosion. Until recently, discitis has been defined as a nonbacterial inflammation and has been attributed to aseptic processes (e.g., chemical reaction to an injected substance). However, recent studies provide evidence that infection may be the initial cause, but perhaps not the promoter, of most cases of discitis. Discitis has been diagnosed in patients following discography, myelography, lumbar puncture, paravertebral injection, and obstetrical epidural anesthesia. Discitis following chemonucleolysis (especially with chymopapain) is attributed to chemical reaction by some and to introduction of microorganisms by others.','en',1,'2007-10-18 04:28:24',1,NULL,'13145FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13146,142247,'Inflammation of the urethra. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13146FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13147,142249,'Observation of discharge coming from the eye.','en',1,'2007-10-18 04:28:24',1,'2015-10-05 18:03:33','13147FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13148,142258,'A metabolic disorder due to disorders in the production or release of vasopressin. It is characterized by the chronic excretion of large amounts of low specific gravity urine and great thirst.','en',1,'2007-10-18 04:28:24',1,NULL,'13148FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13149,142263,'A visual symptom in which a single object is perceived by the visual cortex as two objects rather than one. Disorders associated with this condition include REFRACTIVE ERRORS; STRABISMUS; OCULOMOTOR NERVE DISEASES; TROCHLEAR NERVE DISEASES; ABDUCENS NERVE DISEASES; and diseases of the BRAIN STEM and OCCIPITAL LOBE.','en',1,'2007-10-18 04:28:24',1,NULL,'13149FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13150,142265,'A heterogeneous group of nonprogressive motor disorders caused by chronic brain injuries that originate in the prenatal period, perinatal period, or first few years of life. The four major subtypes are spastic, athetoid, ataxic, and mixed cerebral palsy, with spastic forms being the most common. The motor disorder may range from difficulties with fine motor control to severe spasticity (see MUSCLE SPASTICITY) in all limbs. Spastic diplegia (Little disease) is the most common subtype, and is characterized by spasticity that is more prominent in the legs than in the arms. Pathologically, this condition may be associated with LEUKOMALACIA, PERIVENTRICULAR. (From Dev Med Child Neurol 1998 Aug;40(8):520-7)','en',1,'2007-10-18 04:28:24',1,NULL,'13150FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13151,142267,'Infection with tapeworms of the genus Diphyllobothrium.','en',1,'2007-10-18 04:28:24',1,NULL,'13151FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13152,142268,'A localized infection of mucous membranes or skin caused by toxigenic strains of CORYNEBACTERIUM DIPHTHERIAE. It is characterized by the presence of a pseudomembrane at the site of infection. DIPHTHERIA TOXIN, produced by C. diphtheriae, can cause myocarditis, polyneuritis, and other systemic toxic effects.','en',1,'2007-10-18 04:28:24',1,NULL,'13152FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13153,142270,'A localized infection of mucous membranes or skin caused by toxigenic strains of CORYNEBACTERIUM DIPHTHERIAE. It is characterized by the presence of a pseudomembrane at the site of infection. DIPHTHERIA TOXIN, produced by C. diphtheriae, can cause myocarditis, polyneuritis, and other systemic toxic effects.','en',1,'2007-10-18 04:28:24',1,NULL,'13153FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13154,142271,'A localized infection of mucous membranes or skin caused by toxigenic strains of CORYNEBACTERIUM DIPHTHERIAE. It is characterized by the presence of a pseudomembrane at the site of infection. DIPHTHERIA TOXIN, produced by C. diphtheriae, can cause myocarditis, polyneuritis, and other systemic toxic effects.','en',1,'2007-10-18 04:28:24',1,NULL,'13154FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13155,142276,'Infections with nematodes of the order ENOPLIDA.','en',1,'2007-10-18 04:28:24',1,NULL,'13155FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13156,142277,'Anemia characterized by the presence of erythroblasts containing excessive deposits of iron in the marrow.','en',1,'2007-10-18 04:28:24',1,NULL,'13156FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13157,142278,'Abnormally diminished or absent perspiration. Both generalized and segmented (reduced or absent sweating in circumscribed locations) forms of the disease are usually associated with other underlying conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'13157FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13158,142281,'A nonspecific term referring to impaired vision. Major subcategories include stimulus deprivation-induced amblyopia and toxic amblyopia. Stimulus deprivation-induced amblopia is a developmental disorder of the visual cortex. A discrepancy between visual information received by the visual cortex from each eye results in abnormal cortical development. STRABISMUS and REFRACTIVE ERRORS may cause this condition. Toxic amblyopia is a disorder of the OPTIC NERVE which is associated with ALCOHOLISM, tobacco SMOKING, and other toxins and as an adverse effect of the use of some medications.','en',1,'2007-10-18 04:28:24',1,NULL,'13158FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13159,142283,'Dilation of pupils to greater than 6 mm combined with failure of the pupils to constrict when stimulated with light. This condition may occur due to injury of the pupillary fibers in the oculomotor nerve, in acute angle-closure glaucoma, and in Adie''s syndrome.','en',1,'2007-10-18 04:28:24',1,NULL,'13159FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13160,142301,'Generic term for diseases caused by an abnormal metabolic process. It can be congenital due to inherited enzyme abnormality (METABOLISM, INBORN ERRORS) or acquired due to disease of an endocrine organ or failure of a metabolically important organ such as the liver. (Stedman, 26th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13160FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13161,142317,'Cardiomyopathy resulting from: 1) a toxic effect of alcohol on the myocardium; 2) thiamine deficiency due to malnutrition in alcoholics; or 3) a toxic effect of cobalt additives in beer in heavy beer drinkers. This disease is usually manifested by dyspnea and palpitations with cardiomegaly and congestive heart failure.','en',1,'2007-10-18 04:28:24',1,NULL,'13161FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13162,142322,'Aneurysm of the aorta.','en',1,'2007-10-18 04:28:24',1,NULL,'13162FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13163,142325,'A group of autosomal recessive disorders marked by a deficiency of the hepatic enzyme PHENYLALANINE HYDROXYLASE or less frequently by reduced activity of DIHYDROPTERIDINE REDUCTASE (i.e., atypical phenylketonuria). Classical phenylketonuria is caused by a severe deficiency of phenylalanine hydroxylase and presents in infancy with developmental delay; SEIZURES; skin HYPOPIGMENTATION; ECZEMA; and demyelination in the central nervous system. (From Adams et al., Principles of Neurology, 6th ed, p952).','en',1,'2007-10-18 04:28:24',1,NULL,'13163FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13164,142331,'Sucking of the finger. This is one of the most common manipulations of the body found in young children.','en',1,'2007-10-18 04:28:24',1,NULL,'13164FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13165,142334,'Congenital syndrome with the absence of the thymus and parathyroids causing impairment of cellular immunity. Immunoglobulin levels are normal.','en',1,'2007-10-18 04:28:24',1,NULL,'13165FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13166,142338,'An autosomal dominant disorder characterized by a widely distributed, well-demarcated hyperkeratosis of the palms and soles. There is more than one genotypically distinct form, each of which is clinically similar but histologically distinguishable. Diffuse palmoplantar keratoderma is distinct from palmoplantar keratoderma (KERATODERMA, PALMOPLANTAR), as the former exhibits autosomal dominant inheritance and hyperhidrosis is frequently present.','en',1,'2007-10-18 04:28:24',1,NULL,'13166FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13167,142340,'A form of lymphoma in which relatively large stem cells with large nuclei, pale, scanty cytoplasm, and indistinct borders are predominant. The cells are undifferentiated, i.e., show no morphologic evidence of maturation toward lymphocytes or histiocytes.','en',1,'2007-10-18 04:28:24',1,NULL,'13167FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13168,142341,'A group of disorders having a benign course but exhibiting clinical and histological features suggestive of malignant lymphoma. Pseudolymphoma is characterized by a benign infiltration of lymphoid cells or histiocytes which microscopically resembles a malignant lymphoma. (From Dorland, 28th ed & Stedman, 26th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13168FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13169,142342,'A high-grade malignant lymphoma composed of a diffuse, relatively uniform proliferation of cells with round or convoluted nuclei and scanty cytoplasm. The cells are cytologically similar to the lymphoblasts seen in acute lymphocytic leukemia, and in some cases, the disease may evolve into a leukemic phase morphologically indistinguishable from acute T-lymphocytic leukemia (LEUKEMIA, T-CELL, ACUTE). Lymphoblastic lymphoma represents approximately one-third of the cases of non-Hodgkin''s lymphomas in children and 5% of the cases in adults. It is more prevalent in males.','en',1,'2007-10-18 04:28:24',1,NULL,'13169FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13170,142344,'Malignant lymphoma characterized by the presence of immunoblasts with uniformly round-to-oval nuclei, one or more prominent nucleoli, and abundant cytoplasm. This class may be subdivided into plasmacytoid and clear-cell types based on cytoplasmic characteristics. A third category, pleomorphous, may be analogous to some of the peripheral T-cell lymphomas (LYMPHOMA, T-CELL, PERIPHERAL) recorded in both the United States and Japan.','en',1,'2007-10-18 04:28:24',1,NULL,'13170FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13171,142347,'A form of lymphoma in which relatively large stem cells with large nuclei, pale, scanty cytoplasm, and indistinct borders are predominant. The cells are undifferentiated, i.e., show no morphologic evidence of maturation toward lymphocytes or histiocytes.','en',1,'2007-10-18 04:28:24',1,NULL,'13171FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
