(13243,142500,'A cognitive disorder characterized by an impaired ability to comprehend written and printed words or phrases despite intact vision. This condition may be developmental or acquired. Developmental dyslexia is marked by reading achievement that falls substantially below that expected given the individual''s chronological age, measured intelligence, and age-appropriate education. The disturbance in reading significantly interferes with academic achievement or with activities of daily living that require reading skills. (From DSM-IV)','en',1,'2007-10-18 04:28:24',1,NULL,'13243FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
