(13247,142505,'A cognitive disorder marked by an impaired ability to comprehend or express language in its written or spoken form. This condition is caused by diseases which affect the language areas of the dominant hemisphere. Clinical features are used to classify the various subtypes of this condition. General categories include receptive, expressive, and mixed forms of aphasia.','en',1,'2007-10-18 04:28:24',1,NULL,'13247FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
