(13273,142571,'Inflammation of the mouth due to denture irritation.','en',1,'2007-10-18 04:28:24',1,NULL,'13273FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13274,142572,'The teeth collectively in the dental arch. Dentition ordinarily refers to the natural teeth in position in their alveoli. Dentition referring to the deciduous teeth is DENTITION, PRIMARY; to the permanent teeth, DENTITION, PERMANENT. (From Jablonski, Dictionary of Dentistry, 1992)','en',1,'2007-10-18 04:28:24',1,NULL,'13274FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13275,142573,'An autosomal dominant disorder of tooth development characterized by opalescent dentin resulting in discoloration of the teeth, ranging from dusky blue to brownish. The dentin is poorly formed with an abnormally low mineral content; the pulp canal is obliterated, but the enamel is normal. The teeth usually wear down rapidly, leaving short, brown stumps. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13275FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13276,142574,'A collagen disorder resulting from defective biosynthesis of type I collagen and characterized by brittle, osteoporotic, and easily fractured bones. It may also present with blue sclerae, loose joints, and imperfect dentin formation. There are four major types, I-IV.','en',1,'2007-10-18 04:28:24',1,NULL,'13276FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13277,142575,'An autosomal dominant disorder of tooth development characterized by opalescent dentin resulting in discoloration of the teeth, ranging from dusky blue to brownish. The dentin is poorly formed with an abnormally low mineral content; the pulp canal is obliterated, but the enamel is normal. The teeth usually wear down rapidly, leaving short, brown stumps. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,'2013-07-10 14:00:44','13277FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13278,142576,'An apparently hereditary disorder of dentin formation, marked by a normal appearance of coronal dentin associated with pulpal obliteration, faulty root formation, and a tendency for peripheral lesions without obvious cause. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13278FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13279,142577,'The pathologic wearing away of the tooth substance by brushing, bruxism, clenching, and other mechanical causes. It is differentiated from TOOTH ATTRITION in that this type of wearing away is the result of tooth-to-tooth contact, as in mastication, occurring only on the occlusal, incisal, and proximal surfaces. It differs also from TOOTH EROSION, the progressive loss of the hard substance of a tooth by chemical processes not involving bacterial action. (From Jablonski, Dictionary of Dentistry, 1992, p2)','en',1,'2007-10-18 04:28:24',1,NULL,'13279FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13280,142579,'A heterogeneous group of primarily familial disorders characterized by myoclonic seizures, tonic-clonic seizures, ataxia, progressive intellectual deterioration, and neuronal degeneration. These include LAFORA DISEASE; MERRF SYNDROME; NEURONAL CEROID-LIPOFUSCINOSIS; sialidosis (see MUCOLIPIDOSES), and UNVERRICHT-LUNDBORG SYNDROME.','en',1,'2007-10-18 04:28:24',1,NULL,'13280FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13281,142583,'A film that attaches to teeth, often causing DENTAL CARIES and GINGIVITIS. It is composed of MUCINS, secreted from salivary glands, and microorganisms.','en',1,'2007-10-18 04:28:24',1,NULL,'13281FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13282,142584,'A chronic endemic form of hypoplasia of the dental enamel caused by drinking water with a high fluorine content during the time of tooth formation, and characterized by defective calcification that gives a white chalky appearance to the enamel, which gradually undergoes brown discoloration. (Jablonski''s Dictionary of Dentistry, 1992, p286)','en',1,'2007-10-18 04:28:24',1,'2013-07-10 13:58:32','13282FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13283,142586,'Abnormal concretion or calcified deposit that forms around the teeth or dental prostheses.','en',1,'2007-10-18 04:28:24',1,NULL,'13283FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13284,142587,'Acute or chronic inflammation of tissues surrounding the apical portion of a tooth, associated with the collection of pus, resulting from infection following pulp infection through a carious lesion or as a result of an injury causing pulp necrosis. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13284FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13285,142588,'Anomaly of the tooth, found chiefly in upper lateral incisors. It is characterized by invagination of the enamel at the incisal edge.','en',1,'2007-10-18 04:28:24',1,NULL,'13285FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13286,142590,'A distinct and virulent form of DENGUE characterized by thrombocytopenia and hemoconcentration (grades I and II) and distinguished by a positive tourniquet test. When accompanied by circulatory failure and shock (grades III and IV), it is called dengue shock syndrome. (From Dorland, 28th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13286FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13287,142591,'A distinct and virulent form of DENGUE characterized by thrombocytopenia and hemoconcentration (grades I and II) and distinguished by a positive tourniquet test. When accompanied by circulatory failure and shock (grades III and IV), it is called dengue shock syndrome. (From Dorland, 28th ed)','en',1,'2007-10-18 04:28:24',1,'2014-10-09 15:22:30','13287FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13289,142596,'An acquired organic mental disorder with loss of intellectual abilities of sufficient severity to interfere with social or occupational functioning. The dysfunction is multifaceted and involves memory, behavior, personality, judgment, attention, spatial relations, language, abstract thought, and other executive functions. The intellectual decline is usually progressive, and initially spares the level of consciousness.','en',1,'2007-10-18 04:28:24',1,NULL,'13289FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13290,142597,'An acquired organic mental disorder with loss of intellectual abilities of sufficient severity to interfere with social or occupational functioning. The dysfunction is multifaceted and involves memory, behavior, personality, judgment, attention, spatial relations, language, abstract thought, and other executive functions. The intellectual decline is usually progressive, and initially spares the level of consciousness.','en',1,'2007-10-18 04:28:24',1,'2013-05-11 17:42:47','13290FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13291,142598,'An acute neurological disorder characterized by the triad of ophthalmoplegia, ataxia, and disturbances of mental activity or consciousness. Eye movement abnormalities include nystagmus, external rectus palsies, and reduced conjugate gaze. THIAMINE DEFICIENCY and chronic ALCOHOLISM are associated conditions. Pathologic features include periventricular petechial hemorrhages and neuropil breakdown in the diencephalon and brainstem. Chronic thiamine deficiency may lead to KORSAKOFF''S SYNDROME. (Adams et al., Principles of Neurology, 6th ed, pp1139-42; Davis & Robertson, Textbook of Neuropathology, 2nd ed, pp452-3)','en',1,'2007-10-18 04:28:24',1,NULL,'13291FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13292,142600,'A false belief regarding the self or persons or objects outside the self that persists despite the facts, and is not considered tenable by one''s associates.','en',1,'2007-10-18 04:28:24',1,NULL,'13292FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13293,142601,'Chronic mental disorders in which there has been an insidious development of a permanent and unshakeable delusional system (persecutory delusions or delusions of jealousy), accompanied by preservation of clear and orderly thinking. Emotional responses and behavior are consistent with the delusional state.','en',1,'2007-10-18 04:28:24',1,NULL,'13293FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13294,142602,'A group of hereditary hemolytic anemias in which there is decreased synthesis of one or more hemoglobin polypeptide chains. There are several genetic types with clinical pictures ranging from barely detectable hematologic abnormality to severe and fatal anemia.','en',1,'2007-10-18 04:28:24',1,NULL,'13294FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13295,142603,'A group of hereditary hemolytic anemias in which there is decreased synthesis of one or more hemoglobin polypeptide chains. There are several genetic types with clinical pictures ranging from barely detectable hematologic abnormality to severe and fatal anemia.','en',1,'2007-10-18 04:28:24',1,NULL,'13295FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13296,142605,'A group of hereditary hemolytic anemias in which there is decreased synthesis of one or more hemoglobin polypeptide chains. There are several genetic types with clinical pictures ranging from barely detectable hematologic abnormality to severe and fatal anemia.','en',1,'2007-10-18 04:28:24',1,NULL,'13296FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
