(13298,142610,'A disorder characterized by CONFUSION; inattentiveness; disorientation; ILLUSIONS; HALLUCINATIONS; agitation; and in some instances autonomic nervous system overactivity. It may result from toxic/metabolic conditions or structural brain lesions. (From Adams et al., Principles of Neurology, 6th ed, pp411-2)','en',1,'2007-10-18 04:28:24',1,NULL,'13298FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13299,142619,'Paralysis of the muscular coat of the stomach. It is most often seen as a complication of DIABETES MELLITUS. (From Dorland, 27th ed; Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13299FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13300,142625,'Conditions characterized by language abilities (comprehension and expression of speech and writing) that are below the expected level for a given age, generally in the absence of an intellectual impairment. These conditions may be associated with DEAFNESS; BRAIN DISEASES; MENTAL DISORDERS; or environmental factors.','en',1,'2007-10-18 04:28:24',1,NULL,'13300FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13301,142628,'Unusually late sexual maturity.','en',1,'2007-10-18 04:28:24',1,NULL,'13301FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13302,142632,'A transient loss of consciousness and postural tone caused by diminished blood flow to the brain (i.e., BRAIN ISCHEMIA). Presyncope refers to the sensation of lightheadedness and loss of strength that precedes a syncopal event or accompanies an incomplete syncope. (From Adams et al., Principles of Neurology, 6th ed, pp367-9)','en',1,'2007-10-18 04:28:24',1,NULL,'13302FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13303,142633,'Forward displacement of one vertebra over another.','en',1,'2007-10-18 04:28:24',1,NULL,'13303FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13304,142636,'A chronic systemic disease, primarily of the joints, marked by inflammatory changes in the synovial membranes and articular structures, widespread fibrinoid degeneration of the collagen fibers in mesenchymal tissues, and by atrophy and rarefaction of bony structures. Etiology is unknown, but autoimmune mechanisms have been implicated.','en',1,'2007-10-18 04:28:24',1,NULL,'13304FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13306,142645,'Colloid or hyaline bodies lying beneath the retinal pigment epithelium. They may occur either secondary to changes in the choroid that affect the pigment epithelium or as an autosomal dominant disorder of the retinal pigment epithelium.','en',1,'2007-10-18 04:28:24',1,NULL,'13306FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13308,142658,'Macular degeneration characterized by edema and cystic spaces which may lead to a macular depression or hole.','en',1,'2007-10-18 04:28:24',1,NULL,'13308FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13309,142659,'Degenerative changes in the macula lutea of the retina.','en',1,'2007-10-18 04:28:24',1,NULL,'13309FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13310,142673,'Alterations or deviations from normal shape or size which result in a disfigurement of the foot.','en',1,'2007-10-18 04:28:24',1,NULL,'13310FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13311,142676,'Alterations or deviations from normal shape or size which result in a disfigurement of the hand.','en',1,'2007-10-18 04:28:24',1,NULL,'13311FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13312,142677,'Alterations or deviations from normal shape or size which result in a disfigurement of the foot.','en',1,'2007-10-18 04:28:24',1,NULL,'13312FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13313,142681,'Conditions which affect the structure or function of the pupil of the eye, including disorders of innervation to the pupillary constrictor or dilator muscles, and disorders of pupillary reflexes.','en',1,'2007-10-18 04:28:24',1,NULL,'13313FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13315,142686,'A group of inherited enzyme deficiencies which feature elevations of GALACTOSE in the blood. This condition may be associated with deficiencies of GALACTOKINASE; UDPGLUCOSE-HEXOSE-1-PHOSPHATE URIDYLYLTRANSFERASE; or UDPGLUCOSE 4-EPIMERASE. The classic form is caused by UDPglucose-Hexose-1-Phosphate Uridylyltransferase deficiency, and presents in infancy with FAILURE TO THRIVE; VOMITING; and INTRACRANIAL HYPERTENSION. Affected individuals also may develop MENTAL RETARDATION; JAUNDICE; hepatosplenomegaly; ovarian failure (OVARIAN FAILURE, PREMATURE); and cataracts. (From Menkes, Textbook of Child Neurology, 5th ed, pp61-3)','en',1,'2007-10-18 04:28:24',1,NULL,'13315FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13316,142687,'A group of inherited enzyme deficiencies which feature elevations of GALACTOSE in the blood. This condition may be associated with deficiencies of GALACTOKINASE; UDPGLUCOSE-HEXOSE-1-PHOSPHATE URIDYLYLTRANSFERASE; or UDPGLUCOSE 4-EPIMERASE. The classic form is caused by UDPglucose-Hexose-1-Phosphate Uridylyltransferase deficiency, and presents in infancy with FAILURE TO THRIVE; VOMITING; and INTRACRANIAL HYPERTENSION. Affected individuals also may develop MENTAL RETARDATION; JAUNDICE; hepatosplenomegaly; ovarian failure (OVARIAN FAILURE, PREMATURE); and cataracts. (From Menkes, Textbook of Child Neurology, 5th ed, pp61-3)','en',1,'2007-10-18 04:28:24',1,NULL,'13316FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13317,142688,'A group of inherited enzyme deficiencies which feature elevations of GALACTOSE in the blood. This condition may be associated with deficiencies of GALACTOKINASE; UDPGLUCOSE-HEXOSE-1-PHOSPHATE URIDYLYLTRANSFERASE; or UDPGLUCOSE 4-EPIMERASE. The classic form is caused by UDPglucose-Hexose-1-Phosphate Uridylyltransferase deficiency, and presents in infancy with FAILURE TO THRIVE; VOMITING; and INTRACRANIAL HYPERTENSION. Affected individuals also may develop MENTAL RETARDATION; JAUNDICE; hepatosplenomegaly; ovarian failure (OVARIAN FAILURE, PREMATURE); and cataracts. (From Menkes, Textbook of Child Neurology, 5th ed, pp61-3)','en',1,'2007-10-18 04:28:24',1,NULL,'13317FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13318,142691,'A disturbance of lipid metabolism with abnormal deposit of lipids in the cells. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13318FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13319,142692,'A group of inherited disorders of adrenal steroidogenesis, the physical expression of which varies with the sex of the patient, the severity of the congenital enzyme defect, and the age at which the defect makes its presence felt. The most common form, the simple virilizing form, is due to a 21-hydroxylase deficiency. There is also a salt-losing form (a more complete 21-hydroxylase deficiency), a hypertensive form (11-hydroxylase deficiency), a 17-hydroxylase deficiency form, a desmolase deficiency form, and a 3-beta-hydroxysteroid deficiency form.','en',1,'2007-10-18 04:28:24',1,NULL,'13319FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13320,142694,'A group of inherited disorders of adrenal steroidogenesis, the physical expression of which varies with the sex of the patient, the severity of the congenital enzyme defect, and the age at which the defect makes its presence felt. The most common form, the simple virilizing form, is due to a 21-hydroxylase deficiency. There is also a salt-losing form (a more complete 21-hydroxylase deficiency), a hypertensive form (11-hydroxylase deficiency), a 17-hydroxylase deficiency form, a desmolase deficiency form, and a 3-beta-hydroxysteroid deficiency form.','en',1,'2007-10-18 04:28:24',1,NULL,'13320FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13321,142695,'Normal nystagmus produced by looking at objects moving across the field of vision.','en',1,'2007-10-18 04:28:24',1,NULL,'13321FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13322,142699,'Fibrin stabilizing factor. It is a glycoprotein activated by thrombin in the presence of calcium to form factor XIIIa. Factor XIII is found evenly distributed between plasma and platelets. Its function is to stabilize the formation of the fibrin polymer (clot) which culminates the coagulation cascade.','en',1,'2007-10-18 04:28:24',1,NULL,'13322FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13323,142701,'A disturbance of lipid metabolism with abnormal deposit of lipids in the cells. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13323FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13324,142705,'An inherited disorder transmitted as a sex-linked trait and caused by a deficiency of an enzyme of purine metabolism; HYPOXANTHINE PHOSPHORIBOSYLTRANSFERASE. Affected individuals are normal in the first year of life and then develop psychomotor retardation, extrapyramidal movement disorders, progressive spasticity, and seizures. Self-destructive behaviors such as biting of fingers and lips are seen frequently. Intellectual impairment may also occur but is typically not severe. Elevation of uric acid in the serum leads to the development of renal calculi and gouty arthritis. (Menkes, Textbook of Child Neurology, 5th ed, pp127)','en',1,'2007-10-18 04:28:24',1,NULL,'13324FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13325,142706,'An autosomal recessive inherited disorder with multiple forms of phenotypic expression, caused by a defect in the oxidative decarboxylation of branched-chain ammino acids (AMINO ACIDS, BRANCHED-CHAIN). These metabolites accumulate in body fluids and render a \"maple syrup\" odor. The disease is divided into classic, intermediate, intermittent, and thiamine responsive subtypes. The classic form presents in the first week of life with ketoacidosis, hypoglycemia, emesis, neonatal seizures, and hypertonia. The intermediate and intermittent forms present in childhood or later with acute episodes of ataxia and vomiting. (From Adams et al., Principles of Neurology, 6th ed, p936)','en',1,'2007-10-18 04:28:24',1,NULL,'13325FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13326,142707,'Metabolic disorders affecting amino acid metabolism. They are present at birth, although they may not become symptomatic until later in life. The majority of these disorders are inherited and present in the neonatal period with metabolic disturbances (e.g., ACIDOSIS) and neurologic manifestations.','en',1,'2007-10-18 04:28:24',1,NULL,'13326FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13328,142710,'A group of inherited enzyme deficiencies which feature elevations of GALACTOSE in the blood. This condition may be associated with deficiencies of GALACTOKINASE; UDPGLUCOSE-HEXOSE-1-PHOSPHATE URIDYLYLTRANSFERASE; or UDPGLUCOSE 4-EPIMERASE. The classic form is caused by UDPglucose-Hexose-1-Phosphate Uridylyltransferase deficiency, and presents in infancy with FAILURE TO THRIVE; VOMITING; and INTRACRANIAL HYPERTENSION. Affected individuals also may develop MENTAL RETARDATION; JAUNDICE; hepatosplenomegaly; ovarian failure (OVARIAN FAILURE, PREMATURE); and cataracts. (From Menkes, Textbook of Child Neurology, 5th ed, pp61-3)','en',1,'2007-10-18 04:28:24',1,NULL,'13328FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13329,142711,'An autosomal recessive fructose metabolism disorder due to absent or deficient fructose-1,6-diphosphatase activity. Gluconeogenesis is impaired, resulting in accumulation of gluconeogenic precursors (e.g., amino acids, lactate, ketones) and manifested as hypoglycemia, ketosis, and lactic acidosis. Episodes in the newborn infant are often lethal. Later episodes are often brought on by fasting and febrile infections. As patients age through early childhood, tolerance to fasting improves and development becomes normal.','en',1,'2007-10-18 04:28:24',1,NULL,'13329FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13330,142715,'The presence of abnormally low levels of lipoproteins in the serum.','en',1,'2007-10-18 04:28:24',1,NULL,'13330FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13331,142716,'Metabolic disorders affecting amino acid metabolism. They are present at birth, although they may not become symptomatic until later in life. The majority of these disorders are inherited and present in the neonatal period with metabolic disturbances (e.g., ACIDOSIS) and neurologic manifestations.','en',1,'2007-10-18 04:28:24',1,NULL,'13331FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13332,142721,'Metabolic disorders affecting amino acid metabolism. They are present at birth, although they may not become symptomatic until later in life. The majority of these disorders are inherited and present in the neonatal period with metabolic disturbances (e.g., ACIDOSIS) and neurologic manifestations.','en',1,'2007-10-18 04:28:24',1,NULL,'13332FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13333,142722,'A group of inherited metabolic disorders involving the enzymes responsible for the synthesis and degradation of glycogen. In some patients, prominent liver involvement is presented. In others, more generalized storage of glycogen occurs, sometimes with prominent cardiac involvement.','en',1,'2007-10-18 04:28:24',1,NULL,'13333FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13334,142723,'A disturbance of lipid metabolism with abnormal deposit of lipids in the cells. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13334FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13335,142724,'An autosomal recessive inherited disorder with multiple forms of phenotypic expression, caused by a defect in the oxidative decarboxylation of branched-chain ammino acids (AMINO ACIDS, BRANCHED-CHAIN). These metabolites accumulate in body fluids and render a \"maple syrup\" odor. The disease is divided into classic, intermediate, intermittent, and thiamine responsive subtypes. The classic form presents in the first week of life with ketoacidosis, hypoglycemia, emesis, neonatal seizures, and hypertonia. The intermediate and intermittent forms present in childhood or later with acute episodes of ataxia and vomiting. (From Adams et al., Principles of Neurology, 6th ed, p936)','en',1,'2007-10-18 04:28:24',1,NULL,'13335FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13336,142727,'An immunologic deficiency state characterized by an extremely low level of generally all classes of gamma-globulin in the blood.','en',1,'2007-10-18 04:28:24',1,NULL,'13336FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13337,142738,'New blood vessels originating from the corneal veins and extending from the limbus into the adjacent corneal stroma. These vessels may lie in the superficial and/or deep corneal stroma. Neovascularization is a sequel to numerous inflammatory diseases of the ocular anterior segment, including trachoma, viral interstitial keratitis, microbial keratoconjunctivitis, and the immune response elicited by corneal transplantation.','en',1,'2007-10-18 04:28:24',1,NULL,'13337FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13338,142741,'Difficult childbirth or labor.','en',1,'2007-10-18 04:28:24',1,NULL,'13338FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13339,142742,'Obstruction of a vessel by a blood clot that has been transported from a distant site by the blood stream.','en',1,'2007-10-18 04:28:24',1,NULL,'13339FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13340,142819,'Superficial infections of the skin or its appendages by any of various fungi.','en',1,'2007-10-18 04:28:24',1,NULL,'13340FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13341,142820,'Bleeding from the vessels of the retina.','en',1,'2007-10-18 04:28:24',1,NULL,'13341FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13342,142887,'A pulmonary ventilation rate faster than is metabolically necessary for the exchange of gases. It is the result of an increased frequency of breathing, an increased tidal volume, or a combination of both. It causes an excess intake of oxygen and the blowing off of carbon dioxide.','en',1,'2007-10-18 04:28:24',1,NULL,'13342FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13343,142888,'A malignant tumor derived from primitive or embryonal lipoblastic cells. It may be composed of well-differentiated fat cells or may be dedifferentiated: myxoid (LIPOSARCOMA, MYXOID), round-celled, or pleomorphic, usually in association with a rich network of capillaries. Recurrences are common and dedifferentiated liposarcomas metastasize to the lungs or serosal surfaces. (From Dorland, 27th ed; Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13343FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13344,142895,'The inability of a kidney to excrete metabolites at normal plasma levels under conditions of normal loading, or the inability to retain electrolytes under conditions of normal intake. In the acute form (KIDNEY FAILURE, ACUTE), it is marked by uremia and usually by oliguria or anuria, with hyperkalemia and pulmonary edema. The chronic form (KIDNEY FAILURE, CHRONIC) is irreversible and requires hemodialysis.','en',1,'2007-10-18 04:28:24',1,NULL,'13344FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13345,142900,'Disturbances of milk secretion in either sex, not necessarily related to pregnancy.','en',1,'2007-10-18 04:28:24',1,NULL,'13345FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13346,142901,'Abnormally low intraocular pressure often related to chronic inflammation (uveitis).','en',1,'2007-10-18 04:28:24',1,NULL,'13346FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13347,142902,'Anemia characterized by decreased or absent iron stores, low serum iron concentration, low transferrin saturation, and low hemoglobin concentration or hematocrit value. The erythrocytes are hypochromic and microcytic and the iron binding capacity is increased.','en',1,'2007-10-18 04:28:24',1,NULL,'13347FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13348,142903,'A condition in which the sense of hearing, although defective, is functional with or without a hearing aid. The hearing loss may affect one or both ears. The normal hearing level for speech is approximately 40-70 decibels I.S.O. (International Organization for Standardization) or 30-60 db A.S.A. (American Standards Association).','en',1,'2007-10-18 04:28:24',1,NULL,'13348FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13349,142904,'A disorder characterized by reduction in the elements involved in blood coagulation due to their utilization in widespread blood clotting within the vessels. The activation of the clotting mechanism may arise from any of a number of disorders. In the late stages, it is marked by profuse hemorrhaging. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13349FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13350,142905,'Chronic inflammation and progressive fibrosis of the pulmonary alveolar walls, with steadily progressive dyspnea, resulting finally in death from oxygen lack or right heart failure.','en',1,'2007-10-18 04:28:24',1,NULL,'13350FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13351,142906,'Adrenocortical hypofunction includes all conditions in which adrenal steroid hormone secretion falls below the requirements of the body. Adrenal insufficiency may be divided into two general categories: (1) those associated with primary inability of the adrenal to elaborate sufficient quantities of hormone and (2) those associated with a secondary failure due to a primary failure in the elaboration of adrenocorticotropin. (Harrison''s Principles of Internal Medicine, 13th ed, p1970)','en',1,'2007-10-18 04:28:24',1,NULL,'13351FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13352,142912,'Clinical manifestation consisting of a physiopathological lack or loss of appetite accompanied by an aversion to food and the inability to eat.','en',1,'2007-10-18 04:28:24',1,'2015-07-30 02:30:47','13352FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13353,142913,'A subtype of epilepsy characterized by seizures that are consistently provoked by a certain specific stimulus. Auditory, visual, and somatosensory stimuli as well as the acts of writing, reading, eating, and decision making are examples of events or activities that may induce seizure activity in affected individuals. (From Neurol Clin 1994 Feb;12(1):57-8)','en',1,'2007-10-18 04:28:24',1,NULL,'13353FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13354,142932,'A general term for the complete or partial loss of the ability to hear from one or both ears. Deafness may result from EAR DISEASES; VESTIBULOCOCHLEAR NERVE DISEASES; or BRAIN DISEASES.','en',1,'2007-10-18 04:28:24',1,NULL,'13354FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13355,142933,'Irreversible cessation of all bodily functions, manifested by absence of spontaneous breathing and total loss of cardiovascular and cerebral functions.','en',1,'2007-10-18 04:28:24',1,NULL,'13355FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13356,142936,'A syndrome characterized by growth retardation, severe MENTAL RETARDATION, short stature, a low-pitched growling cry, brachycephaly, low-set ears, webbed neck, carp mouth, depressed nasal bridge, bushy eyebrows meeting at the midline, hirsutism, and malformations of the hands. The condition may occur sporadically or be associated with an autosomal dominant pattern of inheritance or duplication of the long arm of chromosome 3. (Menkes, Textbook of Child Neurology, 5th ed, p231)','en',1,'2007-10-18 04:28:24',1,NULL,'13356FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13357,142937,'Visual impairments limiting one or more of the basic functions of the eye: visual acuity, dark adaptation, color vision, or peripheral vision. These may result from EYE DISEASES; OPTIC NERVE DISEASES; VISUAL PATHWAY diseases; OCCIPITAL LOBE diseases; OCULAR MOTILITY DISORDERS; and other conditions. Visual disability refers to inability of the individual to perform specific visual tasks, such as reading, writing, orientation, or traveling unaided. (From Newell, Ophthalmology: Principles and Concepts, 7th ed, p132)','en',1,'2007-10-18 04:28:24',1,NULL,'13357FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13358,142942,'A group of conditions of diverse etiologies characterized by the accumulation of insoluble fibrillar proteins (amyloid) in various organs and tissues of the body such that vital function is compromised. The associated disease states may be inflammatory, hereditary, or neoplastic, and the deposition can be localized or generalized or systemic. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13358FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13359,142958,'Inflammation of the lacrimal sac. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13359FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13360,142960,'Increased intracellular or extracellular fluid in brain tissue. Cytotoxic brain edema (swelling due to increased intracellular fluid) is indicative of a disturbance in cell metabolism, and is commonly associated with hypoxic or ischemic injuries (see HYPOXIA, BRAIN). An increase in extracellular fluid may be caused by increased brain capillary permeability (vasogenic edema), an osmotic gradient, local blockages in interstitial fluid pathways, or by obstruction of CSF flow (e.g., obstructive HYDROCEPHALUS). (From Childs Nerv Syst 1992 Sep; 8(6):301-6)','en',1,'2007-10-18 04:28:24',1,NULL,'13360FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13361,142961,'A reduction in the number of circulating erythrocytes or in the quantity of hemoglobin.','en',1,'2007-10-18 04:28:24',1,NULL,'13361FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
