(13369,142985,'Lysosomal storage disorders of unknown molecular defect, characterized by widespread deposition of cystine crystals in reticuloendothelial cells. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13369FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13370,142986,'Infection with CYSTICERCUS, a larval form of the various tapeworms of the genus Taenia (usually T. solium in man). In humans they penetrate the intestinal wall and invade subcutaneous tissue, brain, eye, muscle, heart, liver, lung, and peritoneum. Brain involvement results in NEUROCYSTICERCOSIS. (From Dorland, 28th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13370FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13371,142987,'A benign tumor representing a congenital malformation of the lymphatic system and made up of newly formed lymph-containing vascular spaces and channels. Lymphangioendothelioma is a type of lymphangioma in which endothelial cells are the dominant component. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13371FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13373,142991,'An inherited disease of exocrine glands, affecting most characteristically the pancreas, respiratory system, and sweat glands, usually beginning in infancy and typified by chronic respiratory infections, pancreatic insufficiency, and susceptibility to heat prostration. Cirrhosis of liver occurring in childhood is common and may produce portal hypertension, splenomegaly, and hypersplenism.','en',1,'2007-10-18 04:28:24',1,NULL,'13373FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13374,142999,'An autosomal recessive inborn error of methionine metabolism usually caused by a deficiency of CYSTATHIONINE BETA-SYNTHASE and associated with elevations of homocysteine in plasma and urine. Clinical features include a tall, slender habitus, SCOLIOSIS, arachnodactyly, MUSCLE WEAKNESS, genu varis, thin blond hair, malar flush, lens dislocations, an increased incidence of MENTAL RETARDATION, and a tendency to develop fibrosis of arteries, frequently complicated by CEREBROVASCULAR ACCIDENTS and MYOCARDIAL INFARCTION. (From Adams et al., Principles of Neurology, 6th ed, p979)','en',1,'2007-10-18 04:28:24',1,NULL,'13374FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13375,143004,'Cysts of one of the parts of the mediastinum: the superior part, containing the trachea, esophagus, thoracic duct and thymus organs; the inferior middle part, containing the pericardium; the inferior anterior part containing some lymph nodes; and the inferior posterior part, containing the thoracic duct and esophagus.','en',1,'2007-10-18 04:28:24',1,NULL,'13375FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13376,143005,'Intradermal or subcutaneous saclike structure, the wall of which is stratified epithelium containing keratohyalin granules.','en',1,'2007-10-18 04:28:24',1,NULL,'13376FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13377,143009,'A true cyst of the pancreas to be distinguished from the much more common PANCREATIC PSEUDOCYST by possessing a mucous epithelial lining. Pancreatic cysts are categorized as congenital, retention, neoplastic, parasitic, enterogenous, or dermoid. Congenital cysts occur more frequently as solitary cysts but may be multiple. Retention cysts are gross enlargements of pancreatic ducts secondary to ductal obstruction. (From Bockus Gastroenterology, 4th ed, p4145)','en',1,'2007-10-18 04:28:24',1,NULL,'13377FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13379,143014,'Saccular lesions lined with epithelium and contained within pathologically formed cavities in the jaw; also nonepithelial cysts (pseudocysts) as they apply to the jaw, e.g., traumatic or solitary cyst, static bone cavity, and aneurysmal bone cyst. True jaw cysts are classified as odontogenic or nonodontogenic.','en',1,'2007-10-18 04:28:24',1,NULL,'13379FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13380,143027,'A chronic disorder comprising three variants which range from lesions consisting primarily of an overgrowth of fibrous tissue to those characterized by dominance of the proliferation of the epithelial parenchyma to a form of dysplasia characterized by both stromal and epithelial hyperplasia with the formation of cysts.','en',1,'2007-10-18 04:28:24',1,NULL,'13380FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
