(13397,143069,'A mycosis affecting the skin, mucous membranes, lymph nodes, and internal organs. It is caused by Paracoccidioides brasiliensis. It is also called paracoccidioidal granuloma. Superficial resemblance of P. brasiliensis to Blastomyces brasiliensis (BLASTOMYCES) may cause misdiagnosis.','en',1,'2007-10-18 04:28:24',1,NULL,'13397FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
