(13400,143073,'A form of lupus erythematosus in which the skin may be the only organ involved or in which skin involvement precedes the spread into other body systems. It has been classified into three forms - acute (= LUPUS ERYTHEMATOSUS, SYSTEMIC with skin lesions), subacute, and chronic (= LUPUS ERYTHEMATOSUS, DISCOID).','en',1,'2007-10-18 04:28:24',1,NULL,'13400FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13401,143074,'An endemic disease that is characterized by the development of single or multiple localized lesions on exposed areas of skin that typically ulcerate. The disease has been divided into Old and New World forms. Old World leishmaniasis is separated into three distinct types according to epidemiology and clinical manifestations and is caused by species of the L. tropica and L. aethiopica complexes as well as by species of the L. major genus. New World leishmaniasis, also called American leishmaniasis, occurs in South and Central America and is caused by species of the L. mexicana or L. braziliensis complexes.','en',1,'2007-10-18 04:28:24',1,NULL,'13401FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13402,143076,'A common parasite of humans in the moist tropics and subtropics. These organisms attach to villi in the small intestine and suck blood causing diarrhea, anorexia, and anemia.','en',1,'2007-10-18 04:28:24',1,NULL,'13402FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13403,143077,'Infections caused by nematode larvae which never develop into the adult stage and migrate through various body tissues. They commonly infect the skin, eyes, and viscera in man. Ancylostoma brasiliensis causes cutaneous larva migrans. Toxocara causes visceral larva migrans.','en',1,'2007-10-18 04:28:24',1,NULL,'13403FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13404,143080,'A contagious disease of horses that can be transmitted to humans. It is caused by Pseudomonas mallei and characterized by ulceration of the respiratory mucosa and an eruption of nodules on the skin.','en',1,'2007-10-18 04:28:24',1,NULL,'13404FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13405,143082,'A localized infection of mucous membranes or skin caused by toxigenic strains of CORYNEBACTERIUM DIPHTHERIAE. It is characterized by the presence of a pseudomembrane at the site of infection. DIPHTHERIA TOXIN, produced by C. diphtheriae, can cause myocarditis, polyneuritis, and other systemic toxic effects.','en',1,'2007-10-18 04:28:24',1,NULL,'13405FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13406,143083,'Scaly papule or warty growth, caused by five fungi, that spreads as a result of satellite lesions affecting the foot or leg. The extremity may become swollen and, at its distal portion, covered with various nodular, tumorous, verrucous lesions that resemble cauliflower. In rare instances, the disease may begin on the hand or wrist and involve the entire upper extremity. (Arnold, Odom, and James, Andrew''s Diseases of the Skin, 8th ed, p362)','en',1,'2007-10-18 04:28:24',1,NULL,'13406FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13407,143084,'A fungal infection that may appear in two forms: 1) a primary lesion characterized by the formation of a small cutaneous nodule and small nodules along the lymphatics that may heal within several months; and 2) chronic granulomatous lesions characterized by thick crusts, warty growths, and unusual vascularity and infection in the middle or upper lobes of the lung.','en',1,'2007-10-18 04:28:24',1,NULL,'13407FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13408,143086,'An acute bacterial infection caused by ingestion of BACILLUS organisms. Carnivores may become infected from ingestion of infected carcasses. It is transmitted to humans by contact with infected animals or contaminated animal products. The most common form in humans is cutaneous anthrax.','en',1,'2007-10-18 04:28:24',1,NULL,'13408FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13409,143087,'A group of conditions of diverse etiologies characterized by the accumulation of insoluble fibrillar proteins (amyloid) in various organs and tissues of the body such that vital function is compromised. The associated disease states may be inflammatory, hereditary, or neoplastic, and the deposition can be localized or generalized or systemic. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13409FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13410,143088,'A chronic bacterial infection of major folds of the skin, caused by Corynebacterium minutissimum.','en',1,'2007-10-18 04:28:24',1,NULL,'13410FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13411,143089,'A contagious cutaneous inflammation caused by the bite of the mite SARCOPTES SCABIEI. It is characterized by pruritic papular eruptions and burrows and affects primarily the axillae, elbows, wrists, and genitalia, although it can spread to cover the entire body.','en',1,'2007-10-18 04:28:24',1,NULL,'13411FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
