(13414,143093,'A subtype of epilepsy characterized by seizures that are consistently provoked by a certain specific stimulus. Auditory, visual, and somatosensory stimuli as well as the acts of writing, reading, eating, and decision making are examples of events or activities that may induce seizure activity in affected individuals. (From Neurol Clin 1994 Feb;12(1):57-8)','en',1,'2007-10-18 04:28:24',1,NULL,'13414FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13415,143094,'A subtype of epilepsy characterized by seizures that are consistently provoked by a certain specific stimulus. Auditory, visual, and somatosensory stimuli as well as the acts of writing, reading, eating, and decision making are examples of events or activities that may induce seizure activity in affected individuals. (From Neurol Clin 1994 Feb;12(1):57-8)','en',1,'2007-10-18 04:28:24',1,NULL,'13415FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
