(13417,143101,'The absence of certain expected and acceptable cultural phenomena in the environment which results in the failure of the individual to communicate and respond in the most appropriate manner within the context of society. Language acquisition and language use are commonly used in assessing this concept.','en',1,'2007-10-18 04:28:24',1,NULL,'13417FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13418,143102,'Compression of the ULNAR NERVE in the cubital tunnel, which is formed by the two heads of the flexor carpi ulnaris muscle, humeral-ulnar aponeurosis, and medial ligaments of the elbow. This condition may follow trauma or occur in association with processes which produce nerve enlargement or narrowing of the canal. Manifestations include elbow pain and PARESTHESIA radiating distally, weakness of ulnar innervated intrinsic hand muscles, and loss of sensation over the hypothenar region, fifth finger, and ulnar aspect of the ring finger. (Joynt, Clinical Neurology, 1995, Ch51, p43)','en',1,'2007-10-18 04:28:24',1,NULL,'13418FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13419,143110,'Parasitic intestinal infection with severe diarrhea caused by a protozoan, CRYPTOSPORIDIUM. It occurs in both animals and humans.','en',1,'2007-10-18 04:28:24',1,NULL,'13419FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13420,143113,'An epileptic syndrome characterized by the triad of infantile spasms, hypsarrhythmia, and arrest of psychomotor development at seizure onset. The majority present between 3-12 months of age, with spasms consisting of combinations of brief flexor or extensor movements of the head, trunk, and limbs. The condition is divided into two forms: cryptogenic (idiopathic) and symptomatic (secondary to a known disease process such as intrauterine infections; nervous system abnormalities; BRAIN DISEASES, METABOLIC, INBORN; prematurity; perinatal asphyxia; TUBEROUS SCLEROSIS; etc.). (From Menkes, Textbook of Child Neurology, 5th ed, pp744-8)','en',1,'2007-10-18 04:28:24',1,NULL,'13420FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13421,143114,'A plague-like disease of rodents, transmissible to man. It is caused by FRANCISELLA TULARENSIS and is characterized by fever, chills, headache, backache, and weakness.','en',1,'2007-10-18 04:28:24',1,NULL,'13421FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13422,143116,'A clinically diverse group of epilepsy syndromes characterized either by myoclonic seizures or by myoclonus in association with other seizure types. Myoclonic epilepsy syndromes are divided into three subtypes based on etiology: familial, cryptogenic, and symptomatic (i.e., occurring secondary to known disease processes such as infections, hypoxic-ischemic injuries, trauma, etc.).','en',1,'2007-10-18 04:28:24',1,NULL,'13422FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13423,143117,'A generalized seizure disorder characterized by recurrent major motor seizures. The initial brief tonic phase is marked by trunk flexion followed by diffuse extension of the trunk and extremities. The clonic phase features rhythmic flexor contractions of the trunk and limbs, pupillary dilation, elevations of blood pressure and pulse, urinary incontinence, and tongue biting. This is followed by a profound state of depressed consciousness (post-ictal state) which gradually improves over minutes to hours. The disorder may be cryptogenic, familial, or symptomatic (caused by an identified disease process). (From Adams et al., Principles of Neurology, 6th ed, p329)','en',1,'2007-10-18 04:28:24',1,NULL,'13423FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13425,143126,'A condition characterized by the presence of abnormal or abnormal quantities of cryoglobulins in the blood. They are precipitated into the microvasculature on exposure to cold and cause restricted blood flow in exposed areas.','en',1,'2007-10-18 04:28:24',1,NULL,'13425FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13426,143130,'Abnormally increased pressure in the portal venous system; frequently seen in cirrhosis of the liver and in other conditions which cause obstruction of the portal vein.','en',1,'2007-10-18 04:28:24',1,NULL,'13426FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13427,143131,'A contagious cutaneous inflammation caused by the bite of the mite SARCOPTES SCABIEI. It is characterized by pruritic papular eruptions and burrows and affects primarily the axillae, elbows, wrists, and genitalia, although it can spread to cover the entire body.','en',1,'2007-10-18 04:28:24',1,NULL,'13427FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
