(13433,143191,'An autosomal dominant disorder characterized by acrocephaly, exophthalmos, hypertelorism, strabismus, parrot-beaked nose, and hypoplastic maxilla with relative mandibular prognathism. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13433FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13434,143193,'A condition characterized by resonant barking cough, hoarseness and persistant stridor and caused by allergy, foreign body, infection, or neoplasm. It occurs chiefly in infants and children.','en',1,'2007-10-18 04:28:24',1,NULL,'13434FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13435,143195,'Severe or complete loss of motor function on one side of the body. This condition is usually caused by BRAIN DISEASES that are localized to the cerebral hemisphere opposite to the side of weakness. Less frequently, BRAIN STEM lesions; cervical SPINAL CORD DISEASES; PERIPHERAL NERVOUS SYSTEM DISEASES; and other conditions may manifest as hemiplegia. The term hemiparesis (see PARESIS) refers to mild to moderate weakness involving one side of the body.','en',1,'2007-10-18 04:28:24',1,NULL,'13435FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13436,143198,'Pedunculated or sessile growths arising from the intestinal mucosa and extending into the lumen. The disease includes intestinal polyposis.','en',1,'2007-10-18 04:28:24',1,NULL,'13436FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13437,143199,'Gastrointestinal disorder characterized by chronic inflammatory infiltrates, fibrosis affecting all layers of the serosa, and development of noncaseating granulomas. The most common site of involvement is the terminal ileum with the colon as the second most common.','en',1,'2007-10-18 04:28:24',1,NULL,'13437FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13438,143209,'Gastrointestinal disorder characterized by chronic inflammatory infiltrates, fibrosis affecting all layers of the serosa, and development of noncaseating granulomas. The most common site of involvement is the terminal ileum with the colon as the second most common.','en',1,'2007-10-18 04:28:24',1,NULL,'13438FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13439,143210,'Diseases of the lacrimal apparatus.','en',1,'2007-10-18 04:28:24',1,NULL,'13439FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13440,143211,'Diseases of multiple peripheral nerves. The various forms are categorized by the type of nerve affected (e.g., sensory, motor, or autonomic), by the distribution of nerve injury (e.g., distal vs. proximal), by nerve component primarily affected (e.g., demyelinating vs. axonal), by etiology, or by pattern of inheritance.','en',1,'2007-10-18 04:28:24',1,NULL,'13440FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13441,143213,'A familial form of congenital hyperbilirubinemia transmitted as an autosomal recessive trait. It is characterized by icterus and brain damage caused by a glucuronyl transferase deficiency in the liver and faulty bilirubin conjugation.','en',1,'2007-10-18 04:28:24',1,NULL,'13441FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13442,143214,'Disorders affecting the motor function of the upper or lower esophageal sphincters, the esophageal body, or a combination of these parts. The failure of the sphincters to maintain a tonic pressure may result in the impeding of the passage of food, regurgitation of food, or reflux of gastric acid into the esophagus.','en',1,'2007-10-18 04:28:24',1,NULL,'13442FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13444,143217,'A chronic, progressive dermatosis characterized by boardlike hardening and immobility of the affected skin, with visceral involvement, especially of lungs, esophagus, kidneys and heart. It may be accompanied by calcinosis, Raynaud''s phenomenon, and telangiectasis (CREST syndrome). It includes acrosclerosis and sclerodactyly.','en',1,'2007-10-18 04:28:24',1,'2015-04-12 19:16:33','13444FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
