(13450,143234,'Disorders of one or more of the twelve cranial nerves. With the exception of the optic and olfactory nerves, this includes disorders of the brain stem nuclei from which the cranial nerves originate or terminate.','en',1,'2007-10-18 04:28:24',1,NULL,'13450FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13451,143235,'Disorders of one or more of the twelve cranial nerves. With the exception of the optic and olfactory nerves, this includes disorders of the brain stem nuclei from which the cranial nerves originate or terminate.','en',1,'2007-10-18 04:28:24',1,NULL,'13451FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13452,143237,'Cerebral tissue herniation through a congenital or acquired defect in the skull. The majority of congenital encephaloceles occur in the occipital or frontal regions. Clinical features include a protuberant mass that may be pulsatile. The quantity and location of protruding neural tissue determines the type and degree of neurologic deficit. Visual defects, psychomotor developmental delay, and persistent motor deficits frequently occur.','en',1,'2007-10-18 04:28:24',1,NULL,'13452FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
