(13458,143254,'A mild, eruptive skin disease of milk cows caused by COWPOX  VIRUS, with lesions occurring principally on the udder and teats. Human infection may occur while milking an infected animal.','en',1,'2007-10-18 04:28:24',1,NULL,'13458FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13459,143256,'A hereditary disease characterized by multiple ectodermal, mesodermal, and endodermal nevoid and neoplastic anomalies. Papules of the face and oral mucosa are the most characteristic lesion. Other changes occur in the skin, in the thyroid, the breast, the gastrointestinal system, and the nervous system.','en',1,'2007-10-18 04:28:24',1,NULL,'13459FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
