(13461,143259,'A chronic, progressive dermatosis characterized by boardlike hardening and immobility of the affected skin, with visceral involvement, especially of lungs, esophagus, kidneys and heart. It may be accompanied by calcinosis, Raynaud''s phenomenon, and telangiectasis (CREST syndrome). It includes acrosclerosis and sclerodactyly.','en',1,'2007-10-18 04:28:24',1,NULL,'13461FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13462,143261,'A form of bronchial disorder associated with airway obstruction, marked by recurrent attacks of paroxysmal dyspnea, with wheezing due to spasmodic contraction of the bronchi.','en',1,'2007-10-18 04:28:24',1,NULL,'13462FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13464,143266,'Chronic mental disorders in which there has been an insidious development of a permanent and unshakeable delusional system (persecutory delusions or delusions of jealousy), accompanied by preservation of clear and orderly thinking. Emotional responses and behavior are consistent with the delusional state.','en',1,'2007-10-18 04:28:24',1,NULL,'13464FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13465,143267,'A neurovascular syndrome associated with compression of the BRACHIAL PLEXUS; SUBCLAVIAN ARTERY; and SUBCLAVIAN VEIN at the superior thoracic outlet. This may result from a variety of anomalies such as a cervical rib (CERVICAL RIB SYNDROME), anomalous fascial bands, and abnormalities of the origin or insertion of the anterior or medial scalene muscles. Clinical features may include pain in the shoulder and neck region which radiates into the arm, PARESIS or PARALYSIS of brachial plexus innervated muscles, PARESTHESIA, loss of sensation, reduction of arterial pulses in the affected extremity, ISCHEMIA, and EDEMA. (Adams et al., Principles of Neurology, 6th ed, pp214-5).','en',1,'2007-10-18 04:28:24',1,NULL,'13465FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13466,143268,'Idiopathic painful nonsuppurative swellings of one or more costal cartilages, especially of the second rib. The anterior chest pain may mimic that of coronary artery disease. (Dorland, 27th ed.)','en',1,'2007-10-18 04:28:24',1,NULL,'13466FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13467,143270,'A benign tumor, usually found in the anterior lobe of the pituitary gland, whose cells stain with acid dyes. Such pituitary tumors may give rise to excessive secretion of growth hormone, resulting in gigantism or acromegaly. A specific type of acidophil adenoma may give rise to nonpuerperal galactorrhea. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13467FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
