(13504,143391,'Complete loss of phonation due to organic disease of the larynx or to nonorganic (i.e., psychogenic) causes.','en',1,'2007-10-18 04:28:24',1,NULL,'13504FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13505,143392,'Disorders that feature impairment of eye movements as a primary manifestation of disease. These conditions may be divided into infranuclear, nuclear, and supranuclear disorders. Diseases of the eye muscles or oculomotor cranial nerves (III, IV, and VI) are considered infranuclear. Nuclear disorders are caused by disease of the oculomotor, trochlear, or abducens nuclei in the BRAIN STEM. Supranuclear disorders are produced by dysfunction of higher order sensory and motor systems that control eye movements, including neural networks in the CEREBRAL CORTEX; BASAL GANGLIA; CEREBELLUM; and BRAIN STEM. Ocular torticollis refers to a head tilt that is caused by an ocular misalignment. Opsoclonus refers to rapid, conjugate oscillations of the eyes in multiple directions, which may occur as a parainfectious or paraneoplastic condition (e.g., OPSOCLONUS-MYOCLONUS SYNDROME). (Adams et al., Principles of Neurology, 6th ed, p240)','en',1,'2007-10-18 04:28:24',1,NULL,'13505FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13506,143394,'Involuntary movements of the eye that are divided into two types, jerk and pendular. Jerk nystagmus has a slow phase in one direction followed by a corrective fast phase in the opposite direction, and is usually caused by central or peripheral vestibular dysfunction. Pendular nystagmus features oscillations that are of equal velocity in both directions and this condition is often associated with visual loss early in life. (Adams et al., Principles of Neurology, 6th ed, p272)','en',1,'2007-10-18 04:28:24',1,NULL,'13506FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
