(13581,143583,'An illusion of movement, either of the external world revolving around the individual or of the individual revolving in space. Vertigo may be associated with disorders of the inner ear, vestibular nerve, brainstem, and cerebral cortex. Lesions in the temporal and parietal lobes may be associated with FOCAL SEIZURES that may feature vertigo as an ictal manifestation. (From Adams et al., Principles of Neurology, 6th ed, pp300-1)','en',1,'2007-10-18 04:28:24',1,NULL,'13581FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13582,143584,'Misalignment of the visual axes of the eyes. In comitant strabismus the degree of ocular misalignment does not vary with the direction of gaze. In noncomitant strabismus the degree of misalignment varies depending on direction of gaze or which eye is fixating on the target. (Miller, Walsh & Hoyt''s Clinical Neuro-Ophthalmology, 4th ed, p641)','en',1,'2007-10-18 04:28:24',1,NULL,'13582FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
