(13585,143594,'A highly contagious disease characterized by subconjunctival hemorrhage, sudden swelling of the eyelids and congestion, redness, and pain in the eye. Epidemic conjunctivitis caused by Enterovirus 70 (EV-70) was first described in Africa in 1969. It is caused also by Coxsackievirus A24 variant (CA24v). Epidemics by this organism have appeared most frequently in Asia.','en',1,'2007-10-18 04:28:24',1,NULL,'13585FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13586,143595,'Inflammation, often mild, of the conjunctiva caused by a variety of viral agents. Conjunctival involvement may be part of a systemic infection.','en',1,'2007-10-18 04:28:24',1,NULL,'13586FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13587,143596,'The acquired form of infection by Toxoplasma gondii in animals and man.','en',1,'2007-10-18 04:28:24',1,NULL,'13587FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13588,143597,'Drying and inflammation of the conjunctiva as a result of insufficient lacrimal secretion. When found in association with XEROSTOMIA and polyarthritis, it is called SJOGREN''S SYNDROME.','en',1,'2007-10-18 04:28:24',1,NULL,'13588FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13589,143608,'A localized infection of mucous membranes or skin caused by toxigenic strains of CORYNEBACTERIUM DIPHTHERIAE. It is characterized by the presence of a pseudomembrane at the site of infection. DIPHTHERIA TOXIN, produced by C. diphtheriae, can cause myocarditis, polyneuritis, and other systemic toxic effects.','en',1,'2007-10-18 04:28:24',1,NULL,'13589FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13590,143610,'An abnormal triangular fold of membrane in the interpalpebral fissure, extending from the conjunctiva to the cornea, being immovably united to the cornea at its apex, firmly attached to the sclera throughout its middle portion, and merged with the conjunctiva at its base. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13590FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13591,143611,'An abnormal triangular fold of membrane in the interpalpebral fissure, extending from the conjunctiva to the cornea, being immovably united to the cornea at its apex, firmly attached to the sclera throughout its middle portion, and merged with the conjunctiva at its base. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13591FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13592,143615,'A group of conditions of diverse etiologies characterized by the accumulation of insoluble fibrillar proteins (amyloid) in various organs and tissues of the body such that vital function is compromised. The associated disease states may be inflammatory, hereditary, or neoplastic, and the deposition can be localized or generalized or systemic. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13592FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13593,143617,'Involuntary movements of the eye that are divided into two types, jerk and pendular. Jerk nystagmus has a slow phase in one direction followed by a corrective fast phase in the opposite direction, and is usually caused by central or peripheral vestibular dysfunction. Pendular nystagmus features oscillations that are of equal velocity in both directions and this condition is often associated with visual loss early in life. (Adams et al., Principles of Neurology, 6th ed, p272)','en',1,'2007-10-18 04:28:24',1,NULL,'13593FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
