(13599,143633,'Paralysis of one or both vocal cords, which produces hoarseness or aphonia. This condition may be caused by diseases of the medulla (e.g., LATERAL MEDULLARY SYNDROME), VAGUS NERVE, or recurrent laryngeal nerve. Neuromuscular junction diseases and local myopathic processes may also affect vocal cord function. (Adams et al., Principles of Neurology, 6th ed, p1380)','en',1,'2007-10-18 04:28:24',1,NULL,'13599FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
