(13601,143651,'Prenatal protozoal infection with TOXOPLASMA gondii which is associated with injury to the developing fetal nervous system. The severity of this condition is related to the stage of pregnancy during which the infection occurs; first trimester infections are associated with a greater degree of neurologic dysfunction. Clinical features include HYDROCEPHALUS; MICROCEPHALY; deafness; cerebral calcifications; SEIZURES; and psychomotor retardation. Signs of a systemic infection may also be present at birth, including fever, rash, and hepatosplenomegaly. (From Adams et al., Principles of Neurology, 6th ed, p735)','en',1,'2007-10-18 04:28:24',1,NULL,'13601FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
