(13623,143732,'A group of inherited disorders characterized by degeneration of dorsal root and autonomic ganglion cells, and clinically by loss of sensation and autonomic dysfunction. There are five subtypes. Type I features autosomal dominant inheritance and distal sensory involvement. Type II is characterized by autosomal inheritance and distal and proximal sensory loss. Type III is DYSAUTONOMIA, FAMILIAL. Type IV features insensitivity to pain, heat intolerance, and mental deficiency. Type V is characterized by a selective loss of pain with intact light touch and vibratory sensation. (From Joynt, Clinical Neurology, 1995, Ch51, pp142-4)','en',1,'2007-10-18 04:28:24',1,NULL,'13623FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13624,143738,'Transplacental infection of the fetus with rubella usually in the first trimester of pregnancy, as a consequence of maternal infection, resulting in various developmental abnormalities in the newborn infant. They include cardiac and ocular lesions, deafness, microcephaly, mental retardation, and generalized growth retardation. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13624FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
