(13638,143813,'An autosomal dominant neuromuscular disorder which usually presents in early adulthood, characterized by progressive muscular atrophy (most frequently involving the hands, forearms, and face), myotonia, frontal baldness, lenticular opacities, and testicular atrophy. Cardiac conduction abnormalities, diaphragmatic weakness, and mild mental retardation may also occur. Congenital myotonic dystrophy is a severe form of this disorder, characterized by neonatal MUSCLE HYPOTONIA, feeding difficulties, respiratory muscle weakness, and an increased incidence of MENTAL RETARDATION. (From Adams et al., Principles of Neurology, 6th ed, pp1423-5; Joynt, Clinical Neurology, 1997, Ch16, pp16-7)','en',1,'2007-10-18 04:28:24',1,NULL,'13638FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13639,143814,'A dominantly inherited muscle disease that begins in early childhood and is characterized by severe myotonia (delayed relaxation of a muscle) after forceful voluntary contractions. Muscular hypertrophy is common and myotonia may impair ambulation and other movements. Myotonia typically becomes less severe with repetitive voluntary contractions of the affected muscles. Generalized myotonia (of Becker) is an autosomal recessive variant of myotonia congenita that may feature more severe myotonia and muscle wasting. (From Adams et al., Principles of Neurology, 6th ed, pp1476-7; Joynt, Clinical Neurology, 1997, Ch53, p18)','en',1,'2007-10-18 04:28:24',1,NULL,'13639FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13640,143815,'A dominantly inherited muscle disease that begins in early childhood and is characterized by severe myotonia (delayed relaxation of a muscle) after forceful voluntary contractions. Muscular hypertrophy is common and myotonia may impair ambulation and other movements. Myotonia typically becomes less severe with repetitive voluntary contractions of the affected muscles. Generalized myotonia (of Becker) is an autosomal recessive variant of myotonia congenita that may feature more severe myotonia and muscle wasting. (From Adams et al., Principles of Neurology, 6th ed, pp1476-7; Joynt, Clinical Neurology, 1997, Ch53, p18)','en',1,'2007-10-18 04:28:24',1,NULL,'13640FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
