(13670,143972,'A group of disorders characterized by the excessive production of porphyrins or their precursors that arises from abnormalities in the regulation of the porphyrin-heme pathway. The porphyrias are usually divided into three broad groups, erythropoietic (PORPHYRIA, ERYTHROPOIETIC), hepatic (PORPHYRIA, HEPATIC), and erythrohepatic (PORPHYRIA, ERYTHROHEPATIC), according to the major sites of abnormal porphyrin synthesis.','en',1,'2007-10-18 04:28:24',1,NULL,'13670FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
