(13675,143989,'A familial disorder characterized by anemia with multinuclear erythroblasts, karyorrhexis, asynchrony of nuclear and cytoplasmic maturation, and various nuclear abnormalities of bone marrow erythrocyte precursors. Type II is the most common of the 3 types of congenital dyserythropoietic anemia; it is often referred to as HEMPAS, based on the Hereditary Erythroblast Multinuclearity with Positive Acidified Serum test.','en',1,'2007-10-18 04:28:24',1,NULL,'13675FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
