(13688,144053,'A general term for the complete or partial loss of the ability to hear from one or both ears. Deafness may result from EAR DISEASES; VESTIBULOCOCHLEAR NERVE DISEASES; or BRAIN DISEASES.','en',1,'2007-10-18 04:28:24',1,NULL,'13688FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13689,144054,'Infection with CYTOMEGALOVIRUS, characterized by enlarged cells bearing intranuclear inclusions. Infection may be in almost any organ, but the salivary glands are the most common site in children, as are the lungs in adults.','en',1,'2007-10-18 04:28:24',1,NULL,'13689FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13690,144058,'A developmental anomaly that usually becomes apparent in the neonatal period with progressive respiratory distress. This malformation is a focal pulmonary dysplasia characterized by a multicystic mass of terminal bronchiolar structures. CCAM is classified into 3 separate types (I, II, III) depending on cyst size.','en',1,'2007-10-18 04:28:24',1,NULL,'13690FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13691,144061,'Cysts of one of the parts of the mediastinum: the superior part, containing the trachea, esophagus, thoracic duct and thymus organs; the inferior middle part, containing the pericardium; the inferior anterior part containing some lymph nodes; and the inferior posterior part, containing the thoracic duct and esophagus.','en',1,'2007-10-18 04:28:24',1,NULL,'13691FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13694,144089,'A congenital cystic dilatation of the common bile duct; this condition may be asymptomatic, or cause vomiting, fever, jaundice, or pain in the right upper quadrant.','en',1,'2007-10-18 04:28:24',1,NULL,'13694FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13695,144091,'A heterogeneous group of nonprogressive motor disorders caused by chronic brain injuries that originate in the prenatal period, perinatal period, or first few years of life. The four major subtypes are spastic, athetoid, ataxic, and mixed cerebral palsy, with spastic forms being the most common. The motor disorder may range from difficulties with fine motor control to severe spasticity (see MUSCLE SPASTICITY) in all limbs. Spastic diplegia (Little disease) is the most common subtype, and is characterized by spasticity that is more prominent in the legs than in the arms. Pathologically, this condition may be associated with LEUKOMALACIA, PERIVENTRICULAR. (From Dev Med Child Neurol 1998 Aug;40(8):520-7)','en',1,'2007-10-18 04:28:24',1,NULL,'13695FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13696,144092,'Cerebral tissue herniation through a congenital or acquired defect in the skull. The majority of congenital encephaloceles occur in the occipital or frontal regions. Clinical features include a protuberant mass that may be pulsatile. The quantity and location of protruding neural tissue determines the type and degree of neurologic deficit. Visual defects, psychomotor developmental delay, and persistent motor deficits frequently occur.','en',1,'2007-10-18 04:28:24',1,NULL,'13696FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
