(13698,144113,'Atresia of the biliary tract, most commonly of the extrahepatic bile ducts.','en',1,'2007-10-18 04:28:24',1,NULL,'13698FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13699,144115,'Loss of the ability to comprehend the meaning or recognize the importance of various forms of stimulation that cannot be attributed to impairment of a primary sensory modality. Tactile agnosia is characterized by an inability to perceive the shape and nature of an object by touch alone, despite unimpaired sensation to light touch, position, and other primary sensory modalities.','en',1,'2007-10-18 04:28:24',1,NULL,'13699FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
