(13703,144131,'Congenital obliteration of the lumen of the intestine, with the ileum involved in 50% of the cases and the jejunum and duodenum following in frequency. It is the most frequent cause of intestinal obstruction in the newborn infant. Its etiology may be related to failure of recanalization during early development or to some impairment of blood supply during intrauterine life. (From Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13703FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
