(13718,144277,'A group of inherited disorders of adrenal steroidogenesis, the physical expression of which varies with the sex of the patient, the severity of the congenital enzyme defect, and the age at which the defect makes its presence felt. The most common form, the simple virilizing form, is due to a 21-hydroxylase deficiency. There is also a salt-losing form (a more complete 21-hydroxylase deficiency), a hypertensive form (11-hydroxylase deficiency), a 17-hydroxylase deficiency form, a desmolase deficiency form, and a 3-beta-hydroxysteroid deficiency form.','en',1,'2007-10-18 04:28:24',1,NULL,'13718FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
