(13726,144399,'A repetitive and persistent pattern of behavior in which the basic rights of others or major age-appropriate societal norms or rules are violated. These behaviors include aggressive conduct that causes or threatens physical harm to other people or animals, nonagressive conduct that causes property loss or damage, deceitfulness or theft, and serious violations of rules. The onset is before age 18. (From DSM-IV, 1994)','en',1,'2007-10-18 04:28:24',1,NULL,'13726FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
