(13729,144409,'A nonspecific term used to describe transient alterations or loss of consciousness following closed head injuries. The duration of UNCONSCIOUSNESS generally lasts a few seconds, but may persist for several hours. Concussions may be classified as mild, intermediate, and severe. Prolonged periods of unconsciousness (often defined as greater than 6 hours in duration) may be referred to as post-traumatic coma (COMA, POST-HEAD INJURY). (From Rowland, Merritt''s Textbook of Neurology, 9th ed, p418)','en',1,'2007-10-18 04:28:24',1,NULL,'13729FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13730,144414,'A microscopically inflammatory, usually reversible, patchy hair loss occurring in sharply defined areas and usually involving the beard or scalp. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13730FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13731,144417,'A condition in which there is a derivation of pleasure from inflicting pain, discomfort or humiliation on another person or persons. The sexual significance of sadistic wishes or behavior may be conscious or unconscious.','en',1,'2007-10-18 04:28:24',1,NULL,'13731FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13732,144418,'Pleasure derived from being physically or psychologically abused, whether inflicted by oneself or by others. Masochism includes sexual masochism.','en',1,'2007-10-18 04:28:24',1,NULL,'13732FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13734,144420,'A sexual disorder occuring in a person 16 years or older and that is recurrent with intense sexually arousing fantasies, sexual urges, or behaviors involving sexual activity with a prepubescent child (generally age 13 or younger). (from APA, DSM-IV, 1994).','en',1,'2007-10-18 04:28:24',1,NULL,'13734FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13735,144421,'An anxiety disorder characterized by recurrent, persistent obsessions or compulsions. Obsessions are the intrusive ideas, thoughts, or images that are experienced as senseless or repugnant. Compulsions are repetitive and seemingly purposeful behavior which the individual generally recognizes as senseless and from which the individual does not derive pleasure although it may provide a release from tension.','en',1,'2007-10-18 04:28:24',1,NULL,'13735FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13736,144422,'An activity distinguished primarily by an element of risk in trying to obtain a desired goal, e.g., playing a game of chance for money.','en',1,'2007-10-18 04:28:24',1,NULL,'13736FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13737,144423,'A disorder in which fantasies about or the act of exposing the genitals to an unsuspecting stranger produces sexual excitement with no attempt at further sexual activity with the stranger.','en',1,'2007-10-18 04:28:24',1,NULL,'13737FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
