(13744,144469,'A subtype of vascular headaches characterized by periodic unilateral pulsatile headaches which begin in childhood, adolescence, or early adult life and recur with diminishing frequency during advancing years. The two major subtypes are CLASSIC MIGRAINE (i.e., migraine with aura) and COMMON MIGRAINE (i.e., migraine without aura). Migrainous episodes may be associated with alterations in cerebral blood flow. (From Adams et al., Principles of Neurology, 6th ed, p172)','en',1,'2007-10-18 04:28:24',1,NULL,'13744FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13745,144470,'A prolonged seizure or seizures repeated frequently enough to prevent recovery between episodes occurring over a period of 20-30 minutes. The most common subtype is generalized tonic-clonic status epilepticus, a potentially fatal condition associated with neuronal injury and respiratory and metabolic dysfunction. Nonconvulsive forms include petit mal status and complex partial status, which may manifest as behavioral disturbances. Simple partial status epilepticus consists of persistent motor, sensory, or autonomic seizures that do not impair cognition (see also EPILEPSIA PARTIALIS CONTINUA). Subclinical status epilepticus generally refers to seizures occurring in an unresponsive or comatose individual in the absence of overt signs of seizure activity. (From N Engl J Med 1998 Apr 2;338(14):970-6; Neurologia 1997 Dec;12 Suppl 6:25-30)','en',1,'2007-10-18 04:28:24',1,NULL,'13745FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13746,144473,'Abnormal overgrowth of endometrium. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13746FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13747,144481,'A chromosome disorder associated either with an extra chromosome 21 or an effective trisomy for chromosome 21. Clinical manifestations include hypotonia, short stature, brachycephaly, upslanting palpebral fissures, epicanthus, Brushfield spots on the iris, protruding tongue, small ears, short, broad hands, fifth finger clinodactyly, Simian crease, and moderate to severe MENTAL RETARDATION. Cardiac and gastrointestinal malformations, a marked increase in the incidence of LEUKEMIA, and the early onset of ALZHEIMER DISEASE are also associated with this condition. Pathologic features include the development of NEUROFIBRILLARY TANGLES in neurons and the deposition of AMYLOID BETA-PROTEIN, similar to the pathology of ALZHEIMER DISEASE. (Menkes, Textbook of Child Neurology, 5th ed, p213)','en',1,'2007-10-18 04:28:24',1,'2013-11-22 19:37:13','13747FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13748,144488,'A congenital cardiovascular malformation in which the aorta arises entirely from the right ventricle and the pulmonary artery from the left ventricle, so that the venous return from the peripheral circulation is recirculated by the right ventricle via the aorta to the systemic circulation without being oxygenated in the lungs.','en',1,'2007-10-18 04:28:24',1,NULL,'13748FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13749,144498,'Lateral transposition of the viscera of the thorax and abdomen. It has a familial pattern and consanguineous parents have been reported. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13749FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13750,144499,'Protrusion of the rectal mucous membrane through the anus. There are various degrees: incomplete with no displacement of the anal sphincter muscle; complete with displacement of the anal sphincter muscle; complete with no displacement of the anal sphincter muscle but with herniation of the bowel; and internal complete with rectosigmoid or upper rectum intussusception into the lower rectum.','en',1,'2007-10-18 04:28:24',1,NULL,'13750FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
