(13924,145041,'Infection of the biliary passages with CLONORCHIS SINENSIS, also called Opisthorchis sinensis. It may lead to inflammation of the biliary tract, proliferation of biliary epithelium, progressive portal fibrosis, and sometimes bile duct carcinoma. Extension to the liver may lead to fatty changes and cirrhosis. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13924FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
