(13926,145044,'Clinical or subclinical disturbances of cortical function due to a sudden, abnormal, excessive, and disorganized discharge of brain cells. Clinical manifestations include abnormal motor, sensory and psychic phenomena. Recurrent seizures are usually referred to as EPILEPSY or \"seizure disorder.\"','en',1,'2007-10-18 04:28:24',1,NULL,'13926FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13927,145058,'Sounds that are perceived in the absence of any external noise source which may take the form of buzzing, ringing, clicking, pulsations, and other noises. Objective tinnitus refers to noises generated from within the ear or adjacent structures that can be heard by other individuals. The term subjective tinnitus is used when the sound is audible only to the affected individual. Tinnitus may occur as a manifestation of COCHLEAR DISEASES; VESTIBULOCOCHLEAR NERVE DISEASES; INTRACRANIAL HYPERTENSION; CRANIOCEREBRAL TRAUMA; and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'13927FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(13928,145059,'A rare autosomal dominant condition in which there is defective ossification of the cranial bones with large fontanels and delayed closing of the sutures, complete or partial absence of the clavicles, wide pubic symphysis, short middle phalanges of the fifth fingers, and dental and vertebral anomalies. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'13928FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
