(13982,145209,'A variant of epilepsy characterized by continuous focal jerking of a body part over a period of hours, days, or even years without spreading to other body regions. Contractions may be aggravated by movement and are reduced, but not abolished during sleep. ELECTROENCEPHALOGRAPHY demonstrates epileptiform (spike and wave) discharges over the hemisphere opposite to the affected limb in most instances. The repetitive movements may originate from the CEREBRAL CORTEX or from subcortical structures (e.g., BRAIN STEM; BASAL GANGLIA). This condition is associated with Russian Spring and Summer encephalitis (see ENCEPHALITIS, TICK BORNE); Rasmussen syndrome (see ENCEPHALITIS); MULTIPLE SCLEROSIS; DIABETES MELLITUS; BRAIN NEOPLASMS; and CEREBROVASCULAR DISORDERS. (From Brain, 1996 April;119(pt2):393-407; Epilepsia 1993;34;Suppl 1:S29-S36; and Adams et al., Principles of Neurology, 6th ed, p319)','en',1,'2007-10-18 04:28:24',1,NULL,'13982FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
