(13985,145218,'A collective term for a clinical and pathological syndrome which has several causes and is characterized by varying degrees of hepatocellular necrosis and inflammation. Specific forms of chronic hepatitis include autoimmune hepatitis (HEPATITIS, AUTOIMMUNE), chronic hepatitis B (HEPATITIS B, CHRONIC), chronic hepatitis C (HEPATITIS C, CHRONIC), chronic hepatitis D (HEPATITIS D, CHRONIC), indeterminate chronic viral hepatitis, cryptogenic chronic hepatitis and drug-related chronic hepatitis (HEPATITIS, CHRONIC, DRUG-INDUCED).','en',1,'2007-10-18 04:28:24',1,NULL,'13985FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
