(14110,145545,'A malignant tumor of trophoblastic epithelium characterized by secretion of large amounts of chorionic gonadotropin. It usually originates from chorionic products of conception (i.e., hydatidiform mole, normal pregnancy, or following abortion), but can originate in a teratoma of the testis, mediastinum, or pineal gland.','en',1,'2007-10-18 04:28:24',1,NULL,'14110FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14111,145547,'An extremely common benign tumor, occurring most commonly in infancy and childhood, made up of newly formed blood vessels, and resulting from malformation of angioblastic tissue of fetal life. It can occur anywhere in the body but is most frequently noticed in the skin and subcutaneous tissues. About 75% are present at birth, and about 60% occur in the head and neck area. The majority in infancy will regress spontaneously. Some hemangiomas grow rapidly during the early months of life and may be a source of some concern, although virtually all disappear by about 5 years of age. They do not metastasize and simple excision will often be curative. (Dorland, 27th ed; from Stedman, 25th ed; DeVita Jr et al., Cancer: Principles & Practice of Oncology, 3d ed, p1355)','en',1,'2007-10-18 04:28:24',1,NULL,'14111FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14112,145548,'An inflammatory process involving the chorion, its fetal blood vessels, the umbilical cord, and the amnion by extension of the inflammation, as the amnion itself has no blood supply. This inflammatory process is potentially fatal to mother and fetus.','en',1,'2007-10-18 04:28:24',1,'2016-07-10 02:59:25','14112FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14113,145550,'Syndromes which feature DYSKINESIAS as a cardinal manifestation of the disease process. Included in this category are degenerative, hereditary, post-infectious, medication-induced, post-inflammatory, and post-traumatic conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'14113FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14114,145552,'A rare disorder characterized by the development of chorea, athetosis, and/or hemiballismus during pregnancy. RHEUMATIC FEVER and collagen vascular disorders are frequently associated with this disease. Chorea may vary from mild to severe and occurs in approximately 1 per 2,000 to 3,000 pregnancies. (From Md Med J 1997 Sep;46(8):436-9)','en',1,'2007-10-18 04:28:24',1,NULL,'14114FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
