(14118,145564,'A heterogeneous group of bone dysplasias, the common character of which is stippling of the epiphyses in infancy. The group includes a severe autosomal recessive form (CHONDRODYSPLASIA PUNCTATA, RHIZOMELIC), an autosomal dominant form (Conradi-Hunermann syndrome), and a milder X-linked form. Metabolic defects associated with impaired peroxisomes are present only in the rhizomelic form.','en',1,'2007-10-18 04:28:24',1,NULL,'14118FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
