(14124,145602,'A condition produced by a deficiency of CHOLINE in animals. Choline is known as a lipotropic agent because it has been shown to promote the transport of excess fat from the liver under certain conditions in laboratory animals. Combined deficiency of choline (included in the B vitamin complex) and all other methyl group donors causes liver cirrhosis in some animals. Unlike compounds normally considered as vitamins, choline does not serve as a cofactor in enzymatic reactions. (From Saunders Dictionary & Encyclopedia of Laboratory Medicine and Technology, 1984)','en',1,'2007-10-18 04:28:24',1,NULL,'14124FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
