(14149,145673,'A subacute or chronic inflammatory disease of muscle and skin, marked by proximal muscle weakness and a characteristic skin rash. The illness occurs with approximately equal frequency in children and adults. The skin lesions usually take the form of a purplish rash (or less often an exfoliative dermatitis) involving the nose, cheeks, forehead, upper trunk, and arms. The disease is associated with a complement mediated intramuscular microangiopathy, leading to loss of capillaries, muscle ischemia, muscle-fiber necrosis, and perifascicular atrophy. The childhood form of this disease tends to evolve into a systemic vasculitis. Dermatomyositis may occur in association with malignant neoplasms. (From Adams et al., Principles of Neurology, 6th ed, pp1405-6)','en',1,'2007-10-18 04:28:24',1,NULL,'14149FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14151,145677,'Disorders in the processing of phosphorus in the body: its absorption, transport, storage, and utilization.','en',1,'2007-10-18 04:28:24',1,NULL,'14151FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14152,145678,'Conditions characterized by recurrent paroxysmal neuronal discharges which arise from a focal region of the brain. Partial seizures are divided into simple and complex, depending on whether consciousness is unaltered (simple partial seizure) or disturbed (complex partial seizure). Both types may feature a wide variety of motor, sensory, and autonomic symptoms. Partial seizures may be classified by associated clinical features or anatomic location of the seizure focus. A secondary generalized seizure refers to a partial seizure that spreads to involve the brain diffusely. (From Adams et al., Principles of Neurology, 6th ed, pp317)','en',1,'2007-10-18 04:28:24',1,NULL,'14152FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14153,145680,'A disorder beginning in childhood. It is marked by the presence of markedly abnormal or impaired development in social interaction and communication and a markedly restricted repertoire of activity and interest. Manifestations of the disorder vary greatly depending on the developmental level and chronological age of the individual. (DSM-IV)','en',1,'2007-10-18 04:28:24',1,NULL,'14153FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14154,145682,'Persistent abnormal dilatation of the bronchi.','en',1,'2007-10-18 04:28:24',1,NULL,'14154FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14155,145683,'A form of bronchial disorder associated with airway obstruction, marked by recurrent attacks of paroxysmal dyspnea, with wheezing due to spasmodic contraction of the bronchi.','en',1,'2007-10-18 04:28:24',1,NULL,'14155FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14156,145689,'The inability to generate oral-verbal expression, despite normal comprehension of speech. This may be associated with BRAIN DISEASES or MENTAL DISORDERS. Organic mutism may be associated with damage to the FRONTAL LOBE; BRAIN STEM; THALAMUS; and CEREBELLUM. Selective mutism is a psychological condition that usually affects children characterized by continuous refusal to speak in social situations by a child who is able and willing to speak to selected persons. Kussmal aphasia refers to mutism in psychosis. (From Fortschr Neurol Psychiatr 1994; 62(9):337-44)','en',1,'2007-10-18 04:28:24',1,NULL,'14156FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14157,145691,'Sexual maltreatment of the child or minor.','en',1,'2007-10-18 04:28:24',1,NULL,'14157FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14159,145695,'A behavior disorder originating in childhood in which the essential features are signs of developmentally inappropriate inattention, impulsivity, and hyperactivity. Although most individuals have symptoms of both inattention and hyperactivity-impulsivity, one or the other pattern may be predominant. The disorder is more frequent in males than females. Onset is in childhood. Symptoms often attenuate during late adolescence although a minority experience the full complement of symptoms into mid-adulthood. (From DSM-IV)','en',1,'2007-10-18 04:28:24',1,NULL,'14159FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14160,145696,'Recurrent localized itching, swelling and painful erythema on the fingers, toes or ears, produced by exposure to cold. It is also called pernio.','en',1,'2007-10-18 04:28:24',1,NULL,'14160FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14161,145697,'An idiopathic systemic inflammatory granulomatous disorder comprised of epithelioid and multinucleated giant cells with little necrosis. It usually invades the lungs with fibrosis and may also involve lymph nodes, skin, liver, spleen, eyes, phalangeal bones, and parotid glands.','en',1,'2007-10-18 04:28:24',1,NULL,'14161FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14162,145698,'A highly contagious infectious disease caused by the varicella-zoster virus (HERPESVIRUS 3, HUMAN). It usually affects children, is spread by direct contact or respiratory route via droplet nuclei, and is characterized by the appearance on the skin and mucous membranes of successive crops of typical pruritic vesicular lesions that are easily broken and become scabbed. Chickenpox is relatively benign in children, but may be complicated by pneumonia and encephalitis in adults. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14162FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14164,145700,'Imperfections or malformations of the heart, existing at birth.','en',1,'2007-10-18 04:28:24',1,NULL,'14164FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14165,145701,'A group of congenital malformations involving the brainstem, cerebellum, upper spinal cord, and surrounding bony structures. Type II is the most common, and features compression of the medulla and cerebellar tonsils into the upper cervical spinal canal and an associated MENINGOMYELOCELE. Type I features similar, but less severe malformations and is without an associated meningomyelocele. Type III has the features of type II with an additional herniation of the entire cerebellum through the bony defect involving the foramen magnum, forming an ENCEPHALOCELE. Type IV is a form a cerebellar hypoplasia. Clinical manifestations of types I-III include TORTICOLLIS; opisthotonus;;HEADACHE; VERTIGO; VOCAL CORD PARALYSIS; APNEA; NYSTAGMUS; swallowing difficulties; and ATAXIA. (From Menkes, Textbook of Child Neurology, 5th ed, p261; Davis, Textbook of Neuropathology, 2nd ed, pp236-46)','en',1,'2007-10-18 04:28:24',1,NULL,'14165FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
