(14169,145705,'A group of congenital malformations involving the brainstem, cerebellum, upper spinal cord, and surrounding bony structures. Type II is the most common, and features compression of the medulla and cerebellar tonsils into the upper cervical spinal canal and an associated MENINGOMYELOCELE. Type I features similar, but less severe malformations and is without an associated meningomyelocele. Type III has the features of type II with an additional herniation of the entire cerebellum through the bony defect involving the foramen magnum, forming an ENCEPHALOCELE. Type IV is a form a cerebellar hypoplasia. Clinical manifestations of types I-III include TORTICOLLIS; opisthotonus;;HEADACHE; VERTIGO; VOCAL CORD PARALYSIS; APNEA; NYSTAGMUS; swallowing difficulties; and ATAXIA. (From Menkes, Textbook of Child Neurology, 5th ed, p261; Davis, Textbook of Neuropathology, 2nd ed, pp236-46)','en',1,'2007-10-18 04:28:24',1,NULL,'14169FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14170,145706,'An abnormal pattern of breathing characterized by alternating periods of apnea and deep, rapid breathing. The cycle begins with slow, shallow breaths that gradually increase in depth and rate and is then followed by a period of apnea. The period of apnea can last 5 to 30 seconds, then the cycle repeats every 45 seconds to 3 minutes.','en',1,'2007-10-18 04:28:24',1,NULL,'14170FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14171,145707,'A group of disorders characterized by the excessive production of porphyrins or their precursors that arises from abnormalities in the regulation of the porphyrin-heme pathway. The porphyrias are usually divided into three broad groups, erythropoietic (PORPHYRIA, ERYTHROPOIETIC), hepatic (PORPHYRIA, HEPATIC), and erythrohepatic (PORPHYRIA, ERYTHROHEPATIC), according to the major sites of abnormal porphyrin synthesis.','en',1,'2007-10-18 04:28:24',1,NULL,'14171FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14173,145716,'Maladaptive reactions to identifiable psychosocial stressors occurring within a short time after onset of the stressor. They are manifested by either impairment in social or occupational functioning or by symptoms (depression, anxiety, etc.) that are in excess of a normal and expected reaction to the stressor.','en',1,'2007-10-18 04:28:24',1,NULL,'14173FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14174,145717,'A fibro-osseous hereditary disease of the jaws. The swollen jaws and raised eyes give a cherubic appearance; multiple radiolucencies are evident upon radiographic examination.','en',1,'2007-10-18 04:28:24',1,NULL,'14174FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14175,145720,'A disturbance of lipid metabolism with abnormal deposit of lipids in the cells. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14175FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14176,145722,'A syndrome characterized by headache, neck stiffness, low grade fever, and CSF lymphocytic pleocytosis in the absence of an acute bacterial pathogen. Viral meningitis is the most frequent cause although MYCOPLASMA INFECTIONS; RICKETTSIA INFECTIONS; diagnostic or therapeutic procedures; NEOPLASTIC PROCESSES; septic perimeningeal foci; and other conditions may result in this syndrome. (From Adams et al., Principles of Neurology, 6th ed, p745)','en',1,'2007-10-18 04:28:24',1,NULL,'14176FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14177,145736,'An idiopathic syndrome characterized by one or more of the following; recurrent orofacial swelling, relapsing facial paralysis, and fissured tongue (lingua plicata). The onset is usually in childhood and relapses are common. Cheilitis granulomatosa is a monosymptomatic variant of this condition. (Dermatol Clin 1996 Apr;14(2):371-9; Magalini & Magalini, Dictionary of Medical Syndromes, 4th ed, p531)','en',1,'2007-10-18 04:28:24',1,NULL,'14177FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14178,145740,'Inflammation of the lips. It is of various etiologies and degrees of pathology.','en',1,'2007-10-18 04:28:24',1,NULL,'14178FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14179,145748,'Gait abnormalities that are a manifestation of nervous system dysfunction. These conditions may be caused by a wide variety of disorders which affect motor control, sensory feedback, and muscle strength including: CENTRAL NERVOUS SYSTEM DISEASES; PERIPHER','en',1,'2007-10-18 04:28:24',1,NULL,'14179FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14180,145749,'Parenchymatous NEUROSYPHILIS marked by slowly progressive degeneration of the posterior columns, posterior roots, and ganglia of the spinal cord. The condition tends to present 15 to 20 years after the initial infection and is characterized by lightening-like pains in the lower extremities, URINARY INCONTINENCE, ATAXIA, severely impaired position and vibratory sense, abnormal gait (see GAIT DISORDERS, NEUROLOGIC), OPTIC ATROPHY, Argyll-Robertson pupils, hypotonia, hyperreflexia, and trophic joint degeneration (Charcot''s Joint; see ARTHROPATHY, NEUROGENIC). (From Adams et al., Principles of Neurology, 6th ed, p726)','en',1,'2007-10-18 04:28:24',1,NULL,'14180FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14181,145750,'A hereditary motor and sensory neuropathy transmitted most often as an autosomal dominant trait and characterized by progressive distal wasting and loss of reflexes in the muscles of the legs (and occasionally involving the arms). Onset is usually in the second to fourth decade of life. This condition has been divided into two subtypes, hereditary motor and sensory neuropathy (HMSN) types I and II. HMSN I is associated with abnormal nerve conduction velocities and nerve hypertrophy, features not seen in HMSN II. (Adams et al., Principles of Neurology, 6th ed, p1343)','en',1,'2007-10-18 04:28:24',1,NULL,'14181FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14182,145752,'A hereditary motor and sensory neuropathy transmitted most often as an autosomal dominant trait and characterized by progressive distal wasting and loss of reflexes in the muscles of the legs (and occasionally involving the arms). Onset is usually in the second to fourth decade of life. This condition has been divided into two subtypes, hereditary motor and sensory neuropathy (HMSN) types I and II. HMSN I is associated with abnormal nerve conduction velocities and nerve hypertrophy, features not seen in HMSN II. (Adams et al., Principles of Neurology, 6th ed, p1343)','en',1,'2007-10-18 04:28:24',1,NULL,'14182FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
