(14184,145754,'A hereditary motor and sensory neuropathy transmitted most often as an autosomal dominant trait and characterized by progressive distal wasting and loss of reflexes in the muscles of the legs (and occasionally involving the arms). Onset is usually in the second to fourth decade of life. This condition has been divided into two subtypes, hereditary motor and sensory neuropathy (HMSN) types I and II. HMSN I is associated with abnormal nerve conduction velocities and nerve hypertrophy, features not seen in HMSN II. (Adams et al., Principles of Neurology, 6th ed, p1343)','en',1,'2007-10-18 04:28:24',1,NULL,'14184FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14185,145755,'Established behavior pattern characterized by excessive drive and ambition, impatience, competitiveness, sense of time urgency, and poorly contained aggression.','en',1,'2007-10-18 04:28:24',1,NULL,'14185FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14186,145757,'Influenza-like febrile viral disease caused by several members of the BUNYAVIRIDAE family and transmitted mostly by the bloodsucking sandfly Phlebotomus papatasii.','en',1,'2007-10-18 04:28:24',1,NULL,'14186FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14187,145762,'Acute, localized autoinoculable infectious disease usually acquired through sexual contact. Caused by HAEMOPHILUS DUCREYI, it occurs endemically almost worldwide, especially in tropical and subtropical countries and more commonly in seaports and urban areas than in rural areas.','en',1,'2007-10-18 04:28:24',1,'2016-05-21 14:01:12','14187FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14188,145763,'Infection with a fungus of the genus COCCIDIOIDES, species C. immitis. The primary form is an acute, benign, self-limited respiratory infection due to inhalation of spores and varying in severity. The secondary form is a virulent, severe, chronic, progressive granulomatous disease with systemic involvement. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14188FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14189,145766,'Pneumoconiosis due to the inhalation of dust of stone, sand, or flint containing silicon dioxide, with formation of generalized, nodular fibrotic changes in both lungs. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14189FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14190,145771,'A form of trypanosomiasis endemic in Central and South America, caused by TRYPANOSOMA CRUZI. It may follow either an acute or chronic course, the former commonly in children.','en',1,'2007-10-18 04:28:24',1,NULL,'14190FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14191,145772,'Cardiomyopathy with conduction defects and cardiac enlargement characteristic of the last phase of CHAGAS DISEASE.','en',1,'2007-10-18 04:28:24',1,NULL,'14191FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14192,145774,'A form of phagocyte bactericidal dysfunction characterized by unusual oculocutaneous albinism, high incidence of lymphoreticular neoplasms, and recurrent pyogenic infections. In many cell types, abnormal lysosomes are present leading to defective pigment distribution and abnormal neutrophil functions. The disease is transmitted by autosomal recessive inheritance and a similar disorder occurs in the beige mouse, the Aleutian mink, and albino Hereford cattle.','en',1,'2007-10-18 04:28:24',1,NULL,'14192FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14193,145777,'Patient has had a cesarean section procedure in the recent past.','en',1,'2007-10-18 04:28:24',1,'2016-07-10 03:57:37','14193FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14194,145780,'A form of ACTINOMYCOSIS characterized by slow-growing inflammatory lesions of the lymph nodes that drain the mouth (lumpy jaw), reddening of the overlying skin, and intraperitoneal abscesses.','en',1,'2007-10-18 04:28:24',1,NULL,'14194FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14195,145781,'Outgrowth of immature bony processes from the vertebrae, reflecting the presence of degenerative disease and calcification. It includes cervical and lumbar spondylosis.','en',1,'2007-10-18 04:28:24',1,NULL,'14195FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
