(14197,145794,'Outgrowth of immature bony processes from the vertebrae, reflecting the presence of degenerative disease and calcification. It includes cervical and lumbar spondylosis.','en',1,'2007-10-18 04:28:24',1,NULL,'14197FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14198,145795,'Narrowing of the spinal canal.','en',1,'2007-10-18 04:28:24',1,NULL,'14198FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14199,145800,'Development of the fertilized ovum outside of the uterine cavity. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14199FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14200,145806,'A malignancy arising in uterine cervical epithelium and confined thereto, representing a continuum of histological changes ranging from well-differentiated CIN 1 (formerly, mild dysplasia) to severe dysplasia/carcinoma in situ, CIN 3. The lesion arises at the squamocolumnar cell junction at the transformation zone of the endocervical canal, with a variable tendency to develop invasive epidermoid carcinoma, a tendency that is enhanced by concomitant human papillomaviral infection. (Segen, Dictionary of Modern Medicine, 1992)','en',1,'2007-10-18 04:28:24',1,NULL,'14200FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14201,145807,'A spectrum of histologic changes in the epithelium of the cervix uteri which may begin as a superficial lesion and progress to invasive carcinoma.','en',1,'2007-10-18 04:28:24',1,NULL,'14201FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14202,145808,'A spectrum of histologic changes in the epithelium of the cervix uteri which may begin as a superficial lesion and progress to invasive carcinoma.','en',1,'2007-10-18 04:28:24',1,NULL,'14202FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14203,145809,'A spectrum of histologic changes in the epithelium of the cervix uteri which may begin as a superficial lesion and progress to invasive carcinoma.','en',1,'2007-10-18 04:28:24',1,NULL,'14203FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14204,145811,'Habitual abortion in which painless bloodless dilatation of the cervix in the second trimester of pregnancy is followed by rupture of membranes and expulsion of a fetus so immature that it usually dies.','en',1,'2007-10-18 04:28:24',1,NULL,'14204FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14206,145823,'A spectrum of histologic changes in the epithelium of the cervix uteri which may begin as a superficial lesion and progress to invasive carcinoma.','en',1,'2007-10-18 04:28:24',1,NULL,'14206FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14207,145830,'Diseases of intracranial arteries which supply the cerebrum of the brain, including the ANTERIOR CEREBRAL ARTERY; MIDDLE CEREBRAL ARTERY; and POSTERIOR CEREBRAL ARTERY. Included in this category are atherosclerotic, congenital, traumatic, infectious, inflammatory, and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'14207FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14208,145831,'A general term most often used to describe severe or complete loss of muscle strength due to motor system disease from the level of the cerebral cortex to the muscle fiber. This term may also occasionally refer to a loss of sensory function. (From Adams et al., Principles of Neurology, 6th ed, p45)','en',1,'2007-10-18 04:28:24',1,NULL,'14208FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14209,145832,'Discharge of cerebrospinal fluid through the nose. Common etiologies include trauma, neoplasms, and prior surgery, although the condition may occur spontaneously. (Otolaryngol Head Neck Surg 1997 Apr;116(4):442-9)','en',1,'2007-10-18 04:28:24',1,NULL,'14209FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14210,145833,'Discharge of cerebrospinal fluid through the external auditory meatus or through the eustachian tube into the nasopharynx. This is usually associated with CRANIOCEREBRAL TRAUMA (e.g., SKULL FRACTURE involving the TEMPORAL BONE), NEUROSURGICAL PROCEDURES, or other conditions, but may rarely occur spontaneously. (From Am J Otol 1995 Nov;16(6):765-71)','en',1,'2007-10-18 04:28:24',1,NULL,'14210FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14211,145834,'Pathologic processes that affect patients after a surgical procedure. They may or may not be related to the disease for which the surgery was done, and they may or may not be direct results of the surgery.','en',1,'2007-10-18 04:28:24',1,NULL,'14211FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14212,145836,'Bleeding into a cerebral hemisphere of the brain, including lobar, subcortical white matter, and basal ganglia hemorrhages. Commonly associated conditions include HYPERTENSION; INTRACRANIAL ARTERIOSCLEROSIS; INTRACRANIAL ANEURYSM; CRANIOCEREBRAL TRAUMA; INTRACRANIAL ARTERIOVENOUS MALFORMATIONS; CEREBRAL AMYLOID ANGIOPATHY; and CEREBRAL INFARCTION.','en',1,'2007-10-18 04:28:24',1,NULL,'14212FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14213,145842,'A circumscribed collection of purulent exudate in the brain, due to bacterial and other infections. The majority are caused by spread of infected material from a focus of suppuration elsewhere in the body, notably the PARANASAL SINUSES, middle ear (see EAR, MIDDLE), HEART (see also ENDOCARDITIS, BACTERIAL), and LUNG. Penetrating CRANIOCEREBRAL TRAUMA and NEUROSURGICAL PROCEDURES may also be associated with this condition. Clinical manifestations include HEADACHE, SEIZURES, focal neurologic deficits, and alterations of consciousness. (Adams et al., Principles of Neurology, 6th ed, pp712-6)','en',1,'2007-10-18 04:28:24',1,NULL,'14213FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14214,145844,'Severe or complete loss of motor function in the lower extremities and lower portions of the trunk. This condition is most often associated with SPINAL CORD DISEASES, although BRAIN DISEASES; PERIPHERAL NERVOUS SYSTEM DISEASES; NEUROMUSCULAR DISEASES; and MUSCULAR DISEASES may also cause bilateral leg weakness.','en',1,'2007-10-18 04:28:24',1,NULL,'14214FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14215,145845,'Mild to moderate loss of bilateral lower extremity motor function, which may be a manifestation of SPINAL CORD DISEASES; PERIPHERAL NERVOUS SYSTEM DISEASES; MUSCULAR DISEASES; INTRACRANIAL HYPERTENSION; parasagittal brain lesions; and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'14215FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14216,145847,'A heterogeneous group of nonprogressive motor disorders caused by chronic brain injuries that originate in the prenatal period, perinatal period, or first few years of life. The four major subtypes are spastic, athetoid, ataxic, and mixed cerebral palsy, with spastic forms being the most common. The motor disorder may range from difficulties with fine motor control to severe spasticity (see MUSCLE SPASTICITY) in all limbs. Spastic diplegia (Little disease) is the most common subtype, and is characterized by spasticity that is more prominent in the legs than in the arms. Pathologically, this condition may be associated with LEUKOMALACIA, PERIVENTRICULAR. (From Dev Med Child Neurol 1998 Aug;40(8):520-7)','en',1,'2007-10-18 04:28:24',1,NULL,'14216FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14219,145851,'A condition characterized by somnolence or coma in the presence of an acute infection with PLASMODIUM FALCIPARUM (and rarely other Plasmodium species). Initial clinical manifestations include HEADACHES, SEIZURES, and alterations of mentation followed by a rapid progression to COMA. Pathologic features include cerebral capillaries filled with parasitized erythrocytes and multiple small foci of cortical and subcortical necrosis. (From Adams et al., Principles of Neurology, 6th ed, p136)','en',1,'2007-10-18 04:28:24',1,'2012-06-14 00:41:02','14219FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14220,145851,'Homa kali ya ubongo','sw',1,'2007-12-11 21:19:40',1,'2012-06-14 00:41:02','14220FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14221,145853,'Localized reduction of blood flow to brain tissue due to arterial obtruction or systemic hypoperfusion. This frequently occurs in conjuction with brain hypoxia (HYPOXIA, BRAIN). Prolonged ischemia is associated with BRAIN INFARCTION.','en',1,'2007-10-18 04:28:24',1,NULL,'14221FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14222,145855,'The formation of an area of necrosis in the cerebrum caused by an insufficiency of arterial or venous blood flow. Infarcts of the cerebrum are generally classified by hemisphere (i.e., left vs. right), lobe (e.g., frontal lobe infarction), arterial distribution (e.g., INFARCTION, ANTERIOR CEREBRAL ARTERY), and etiology (e.g., embolic infarction).','en',1,'2007-10-18 04:28:24',1,NULL,'14222FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14223,145857,'Deficiency of sodium in the blood; salt depletion. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14223FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14224,145858,'Excessive amount of sodium in the blood. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14224FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14225,145859,'Cerebral tissue herniation through a congenital or acquired defect in the skull. The majority of congenital encephaloceles occur in the occipital or frontal regions. Clinical features include a protuberant mass that may be pulsatile. The quantity and location of protruding neural tissue determines the type and degree of neurologic deficit. Visual defects, psychomotor developmental delay, and persistent motor deficits frequently occur.','en',1,'2007-10-18 04:28:24',1,NULL,'14225FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14226,145864,'Bleeding into a cerebral hemisphere of the brain, including lobar, subcortical white matter, and basal ganglia hemorrhages. Commonly associated conditions include HYPERTENSION; INTRACRANIAL ARTERIOSCLEROSIS; INTRACRANIAL ANEURYSM; CRANIOCEREBRAL TRAUMA; INTRACRANIAL ARTERIOVENOUS MALFORMATIONS; CEREBRAL AMYLOID ANGIOPATHY; and CEREBRAL INFARCTION.','en',1,'2007-10-18 04:28:24',1,'2013-04-10 02:45:24','14226FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14227,145865,'Embolism or thrombosis involving blood vessels which supply intracranial structures. Emboli may originate from extracranial or intracranial sources. Thrombosis may occur in arterial or venous structures.','en',1,'2007-10-18 04:28:24',1,NULL,'14227FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14229,145872,'Meningeal inflammation produced by CRYPTOCOCCUS NEOFORMANS, an encapsulated yeast that tends to infect individuals with ACQUIRED IMMUNODEFICIENCY SYNDROME and other immunocompromised states. The organism enters the body through the respiratory tract, but symptomatic infections are usually limited to the lungs and nervous system. The organism may also produce parenchymal brain lesions (torulomas). Clinically, the course is subacute and may feature HEADACHE; NAUSEA; PHOTOPHOBIA; focal neurologic deficits; SEIZURES; cranial neuropathies; and HYDROCEPHALUS. (From Adams et al., Principles of Neurology, 6th ed, pp721-2)','en',1,'2007-10-18 04:28:24',1,NULL,'14229FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14230,145876,'Loss of higher cortical functions with retained awareness due to multiple cortical or subcortical CEREBRAL INFARCTION. Memory, judgement, attention span, and impulse control are often impaired, and may be accompanied by PSEUDOBULBAR PALSY, hemiparesis, reflex abnormalities, and other signs of localized neurologic dysfunction. (From Adams et al., Principles of Neurology, 6th ed, p1060)','en',1,'2007-10-18 04:28:24',1,NULL,'14230FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14231,145877,'Vascular diseases characterized by thickening, hardening, and remodeling of the walls of intracranial arteries. There are three subtypes: 1) atherosclerosis, marked by fatty depositions in the innermost layer of the arterial walls, 2) Monckeberg''s sclerosis, which features calcium deposition in the media and 3) arteriolosclerosis, which refers to sclerosis of small caliber arteries. Clinically, this process may be associated with ISCHEMIC ATTACK, TRANSIENT; BRAIN INFARCTION; INTRACRANIAL EMBOLISM AND THROMBOSIS; or INTRACRANIAL ANEURYSM.','en',1,'2007-10-18 04:28:24',1,NULL,'14231FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14232,145878,'Vascular diseases characterized by thickening, hardening, and remodeling of the walls of intracranial arteries. There are three subtypes: 1) atherosclerosis, marked by fatty depositions in the innermost layer of the arterial walls, 2) Monckeberg''s sclerosis, which features calcium deposition in the media and 3) arteriolosclerosis, which refers to sclerosis of small caliber arteries. Clinically, this process may be associated with ISCHEMIC ATTACK, TRANSIENT; BRAIN INFARCTION; INTRACRANIAL EMBOLISM AND THROMBOSIS; or INTRACRANIAL ANEURYSM.','en',1,'2007-10-18 04:28:24',1,NULL,'14232FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14233,145879,'Congenital or acquired abnormal outpouching of an intracranial blood vessel wall. Saccular (berry) aneurysms are the most common variant, and tend to form at arterial branch points near the base of the brain. Rupture results in SUBARACHNOID HEMORRHAGE or INTRACRANIAL HEMORRHAGES. Giant aneurysms (>2.5 cm in diameter) may compress adjacent structures, including the OCULOMOTOR NERVE (see also OCULOMOTOR NERVE DISEASES). (From Adams et al., Principles of Neurology, 6th ed, p841)','en',1,'2007-10-18 04:28:24',1,NULL,'14233FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14234,145883,'A heterogeneous group of disorders that includes sporadic and familial forms, characterized clinically by cerebral ischemia (see BRAIN ISCHEMIA), CEREBRAL INFARCTION, and CEREBRAL HEMORRHAGE. Pathologically the condition is marked by the deposition of amyloid in the walls of small vessels in the cerebral cortex and meninges. The sporadic form is associated with lobar cerebral hemorrhage in the elderly and ALZHEIMER DISEASE. (From Neuropathol Appl Neurobiol 1996 Jun;22(3):216-227; Adams et al., Principles of Neurology, 6th ed, p852)','en',1,'2007-10-18 04:28:24',1,NULL,'14234FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14235,145884,'A circumscribed collection of purulent exudate in the brain, due to bacterial and other infections. The majority are caused by spread of infected material from a focus of suppuration elsewhere in the body, notably the PARANASAL SINUSES, middle ear (see EAR, MIDDLE), HEART (see also ENDOCARDITIS, BACTERIAL), and LUNG. Penetrating CRANIOCEREBRAL TRAUMA and NEUROSURGICAL PROCEDURES may also be associated with this condition. Clinical manifestations include HEADACHE, SEIZURES, focal neurologic deficits, and alterations of consciousness. (Adams et al., Principles of Neurology, 6th ed, pp712-6)','en',1,'2007-10-18 04:28:24',1,'2015-12-31 21:01:40','14235FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14237,145907,'Bleeding within the intracranial cavity, including hemorrhages in the brain and within the cranial epidural, subdural, and subarachnoid spaces.','en',1,'2007-10-18 04:28:24',1,NULL,'14237FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14238,145909,'Disorders of speech articulation caused by imperfect coordination of pharnyx, larnyx, tongue, or face muscles. This may result from CRANIAL NERVE DISEASES; NEUROMUSCULAR DISEASES; CEREBELLAR DISEASES; BASAL GANGLIA DISEASES; BRAIN STEM diseases; or diseases of the corticobulbar tracts (see PYRAMIDAL TRACTS). The cortical language centers are intact in this condition. (From Adams et al., Principles of Neurology, 6th ed, p489)','en',1,'2007-10-18 04:28:24',1,NULL,'14238FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14239,145929,'Infection with flukes (trematodes) of the genus SCHISTOSOMA. Three species produce the most frequent clinical diseases: SCHISTOSOMA HAEMATOBIUM (endemic in Africa and the Middle East), SCHISTOSOMA MANSONI (in Egypt, northern and southern Africa, some West Indies islands, northern 2/3 of South America), and SCHISTOSOMA JAPONICUM (in Japan, China, the Philippines, Celebes, Thailand, Laos). S. mansoni is often seen in Puerto Ricans living in the United States. (Merck Manual, 15th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14239FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14240,145930,'Infection with flukes (trematodes) of the genus SCHISTOSOMA. Three species produce the most frequent clinical diseases: SCHISTOSOMA HAEMATOBIUM (endemic in Africa and the Middle East), SCHISTOSOMA MANSONI (in Egypt, northern and southern Africa, some West Indies islands, northern 2/3 of South America), and SCHISTOSOMA JAPONICUM (in Japan, China, the Philippines, Celebes, Thailand, Laos). S. mansoni is often seen in Puerto Ricans living in the United States. (Merck Manual, 15th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14240FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14241,145931,'Infection with flukes (trematodes) of the genus SCHISTOSOMA. Three species produce the most frequent clinical diseases: SCHISTOSOMA HAEMATOBIUM (endemic in Africa and the Middle East), SCHISTOSOMA MANSONI (in Egypt, northern and southern Africa, some West Indies islands, northern 2/3 of South America), and SCHISTOSOMA JAPONICUM (in Japan, China, the Philippines, Celebes, Thailand, Laos). S. mansoni is often seen in Puerto Ricans living in the United States. (Merck Manual, 15th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14241FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14242,145935,'Medical problems associated with labor including cephalopelvic disproportion, hemorrhage, FETAL DISTRESS, or other disorders.','en',1,'2007-10-18 04:28:24',1,'2013-10-31 02:51:42','14242FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14243,145945,'Separation of the inner layers of the retina (neural retina) from the pigment epithelium. Retinal detachment occurs more commonly in men than in women, in eyes with degenerative myopia, in aging and in aphakia. It may occur after an uncomplicated cataract extraction, but it is seen more often if vitreous humor has been lost during surgery. (Dorland, 27th ed; Newell, Ophthalmology: Principles and Concepts, 7th ed, p310-12).','en',1,'2007-10-18 04:28:24',1,NULL,'14243FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14244,145946,'Occlusion of the retinal vein. Those at high risk for this condition include patients with hypertension, diabetes mellitus, arteriosclerosis, and other cardiovascular diseases.','en',1,'2007-10-18 04:28:24',1,NULL,'14244FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14245,145947,'Occlusion or closure of the central retinal artery causing sudden, usually nearly complete, loss of vision in one eye. Occlusion of the branch retinal artery causes sudden visual loss in only a portion of the visual field.','en',1,'2007-10-18 04:28:24',1,NULL,'14245FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14246,145948,'An abnormal triangular fold of membrane in the interpalpebral fissure, extending from the conjunctiva to the cornea, being immovably united to the cornea at its apex, firmly attached to the sclera throughout its middle portion, and merged with the conjunctiva at its base. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14246FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14247,145949,'A demyelinating condition affecting the PONS and characterized clinically by an acute progressive QUADRIPLEGIA; DYSARTHRIA; DYSPHAGIA; and alterations of consciousness. Pathologic features include prominent demyelination in the central PONS with sparing of axons and neurons. This condition is usually associated with systemic disorders such as HYPONATREMIA; chronic ALCOHOLISM; LIVER FAILURE; severe BURNS; malignant NEOPLASMS; hemorrhagic PANCREATITIS; HEMODIALYSIS; and SEPSIS. The rapid medical correction of hyponatremia has been cited as a cause of this condition. (From Adams et al., Principles of Neurology, 6th ed, pp1125-6)','en',1,'2007-10-18 04:28:24',1,NULL,'14247FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14248,145950,'An opening in the tympanic membrane usually caused by trauma. There are four general categories: compression injuries (the most common and usually the result of a blow to the ear); instrumentation injuries (the second most common, usually inadvertent, caused often by cotton swabs or bobby-pins); burn-slag injuries (frequently seen in industry, from hot metal from machines or welding); and blast injuries (usually seen during war or as a result of terrorist bombing). In the absence of infection, most traumatic tympanic membrane perforations heal spontaneously. Persistent perforation is usually a manifestation of tubotympanitis, an inflammation of the eustachian tube and tympanic cavity (middle ear). (From Paparella, Shumrick, Gluckman, and Meyerhoff: Otolaryngology, vol. II, 3d ed, pp1363-65)','en',1,'2007-10-18 04:28:24',1,NULL,'14248FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14249,145952,'Increase in body weight beyond skeletal and physical standards as the result of an excessive accumulation of fat in the body. More than two times the ideal weight is considered OBESITY, MORBID.','en',1,'2007-10-18 04:28:24',1,NULL,'14249FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14250,145958,'Disorders of hearing or auditory perception resulting from disease of the central auditory pathways or auditory association cortical areas. These include HEARING LOSS, CENTRAL; cortical deafness; and AUDITORY PERCEPTUAL DISORDERS. Above the level of the pons, bilateral lesions are usually required to produce auditory dysfunction.','en',1,'2007-10-18 04:28:24',1,NULL,'14250FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14251,145959,'A non-neoplastic inflammatory lesion, usually of the jaw or gingiva, containing large, multinucleated cells. It includes reparative giant cell granuloma. Peripheral giant cell granuloma refers to the gingiva (giant cell epulis); central refers to the jaw.','en',1,'2007-10-18 04:28:24',1,NULL,'14251FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14252,145960,'Loss of epithelial tissue from the surface of the cornea due to progressive erosion and necrosis of the tissue; usually caused by bacterial, fungal, or viral infection.','en',1,'2007-10-18 04:28:24',1,NULL,'14252FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14253,145961,'An inherited congenital myopathic condition characterized by weakness and hypotonia in infancy and delayed motor development. Muscle biopsy reveals a condensation of myofibrils and myofibrillar material in the central portion of each muscle fiber. (Adams et al., Principles of Neurology, 6th ed, p1452)','en',1,'2007-10-18 04:28:24',1,NULL,'14253FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14254,145968,'Localized destruction of the tooth surface initiated by decalcification of the enamel followed by enzymatic lysis of organic structures and leading to cavity formation. If left unchecked, the cavity may penetrate the enamel and dentin and reach the pulp. The three most prominent theories used to explain the etiology of the disase are that acids produced by bacteria lead to decalcification; that micro-organisms destroy the enamel protein; or that keratolytic micro-organisms produce chelates that lead to decalcification.','en',1,'2007-10-18 04:28:24',1,NULL,'14254FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14255,145971,'An acute infectious disease caused by YERSINIA PESTIS that affects humans, wild rodents, and their ectoparasites. This condition persists due to its firm entrenchment in sylvatic rodent-flea ecosystems throughout the world. Bubonic plague is the most common form.','en',1,'2007-10-18 04:28:24',1,NULL,'14255FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14256,145973,'An acute, diffuse, and suppurative inflammation of loose connective tissue, particularly the deep subcutaneous tissues, and sometimes muscle, which is most commonly seen as a result of infection of a wound, ulcer, or other skin lesions.','en',1,'2007-10-18 04:28:24',1,NULL,'14256FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
