(14318,146073,'A vascular tumor preponderantly composed of large dilated blood vessels, often containing large amounts of blood, occurring in the skin, subcutaneously, or both, and also in many viscera, particularly the liver, spleen, pancreas, and sometimes the brain. The typical superficial lesions are bright to dark red in color; deep lesions have a blue color. A cavernous hemangioma in the skin extends more deeply than a capillary hemangioma and is less likely to regress spontaneously. (Dorland, 27th ed; from Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14318FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14319,146082,'Disease or injury involving multiple SPINAL NERVE ROOTS. Polyradiculitis refers to inflammation of multiple spinal nerve roots.','en',1,'2007-10-18 04:28:24',1,NULL,'14319FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14320,146088,'A type of schizophrenia characterized by abnormality of motor behavior which may involve particular forms of stupor, rigidity, excitement or inappropriate posture.','en',1,'2007-10-18 04:28:24',1,NULL,'14320FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14321,146089,'A type of schizophrenia characterized by abnormality of motor behavior which may involve particular forms of stupor, rigidity, excitement or inappropriate posture.','en',1,'2007-10-18 04:28:24',1,NULL,'14321FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14322,146090,'A type of schizophrenia characterized by abnormality of motor behavior which may involve particular forms of stupor, rigidity, excitement or inappropriate posture.','en',1,'2007-10-18 04:28:24',1,NULL,'14322FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14323,146091,'Continuous involuntary sustained muscle contraction which is often a manifestation of BASAL GANGLIA DISEASES. When an affected muscle is passively stretched, the degree of resistance remains constant regardless of the rate at which the muscle is stretched. This feature helps to distinguish rigidity from MUSCLE SPASTICITY. (From Adams et al., Principles of Neurology, 6th ed, p73)','en',1,'2007-10-18 04:28:24',1,NULL,'14323FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14324,146093,'A condition characterized by inactivity, decreased responsiveness to stimuli, and a tendency to maintain an immobile posture. The limbs tend to remain in whatever position they are placed (waxy flexibility). Catalepsy may be associated with PSYCHOTIC DISORDERS (e.g., SCHIZOPHRENIA, CATATONIC), nervous system drug toxicity, and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'14324FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14325,146094,'A neuropsychiatric disorder characterized by one or more of the following essential features: immobility, mutism, negativism (active or passive refusal to follow commands), mannerisms, stereotypies, posturing, grimacing, excitement, echolalia, echopraxia, muscular rigidity, and stupor; sometimes punctuated by sudden violent outbursts, panic, or hallucinations. This condition may be associated with psychiatric illnesses (e.g., SCHIZOPHRENIA; MOOD DISORDERS) or organic disorders (NEUROLEPTIC MALIGNANT SYNDROME; ENCEPHALITIS, etc.). (From DSM-IV, 4th ed, 1994; APA, Thesaurus of Psychological Index Terms, 1994)','en',1,'2007-10-18 04:28:24',1,NULL,'14325FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14326,146097,'A catarrhal disorder of the upper respiratory tract, which may be viral, a mixed infection, or an allergic reaction. It is marked by acute coryza, slight rise in temperature, chilly sensations, and general indisposition. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14326FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14327,146105,'Inflammation of part or all of the uvea, the middle (vascular) tunic of the eye, and commonly involving the other tunics (sclera and cornea, and the retina). (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14327FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14328,146110,'A condition characterized by transient weakness or paralysis of somatic musculature triggered by an emotional stimulus or physical exertion. Cataplexy is frequently associated with NARCOLEPSY. During a cataleptic attack, there is a marked reduction in muscle tone similar to the normal physiologic hypotonia that accompanies rapid eye movement sleep (SLEEP, REM). (From Adams et al., Principles of Neurology, 6th ed, p396)','en',1,'2007-10-18 04:28:24',1,NULL,'14328FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14329,146111,'Defects in the structure or number of chromosomes resulting in structural aberrations or manifesting as disease.','en',1,'2007-10-18 04:28:24',1,NULL,'14329FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14330,146114,'Disorders in which the symptoms are distressing to the individual and recognized by him or her as being unacceptable. Social relationships may be greatly affected but usually remain within acceptable limits. The disturbance is relatively enduring or recurrent without treatment.','en',1,'2007-10-18 04:28:24',1,NULL,'14330FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14331,146122,'Infections by the genus BARTONELLA. Bartonella bacilliformis can cause acute febrile anemia, designated Oroya fever, and a benign skin eruption, called verruga peruana. BARTONELLA QUINTANA causes TRENCH FEVER, while BARTONELLA HENSELAE is the etiologic agent of bacillary angiomatosis (ANGIOMATOSIS, BACILLARY) and is also one of the causes of CAT-SCRATCH DISEASE in immunocompetent patients.','en',1,'2007-10-18 04:28:24',1,NULL,'14331FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14332,146124,'A disorder characterized by muscle twitches, cramps, and carpopedal spasm, and when severe, laryngospasm and seizures. This condition is associated with unstable depolarization of axonal membranes, primarily in the peripheral nervous system. Tetany usually results from HYPOCALCEMIA or reduced serum levels of MAGNESIUM that may be associated with HYPERVENTILATION; HYPOPARATHYROIDISM; RICKETS; UREMIA; or other conditions. (From Adams et al., Principles of Neurology, 6th ed, p1490)','en',1,'2007-10-18 04:28:24',1,NULL,'14332FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14334,146127,'Entrapment of the MEDIAN NERVE in the carpal tunnel, which is formed by the flexor retinaculum and the CARPAL BONES. This syndrome may be associated with repetitive occupational trauma (CUMULATIVE TRAUMA DISORDERS); wrist injuries; AMYLOID NEUROPATHIES; rheumatoid arthritis (see ARTHRITIS, RHEUMATOID); ACROMEGALY; PREGNANCY; and other conditions. Symptoms include burning pain and paresthesias involving the ventral surface of the hand and fingers which may radiate proximally. Impairment of sensation in the distribution of the median nerve and thenar muscle atrophy may occur. (Joynt, Clinical Neurology, 1995, Ch51, p45)','en',1,'2007-10-18 04:28:24',1,NULL,'14334FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14335,146130,'Brief reversible episodes of focal, nonconvulsive ischemic dysfunction of the brain having a duration of less than 24 hours, and usually less than one hour, caused by transient thrombotic or embolic blood vessel occlusion or stenosis. Events may be classified by arterial distribution, temporal pattern, or etiology (e.g., embolic vs. thrombotic). (From Adams et al., Principles of Neurology, 6th ed, pp814-6)','en',1,'2007-10-18 04:28:24',1,NULL,'14335FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14337,146133,'Blood clot formation in the common, internal, or external carotid artery which may produce stenosis or occlusion of the vessel, leading to ischemia or infarction of tissue supplied by these arteries. Thrombosis of the common and internal carotid arteries may result in ISCHEMIC ATTACKS, TRANSIENT; CEREBRAL INFARCTION; or AMAUROSIS FUGAX.','en',1,'2007-10-18 04:28:24',1,NULL,'14337FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14338,146134,'Blood clot formation in the common, internal, or external carotid artery which may produce stenosis or occlusion of the vessel, leading to ischemia or infarction of tissue supplied by these arteries. Thrombosis of the common and internal carotid arteries may result in ISCHEMIC ATTACKS, TRANSIENT; CEREBRAL INFARCTION; or AMAUROSIS FUGAX.','en',1,'2007-10-18 04:28:24',1,NULL,'14338FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14340,146136,'Blood clot formation in the common, internal, or external carotid artery which may produce stenosis or occlusion of the vessel, leading to ischemia or infarction of tissue supplied by these arteries. Thrombosis of the common and internal carotid arteries may result in ISCHEMIC ATTACKS, TRANSIENT; CEREBRAL INFARCTION; or AMAUROSIS FUGAX.','en',1,'2007-10-18 04:28:24',1,NULL,'14340FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14341,146137,'Narrowing or stricture of the internal, common, or external carotid artery, most often as a result of atherosclerotic plaque formation. Ulcerations may form in atherosclerotic plaques and induce thrombus formation. Platelet or cholesterol emboli may arise from stenotic carotid lesions and induce a transient ischemic attack (ISCHEMIC ATTACK, TRANSIENT) or CEREBROVASCULAR ACCIDENT. Emboli which travel to the eye may manifest as AMAUROSIS FUGAX (temporary blindness). (From Adams et al., Principles of Neurology, 6th ed, pp822-3)','en',1,'2007-10-18 04:28:24',1,NULL,'14341FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14342,146139,'Narrowing or stricture of the internal, common, or external carotid artery, most often as a result of atherosclerotic plaque formation. Ulcerations may form in atherosclerotic plaques and induce thrombus formation. Platelet or cholesterol emboli may arise from stenotic carotid lesions and induce a transient ischemic attack (ISCHEMIC ATTACK, TRANSIENT) or CEREBROVASCULAR ACCIDENT. Emboli which travel to the eye may manifest as AMAUROSIS FUGAX (temporary blindness). (From Adams et al., Principles of Neurology, 6th ed, pp822-3)','en',1,'2007-10-18 04:28:24',1,'2013-05-19 21:31:02','14342FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14343,146140,'A chronic cerebral vasculopathy primarily occurring in childhood and characterized by slowly progressive carotid artery narrowing and occlusion at the base of the brain. An extensive network of anastomoses forms between branches of the carotid arteries, resulting in a characteristic angiographic appearance. The condition may be idiopathic (classic moyamoya disease) or occur in association with ANEMIA, SICKLE CELL; DOWN SYNDROME; CRANIOCEREBRAL TRAUMA; RADIOTHERAPY induced arterial injury; NEUROFIBROMATOSIS; and other diseases. Clinical manifestations include hemiparesis, headache, seizures, and delayed mental development. In older individuals, this disease may present as SUBARACHNOID HEMORRHAGE. (From Adams et al., Principles of Neurology, 6th ed, p831; Clin Neurol Neurosurg 1997 Oct;99 Suppl 2:S36-8)','en',1,'2007-10-18 04:28:24',1,NULL,'14343FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14344,146142,'Splitting or dissection of an arterial wall by blood entering through an intimal tear or by interstitial hemorrhage. It is most common in the aorta.','en',1,'2007-10-18 04:28:24',1,NULL,'14344FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14345,146143,'A sac formed by the dilatation of the wall of an artery, a vein, or the heart.','en',1,'2007-10-18 04:28:24',1,NULL,'14345FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14346,146144,'Laceration of the intracavernous portion of the carotid artery or one of its intracavernous branches resulting in a direct communication between the internal carotid artery and the cavernous sinus. Clinically, this produces a pulsatile exophthalamus and a marked limitation of extraocular motion in the affected eye. CRANIOCEREBRAL TRAUMA, especially basilar skull fractures (SKULL FRACTURE, BASILAR) is the most common cause of this condition, but it may also occur spontaneously or in association with diseases featuring defective connective tissue, such as EHLERS-DANLOS SYNDROME. (Adams et al., Principles of Neurology, 6th ed, p877)','en',1,'2007-10-18 04:28:24',1,NULL,'14346FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14347,146147,'Metabolic disorders affecting amino acid metabolism. They are present at birth, although they may not become symptomatic until later in life. The majority of these disorders are inherited and present in the neonatal period with metabolic disturbances (e.g., ACIDOSIS) and neurologic manifestations.','en',1,'2007-10-18 04:28:24',1,NULL,'14347FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14348,146150,'Metabolic disorders affecting amino acid metabolism. They are present at birth, although they may not become symptomatic until later in life. The majority of these disorders are inherited and present in the neonatal period with metabolic disturbances (e.g., ACIDOSIS) and neurologic manifestations.','en',1,'2007-10-18 04:28:24',1,NULL,'14348FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14349,146155,'An infectious disease of the skin caused by Treponema carateum that occurs only in the western hemisphere. Age of onset is between 10 and 20 years of age. This condition is characterized by marked changes in the skin color and is believed to be transmitted by direct person-to-person contact.','en',1,'2007-10-18 04:28:24',1,NULL,'14349FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14350,146161,'Sudden and usually momentary cessation of the heart beat. This sudden cessation may, but not usually, lead to DEATH, SUDDEN, CARDIAC.','en',1,'2007-10-18 04:28:24',1,NULL,'14350FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14351,146162,'Schistosomiasis affecting the heart and lungs.','en',1,'2007-10-18 04:28:24',1,NULL,'14351FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14354,146166,'Shock resulting from diminution of cardiac output in heart disease.','en',1,'2007-10-18 04:28:24',1,NULL,'14354FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14355,146168,'Angina pectoris or angina-like chest pain with a normal coronary arteriogram and positive exercise test. The cause of the syndrome is unknown. While its recognition is of clinical importance, its prognosis is excellent. (Braunwald, Heart Disease, 4th ed, p1346; Jablonski Dictionary of Syndromes & Eponymic Diseases, 2d ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14355FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
