(14514,146810,'A form of undifferentiated malignant lymphoma usually found in central Africa, but also reported in other parts of the world. It is commonly manifested as a large osteolytic lesion in the jaw or as an abdominal mass. B-cell antigens are expressed on the immature cells that make up the tumor in virtually all cases of Burkitt lymphoma. The Epstein-Barr virus (HERPESVIRUS 4, HUMAN) has been isolated from Burkitt lymphoma cases in Africa and it is implicated as the causative agent in these cases; however, most non-African cases are EBV-negative.','en',1,'2007-10-18 04:28:24',1,NULL,'14514FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
