(14532,146830,'A common superficial bacterial infection caused by STAPHYLOCOCCUS AUREUS or group A beta-hemolytic streptococci. Characteristics include pustular lesions that rupture and discharge a thin, amber-colored fluid that dries and forms a crust. This condition is commonly located on the face, especially about the mouth and nose.','en',1,'2007-10-18 04:28:24',1,NULL,'14532FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14533,146832,'A chronic and relatively benign subepidermal blistering disease usually of the elderly and without histopathologic acantholysis.','en',1,'2007-10-18 04:28:24',1,'2015-04-06 14:35:32','14533FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14534,146834,'An inflammatory, pruritic disease of the skin and mucous membranes, which can be either generalized or localized. It is characterized by distinctive purplish, flat-topped papules having a predilection for the trunk and flexor surfaces. The lesions may be discrete or coalesce to form plaques. Histologically, there is a \"saw-tooth\" pattern of epidermal hyperplasia and vacuolar alteration of the basal layer of the epidermis along with an intense upper dermal inflammatory infiltrate composed predominantly of T-cells. Etiology is unknown.','en',1,'2007-10-18 04:28:24',1,NULL,'14534FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14535,146835,'Diseases of the cornea.','en',1,'2007-10-18 04:28:24',1,NULL,'14535FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14536,146836,'A form of congenital ichthyosis inherited as an autosomal dominant trait and characterized by erythroderma and severe hyperkeratosis. It is manifested at birth by blisters followed by the appearance of thickened, horny, verruciform scales over the entire body, but accentuated in flexural areas.','en',1,'2007-10-18 04:28:24',1,NULL,'14536FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14537,146837,'Skin diseases characterized by local or general distributions of blisters. They are classified according to the site and mode of blister formation. Lesions can appear spontaneously or be precipitated by infection, trauma, or sunlight. Etiologies include immunologic and genetic factors. (From Scientific American Medicine, 1990)','en',1,'2007-10-18 04:28:24',1,NULL,'14537FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14539,146840,'A group of conditions of diverse etiologies characterized by the accumulation of insoluble fibrillar proteins (amyloid) in various organs and tissues of the body such that vital function is compromised. The associated disease states may be inflammatory, hereditary, or neoplastic, and the deposition can be localized or generalized or systemic. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14539FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14540,146845,'Episodic binge eating associated with the fear of not being able to stop eating, depressed mood, and self-deprecating thoughts. Binges are frequently terminated by self-induced vomiting. The bulimic episodes are not due to ANOREXIA NERVOSA or any known physical disorder.','en',1,'2007-10-18 04:28:24',1,NULL,'14540FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
