(14543,146849,'A group of disorders marked by progressive degeneration of motor neurons in the spinal cord resulting in weakness and muscular atrophy, usually without evidence of injury to the corticospinal tracts. Diseases in this category include Werdnig-Hoffmann disease and later onset SPINAL MUSCULAR ATROPHIES OF CHILDHOOD, most of which are hereditary. The adult onset variant of this condition is referred to as progressive muscular atrophy. (Adams et al., Principles of Neurology, 6th ed, p1089)','en',1,'2007-10-18 04:28:24',1,NULL,'14543FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14544,146850,'An abnormal response to a stimulus applied to the sensory components of the nervous system. This may take the form of increased, decreased, or absent reflexes.','en',1,'2007-10-18 04:28:24',1,NULL,'14544FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14545,146851,'Bleeding into a cerebral hemisphere of the brain, including lobar, subcortical white matter, and basal ganglia hemorrhages. Commonly associated conditions include HYPERTENSION; INTRACRANIAL ARTERIOSCLEROSIS; INTRACRANIAL ANEURYSM; CRANIOCEREBRAL TRAUMA; INTRACRANIAL ARTERIOVENOUS MALFORMATIONS; CEREBRAL AMYLOID ANGIOPATHY; and CEREBRAL INFARCTION.','en',1,'2007-10-18 04:28:24',1,NULL,'14545FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
