(14549,146858,'An acute infectious disease caused by YERSINIA PESTIS that affects humans, wild rodents, and their ectoparasites. This condition persists due to its firm entrenchment in sylvatic rodent-flea ecosystems throughout the world. Bubonic plague is the most common form.','en',1,'2007-10-18 04:28:24',1,NULL,'14549FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14550,146859,'An oral habit consisting of involuntary rhythmic or spasmodic nonfunctional gnashing, grinding, and clenching of teeth on other than chewing movements of the mandible, usually performed during sleep, which may lead to occlusal trauma. Causes are believed to be related to repressed aggression, emotional tension, anger, fear, and frustration. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14550FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
