(14584,146958,'A state of prolonged irreversible cessation of all brain activity, including lower brain stem function with the complete absence of voluntary movements, responses to stimuli, brain stem reflexes, and spontaneous respirations. Reversible conditions which mimic this clinical state (e.g., sedative overdose, hypothermia, etc.) are excluded prior to making the determination of brain death. (From Adams et al., Principles of Neurology, 6th ed, pp348-9)','en',1,'2007-10-18 04:28:24',1,NULL,'14584FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14585,146959,'An illusion of movement, either of the external world revolving around the individual or of the individual revolving in space. Vertigo may be associated with disorders of the inner ear, vestibular nerve, brainstem, and cerebral cortex. Lesions in the temporal and parietal lobes may be associated with FOCAL SEIZURES that may feature vertigo as an ictal manifestation. (From Adams et al., Principles of Neurology, 6th ed, pp300-1)','en',1,'2007-10-18 04:28:24',1,NULL,'14585FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14586,146960,'An autoimmune disorder mainly affecting young adults and characterized by destruction of myelin in the central nervous system. Pathologic findings include multiple sharply demarcated areas of demyelination throughout the white matter of the central nervous system. Clinical manifestations include visual loss, extra-ocular movement disorders, paresthesias, loss of sensation, weakness, dysarthria, spasticity, ataxia, and bladder dysfunction. The usual pattern is one of recurrent attacks followed by partial recovery (see MULTIPLE SCLEROSIS, RELAPSING-REMITTING), but acute fulminating and chronic progressive forms (see MULTIPLE SCLEROSIS, CHRONIC PROGRESSIVE) also occur. (Adams et al., Principles of Neurology, 6th ed, p903)','en',1,'2007-10-18 04:28:24',1,NULL,'14586FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14587,146977,'Infarctions that occur in the brain stem which is comprised of the midbrain, pons, and medulla. There are several named syndromes characterized by their distinctive clinical manifestations and specific sites of ischemic injury.','en',1,'2007-10-18 04:28:24',1,NULL,'14587FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
