(14590,147035,'Diseases of the cervical (and first thoracic) roots, nerve trunks, cords, and peripheral nerve components of the BRACHIAL PLEXUS. Clinical manifestations include regional pain, PARESTHESIA; MUSCLE WEAKNESS, and decreased sensation (HYPESTHESIA) in the upper extremity. These disorders may be associated with trauma (including BIRTH INJURIES); THORACIC OUTLET SYNDROME; NEOPLASMS; NEURITIS; RADIOTHERAPY; and other conditions. (From Adams et al., Principles of Neurology, 6th ed, pp1351-2)','en',1,'2007-10-18 04:28:24',1,NULL,'14590FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
