(14669,147320,'Partial or complete loss of vision in one half of the visual field(s) of one or both eyes. Subtypes include altitudinal hemianopsia, characterized by a visual defect above or below the horizontal meridian of the visual field. Homonymous hemianopsia refers to a visual defect that affects both eyes equally, and occurs either to the left or right of the midline of the visual field. Binasal hemianopsia consists of loss of vision in the nasal hemifields of both eyes. Bitemporal hemianopsia is the bilateral loss of vision in the temporal fields. Quadrantanopsia refers to loss of vision in one quarter of the visual field in one or both eyes.','en',1,'2007-10-18 04:28:24',1,NULL,'14669FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14670,147323,'Maladaptive reactions to identifiable psychosocial stressors occurring within a short time after onset of the stressor. They are manifested by either impairment in social or occupational functioning or by symptoms (depression, anxiety, etc.) that are in excess of a normal and expected reaction to the stressor.','en',1,'2007-10-18 04:28:24',1,NULL,'14670FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
