(14704,147455,'An autosomal dominant inherited partial epilepsy syndrome with onset between age 3 and 13 years. Seizures are characterized by PARESTHESIA and tonic or clonic activity of the lower face associated with drooling and dysarthria. The episodes tend to occur at night and may become secondarily generalized. In most cases, affected children are neurologically and developmentally normal. The electroencephalogram shows characteristic high-voltage sharp waves over the central temporal regions, which are more prominent during drowsiness and sleep. In general, seizures do not continue beyond mid-adolescence. (From Epilepsia 1998 39;Suppl 4:S32-S41)','en',1,'2007-10-18 04:28:24',1,NULL,'14704FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14705,147458,'A localization-related (focal) form of epilepsy characterized by recurrent seizures that arise from foci within the temporal lobe, most commonly from its mesial aspect. A wide variety of psychic phenomena may be associated, including illusions, hallucinations, dyscognitive states, and affective experiences. The majority of complex partial seizures (see EPILEPSY, COMPLEX PARTIAL) originate from the temporal lobes. Temporal lobe seizures may be classified by etiolgy as cryptogenic, familial, or symptomatic (i.e., related to an identified disease process or lesion). (From Adams et al., Principles of Neurology, 6th ed, p321)','en',1,'2007-10-18 04:28:24',1,NULL,'14705FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14706,147460,'Condition characterized by permanent deposition of substantial amounts of particulate matter in the lungs, usually of occupational or environmental origin, and by the tissue reaction to its presence.','en',1,'2007-10-18 04:28:24',1,NULL,'14706FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14707,147461,'A usually benign, well-encapsulated, lobular, vascular tumor of chromaffin tissue of the adrenal medulla or sympathetic paraganglia. The cardinal symptom, reflecting the increased secretion of epinephrine and norepinephrine, is hypertension, which may be persistent or intermittent. During severe attacks, there may be headache, sweating, palpitation, apprehension, tremor, pallor or flushing of the face, nausea and vomiting, pain in the chest and abdomen, and paresthesias of the extremities. The incidence of malignancy is as low as 5% but the pathologic distinction between benign and malignant pheochromocytomas is not clear. (Dorland, 27th ed; DeVita Jr et al., Cancer: Principles & Practice of Oncology, 3d ed, p1298)','en',1,'2007-10-18 04:28:24',1,NULL,'14707FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14721,147501,'A benign neoplasm derived from connective tissue, consisting chiefly of polyhedral and stellate cells that are loosely embedded in a soft mucoid matrix, thereby resembling primitive mesenchymal tissue. It occurs frequently intramuscularly where it may be mistaken for a sarcoma. It appears also in the jaws and the skin. (From Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14721FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14722,147502,'A benign neoplasm of muscular tissue. (Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,'2013-02-22 14:20:06','14722FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14724,147505,'A multilocular tumor with mucin secreting epithelium. They are most often found in the ovary, but are also found in the pancreas, appendix, and rarely, retroperitoneal and in the urinary bladder. They are considered to have low-grade malignant potential.','en',1,'2007-10-18 04:28:24',1,NULL,'14724FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14727,147515,'A benign, rapidly growing, deeply pigmented tumor of the jaw and occasionally of other sites, consisting of an infiltrating mass of cells arranged in an alveolar pattern, and occurring almost exclusively in infants. Its source of origin is in dispute, the various theories giving rise to its several names. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14727FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14733,147527,'A tumor of the beta cells of the islets of Langerhans. Although usually benign, such tumors are among the most important causes of hypoglycemia. Insulinomas usually occur in patients between the ages of 20 and 75 years, the average age being 44-46. Women are 60% of the patients in most series. (Dorland, 27th ed; DeVita Jr et al., Cancer: Principles & Practice of Oncology, 3d ed, p1324)','en',1,'2007-10-18 04:28:24',1,'2011-12-19 01:41:39','14733FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
