(14803,147825,'Pedunculated or sessile growths arising from the mucous membrane of the COLON.','en',1,'2007-10-18 04:28:24',1,NULL,'14803FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14804,147830,'A relatively common neoplasm of the central nervous system that arises from arachnoidal cells. The majority are well differentiated vascular tumors which grow slowly and have a low potential to be invasive, although malignant subtypes occur. Meningiomas have a predilection to arise from the parasagittal region, cerebral convexity, sphenoidal ridge, olfactory groove, and spinal canal. They tend to present in the fourth to sixth decades of life with signs indicative of a slowly progressive mass lesion. Specific clinical manifestations depend on the location of the tumor, but may include INTRACRANIAL HYPERTENSION, cranial neuropathies, ataxia, and other focal neurologic signs. (From DeVita et al., Cancer: Principles and Practice of Oncology, 5th ed, pp2056-7)','en',1,'2007-10-18 04:28:24',1,NULL,'14804FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14806,147840,'Tumors or cancer of the LUNG.','en',1,'2007-10-18 04:28:24',1,NULL,'14806FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14807,147843,'Neoplasms of the intracranial components of the central nervous system, including the cerebral hemispheres, basal ganglia, hypothalamus, thalamus, brain stem, and cerebellum. Brain neoplasms are subdivided into primary (originating from brain tissue) and secondary (i.e., metastatic) forms. Primary neoplasms are subdivided into benign and malignant forms. In general, brain tumors may also be classified by age of onset, histologic type, or presenting location in the brain.','en',1,'2007-10-18 04:28:24',1,NULL,'14807FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14809,147845,'Tumors or cancer located in bone tissue or specific bones.','en',1,'2007-10-18 04:28:24',1,NULL,'14809FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14811,147865,'Tumors or cancer of the adrenal gland.','en',1,'2007-10-18 04:28:24',1,NULL,'14811FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14812,147872,'Movements or behaviors associated with sleep, sleep stages, or partial arousals from sleep that may impair sleep maintenance. Parasomnias are generally divided into four groups: arousal disorders, sleep-wake transition disorders, parasomnias of REM sleep, and nonspecific parasomnias. (From Thorpy, Sleep Disorders Medicine, 1994, p191)','en',1,'2007-10-18 04:28:24',1,NULL,'14812FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14813,147874,'A general term referring to sudden and often violent motor activity of cerebral or brainstem origin. Convulsions may also occur in the absence of an electrical cerebral discharge (e.g., in response to hypotension).','en',1,'2007-10-18 04:28:24',1,NULL,'14813FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14814,147877,'Conditions characterized by the presence of a monoclonal serum (or urine) protein without clinical manifestations of plasma cell dyscrasia.','en',1,'2007-10-18 04:28:24',1,NULL,'14814FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14815,147878,'A benign tumor derived from smooth muscle tissue, also known as a fibroid tumor. They rarely occur outside of the uterus and the gastrointestinal tract but can occur in the skin and subcutaneous tissues, probably arising from the smooth muscle of small blood vessels in these tissues.','en',1,'2007-10-18 04:28:24',1,NULL,'14815FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14817,147883,'A condition marked by raised intracranial pressure and characterized clinically by HEADACHES; NAUSEA; PAPILLEDEMA, peripheral constriction of the visual fields, transient visual obscurations, and pulsatile TINNITUS. OBESITY is frequently associated with this condition, which primarily affects women between 20 and 44 years of age. Chronic PAPILLEDEMA may lead to optic nerve injury (see OPTIC NERVE DISEASES) and visual loss (see BLINDNESS).','en',1,'2007-10-18 04:28:24',1,NULL,'14817FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14819,147885,'Hypertrophy or enlargement of the heart.','en',1,'2007-10-18 04:28:24',1,NULL,'14819FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
