(14823,147889,'Presence of blood in the urine.','en',1,'2007-10-18 04:28:24',1,NULL,'14823FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14824,147890,'Conditions characterized by recurrent paroxysmal neuronal discharges which arise from a focal region of the brain. Partial seizures are divided into simple and complex, depending on whether consciousness is unaltered (simple partial seizure) or disturbed (complex partial seizure). Both types may feature a wide variety of motor, sensory, and autonomic symptoms. Partial seizures may be classified by associated clinical features or anatomic location of the seizure focus. A secondary generalized seizure refers to a partial seizure that spreads to involve the brain diffusely. (From Adams et al., Principles of Neurology, 6th ed, pp317)','en',1,'2007-10-18 04:28:24',1,NULL,'14824FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14825,147891,'A general term encompassing lower MOTOR NEURON DISEASE; PERIPHERAL NERVOUS SYSTEM DISEASES; and certain MUSCULAR DISEASES. Manifestations include MUSCLE WEAKNESS; FASCICULATION; muscle ATROPHY; SPASM; MYOKYMIA; MUSCLE HYPERTONIA, myalgias, and MUSCLE HYPOTONIA.','en',1,'2007-10-18 04:28:24',1,NULL,'14825FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14826,147892,'A relatively common disorder characterized by a fairly specific pattern of tremors which are most prominent in the upper extremities and neck, inducing titubations of the head. The tremor is usually mild, but when severe may be disabling. An autosomal dominant pattern of inheritance may occur in some families (i.e., familial tremor). (Mov Disord 1988;13(1):5-10)','en',1,'2007-10-18 04:28:24',1,NULL,'14826FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14827,147893,'Hereditary disease characterized initially by hematuria and slowly progressing to renal insufficiency. It is sometimes associated with perceptual deafness and/or congenital ocular defects.','en',1,'2007-10-18 04:28:24',1,NULL,'14827FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14828,147903,'Persistently high arterial blood pressure. Currently accepted threshold levels are 140 mm Hg systolic and 90 mm Hg diastolic pressure.','en',1,'2007-10-18 04:28:24',1,NULL,'14828FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14829,147904,'A form of necrotizing vasculitis involving small- and medium-sized arteries. The signs and symptoms result from infarction and scarring of the affected organ system.','en',1,'2007-10-18 04:28:24',1,NULL,'14829FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14830,147910,'A condition occurring as a result of exposure to a rapid fall in ambient pressure. Gases, nitrogen in particular, come out of solution and form bubbles in body fluid and blood. These gas bubbles accumulate in joint spaces and the peripheral circulation impairing tissue oxygenation causing disorientation, severe pain, and potentially death.','en',1,'2007-10-18 04:28:24',1,NULL,'14830FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14831,147912,'A syndrome characterized by the acute onset of unilateral FACIAL PARALYSIS which progresses over a 2-5 day period. Weakness of the orbicularis oculi muscle and resulting incomplete eye closure may be associated with corneal injury. Pain behind the ear often precedes the onset of paralysis. This condition may be associated with HERPESVIRUS 1, HUMAN infection of the facial nerve. (Adams et al., Principles of Neurology, 6th ed, p1376)','en',1,'2007-10-18 04:28:24',1,NULL,'14831FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14832,147915,'Rare chronic inflammatory disease involving the small blood vessels. It is of unknown etiology and characterized by mucocutaneous ulceration in the mouth and genital region and uveitis with hypopyon. The neuro-ocular form may cause blindness and death. Synovitis, thrombophlebitis, gastrointestinal ulcerations, retinal vasculitis, and optic atrophy may be occur as well.','en',1,'2007-10-18 04:28:24',1,NULL,'14832FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
