(14838,147922,'Slow or diminished movement of body musculature. It may be associated with BASAL GANGLIA DISEASES; MENTAL DISORDERS; prolonged inactivity due to illness; experimental protocols used to evaluate the physiologic effects of immobility; and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'14838FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14839,147923,'A behavior disorder originating in childhood in which the essential features are signs of developmentally inappropriate inattention, impulsivity, and hyperactivity. Although most individuals have symptoms of both inattention and hyperactivity-impulsivity, one or the other pattern may be predominant. The disorder is more frequent in males than females. Onset is in childhood. Symptoms often attenuate during late adolescence although a minority experience the full complement of symptoms into mid-adulthood. (From DSM-IV)','en',1,'2007-10-18 04:28:24',1,NULL,'14839FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14840,147925,'A repetitive and persistent pattern of behavior in which the basic rights of others or major age-appropriate societal norms or rules are violated. These behaviors include aggressive conduct that causes or threatens physical harm to other people or animals, nonagressive conduct that causes property loss or damage, deceitfulness or theft, and serious violations of rules. The onset is before age 18. (From DSM-IV, 1994)','en',1,'2007-10-18 04:28:24',1,NULL,'14840FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14841,147927,'A syndrome of multiple defects characterized primarily by umbilical hernia, macroglossia, and gigantism and secondarily by visceromegaly, hypoglycemia, ear abnormalities, etc.','en',1,'2007-10-18 04:28:24',1,NULL,'14841FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14842,147936,'A rare form of non-Hodgkin lymphoma having a usually diffuse pattern with both small and medium lymphocytes and small cleaved cells. It accounts for about 5% of adult non-Hodgkin lymphomas in the United States and Europe. The majority of mantle-cell lymphomas are associated with a t(11;14) translocation resulting in overexpression of the cyclin D1 gene (GENES, BCL-1).','en',1,'2007-10-18 04:28:24',1,NULL,'14842FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14844,147942,'A complex that includes several strains of M. avium. M. intracellulare is not easily distinguished from M. avium and therefore is included in the complex. These organisms are most frequently found in pulmonary secretions from persons with a tuberculous-like mycobacteriosis. Strains of this complex have also been associated with childhood lymphadenitis and AIDS. M. avium alone causes tuberculosis in a variety of birds and other animals, including pigs.','en',1,'2007-10-18 04:28:24',1,NULL,'14844FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14845,147943,'Deliberate severe and repeated injury to one domestic partner by the other.','en',1,'2007-10-18 04:28:24',1,NULL,'14845FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14846,147944,'Deliberate severe and repeated injury to one domestic partner by the other.','en',1,'2007-10-18 04:28:24',1,NULL,'14846FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14848,147952,'A heterogeneous group of disorders with the common feature of prolonged eosinophilia of unknown cause and associated organ system dysfunction, including the heart, central nervous system, kidneys, lungs, gastrointestinal tract, and skin. There is a massive increase in the number of eosinophils in the blood, mimicking leukemia, and extensive eosinophilic infiltration of the various organs. It is often referred to as idiopathic.','en',1,'2007-10-18 04:28:24',1,NULL,'14848FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14849,147954,'A condition characterized by throbbing headaches which are preceded or accompanied by reversible symptoms that reflect cortical or brain stem dysfunction. The most common type of aura consists of a positive visual phenomenon, usually in the form of a scintillating scotoma. An aura may also take the form of other focal neurologic symptoms or signs, including loss of sensation or weakness in an extremity. In general, the aura precedes the headache by less than 60 minutes, develops over 4 minutes or longer, and has a duration of less than one hour. (From Adams et al., Principles of Neurology, 6th ed, p172; Cephalalgia 1988;8:Suppl 7:1-96)','en',1,'2007-10-18 04:28:24',1,NULL,'14849FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14850,147956,'Localized or diffuse reduction in blood flow through the vertebrobasilar arterial system, which supplies the BRAIN STEM; CEREBELLUM; OCCIPITAL LOBE; medial TEMPORAL LOBE; and THALAMUS. Characteristic clinical features include SYNCOPE; lightheadedness; visual disturbances; and VERTIGO. BRAIN STEM INFARCTIONS or other BRAIN INFARCTION may be associated.','en',1,'2007-10-18 04:28:24',1,NULL,'14850FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14851,147966,'Infections by the genus BARTONELLA. Bartonella bacilliformis can cause acute febrile anemia, designated Oroya fever, and a benign skin eruption, called verruga peruana. BARTONELLA QUINTANA causes TRENCH FEVER, while BARTONELLA HENSELAE is the etiologic agent of bacillary angiomatosis (ANGIOMATOSIS, BACILLARY) and is also one of the causes of CAT-SCRATCH DISEASE in immunocompetent patients.','en',1,'2007-10-18 04:28:24',1,NULL,'14851FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14852,147968,'Ectopic gastric mucosa in the lower esophagus that often becomes ulcerated (Barrett ulcer), leading to stricture formation (ESOPHAGEAL STENOSIS).','en',1,'2007-10-18 04:28:24',1,NULL,'14852FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14853,147969,'Ectopic gastric mucosa in the lower esophagus that often becomes ulcerated (Barrett ulcer), leading to stricture formation (ESOPHAGEAL STENOSIS).','en',1,'2007-10-18 04:28:24',1,NULL,'14853FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14854,147972,'Tumors or cancer of the pancreas.','en',1,'2007-10-18 04:28:24',1,NULL,'14854FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14855,147973,'An autosomal recessive condition characterized by hypogonadism; spinocerebellar degeneration; MENTAL RETARDATION; RETINITIS PIGMENTOSA; and OBESITY. This syndrome was previously referred to as Laurence-Moon-Biedl syndrome until BARDET-BIEDL SYNDROME was identified as a distinct entity. (From N Engl J Med. 1989 Oct 12;321(15):1002-9)','en',1,'2007-10-18 04:28:24',1,NULL,'14855FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14856,147981,'Most common form of ichthyosis characterized by prominent scaling especially on the exterior surfaces of the extremities. It is inherited as an autosomal dominant trait.','en',1,'2007-10-18 04:28:24',1,NULL,'14856FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14857,147982,'A rare central nervous system demyelinating condition affecting children and young adults. Pathologic findings include a large, sharply defined, asymmetric focus of myelin destruction that may involve an entire lobe or cerebral hemisphere. The clinical course tends to be progressive and includes dementia, cortical blindness, cortical deafness, spastic hemiplegia, and pseudobulbar palsy. Concentric sclerosis of Balo is differentiated from diffuse cerebral sclerosis of Schilder by the pathologic finding of alternating bands of destruction and preservation of myelin in concentric rings. Alpers'' Syndrome refers to a heterogeneous group of diseases that feature progressive cerebral deterioration and liver disease. (From Adams et al., Principles of Neurology, 6th ed, p914; Dev Neurosci 1991;13(4-5):267-73)','en',1,'2007-10-18 04:28:24',1,NULL,'14857FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
