(14907,148090,'A group of inherited disorders characterized by degeneration of dorsal root and autonomic ganglion cells, and clinically by loss of sensation and autonomic dysfunction. There are five subtypes. Type I features autosomal dominant inheritance and distal sensory involvement. Type II is characterized by autosomal inheritance and distal and proximal sensory loss. Type III is DYSAUTONOMIA, FAMILIAL. Type IV features insensitivity to pain, heat intolerance, and mental deficiency. Type V is characterized by a selective loss of pain with intact light touch and vibratory sensation. (From Joynt, Clinical Neurology, 1995, Ch51, pp142-4)','en',1,'2007-10-18 04:28:24',1,NULL,'14907FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14908,148091,'A genetic disorder with autosomal dominant inheritance characterized by multiple cysts in both kidneys and progressive deterioration of renal function. It is usually caused by a mutant gene at the PKD1 locus on the short arm of chromosome 16, though mutations elsewhere in the genome can also cause the disease. The age of onset of symptoms varies widely.','en',1,'2007-10-18 04:28:24',1,NULL,'14908FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
