(14910,148094,'A group of hereditary disorders involving tissues and structures derived from the embryonic ectoderm. They are characterized by the presence of abnormalities at birth and involvement of both the epidermis and skin appendages. They are generally nonprogressive and diffuse. Various forms exist, including anhidrotic and hidrotic dysplasias, FOCAL DERMAL HYPOPLASIA, and aplasia cutis congenita.','en',1,'2007-10-18 04:28:24',1,NULL,'14910FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14911,148101,'A syndrome associated with damage to the spinal cord above the mid thoracic level (see SPINAL CORD INJURIES) characterized by a marked increase in the sympathetic response to minor stimuli such as bladder or rectal distention. Manifestations include HYPERTENSION; TACHYCARDIA (or reflex bradycardia); FEVER; FLUSHING; and HYPERHIDROSIS. Extreme hypertension may be associated with a CEREBROVASCULAR ACCIDENT. (From Adams et al., Principles of Neurology, 6th ed, pp538 and 1232; J Spinal Cord Med 1997;20(3):355-60)','en',1,'2007-10-18 04:28:24',1,NULL,'14911FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
