(14924,148123,'A disorder characterized by recurrent episodes of paroxysmal brain dysfunction due to a sudden, disorderly, and excessive neuronal discharge. Epilepsy classification systems are generally based upon: (1) clinical features of the seizure episodes (e.g., motor seizure), (2) etiology (e.g., post-traumatic), (3) anatomic site of seizure origin (e.g., frontal lobe seizure), (4) tendency to spread to other structures in the brain, and (5) temporal patterns (e.g., nocturnal epilepsy). (From Adams et al., Principles of Neurology, 6th ed, p313)','en',1,'2007-10-18 04:28:24',1,NULL,'14924FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14925,148124,'Clinical or subclinical disturbances of cortical function due to a sudden, abnormal, excessive, and disorganized discharge of brain cells. Clinical manifestations include abnormal motor, sensory and psychic phenomena. Recurrent seizures are usually referred to as EPILEPSY or \"seizure disorder.\"','en',1,'2007-10-18 04:28:24',1,NULL,'14925FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14927,148126,'Subjectively experienced sensations in the absence of an appropriate stimulus, but which are regarded by the individual as real. They may be of organic origin or associated with MENTAL DISORDERS.','en',1,'2007-10-18 04:28:24',1,'2015-07-17 21:18:20','14927FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14928,148128,'Disorders characterized by recurrent TICS that may interfere with speech and other activities. Tics are sudden, rapid, nonrhythmic, stereotyped motor movements or vocalizations which may be exacerbated by stress and are generally attenuated during absorbing activities. Tic disorders are distinguished from conditions which feature other types of abnormal movements that may accompany general medical conditions. (From DSM-IV, 1994)','en',1,'2007-10-18 04:28:24',1,NULL,'14928FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14929,148130,'Intense or aching pain that occurs along the course or distribution of a peripheral or cranial nerve.','en',1,'2007-10-18 04:28:24',1,NULL,'14929FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14930,148131,'So-called atypical species of the genus MYCOBACTERIUM. They are also called tuberculoid bacilli, i.e.: M. buruli (see M. ULCERANS), M. CHELONAE, M. duvalii, M. flavescens, M. FORTUITUM, M. gilvum, M. gordonae, M. intracellulare (see MYCOBACTERIUM AVIUM COMPLEX), M. KANSASII, M. MARINUM, M. obuense, M. SCROFULACEUM, M. szulgai, M. terrae, M. ULCERANS, M. XENOPI.','en',1,'2007-10-18 04:28:24',1,'2016-06-05 02:09:40','14930FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14931,148134,'A neoplastic disease of the lymphoreticular cells which is considered to be a rare type of chronic leukemia; it is characterized by an insidious onset, splenomegaly, anemia, granulocytopenia, thrombocytopenia, little or no lymphadenopathy, and the presence of \"hairy\" or \"flagellated\" cells in the blood and bone marrow.','en',1,'2007-10-18 04:28:24',1,NULL,'14931FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14932,148135,'A syndrome characterized by recurrent episodes of excruciating pain lasting several seconds or longer in the sensory distribution of the trigeminal nerve. Pain may be initiated by stimulation of trigger points on the face, lips, or gums or by movement of facial muscles or chewing. Associated conditions include MULTIPLE SCLEROSIS, vascular anomalies, ANEURSYMS, and neoplasms. (Adams et al., Principles of Neurology, 6th ed, p187)','en',1,'2007-10-18 04:28:24',1,NULL,'14932FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14933,148137,'Depressive states usually of moderate intensity in contrast with major depression present in neurotic and psychotic disorders.','en',1,'2007-10-18 04:28:24',1,NULL,'14933FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14934,148138,'A syndrome characterized by daily episodes of intense periorbital pain that recur over a period of 6-12 weeks that may be followed by a period of remission of months to years. The pain is non-throbbing, has a duration of 30-60 minutes and tends to occur at night or at regular intervals during the day. Unilateral rhinorrhea, conjunctival injection, lacrimation, facial flushing, and miosis frequently accompany the headaches, which primarily affect young adult males. (Adams et al., Principles of Neurology, 6th ed, p181)','en',1,'2007-10-18 04:28:24',1,NULL,'14934FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14935,148142,'A behavior disorder originating in childhood in which the essential features are signs of developmentally inappropriate inattention, impulsivity, and hyperactivity. Although most individuals have symptoms of both inattention and hyperactivity-impulsivity, one or the other pattern may be predominant. The disorder is more frequent in males than females. Onset is in childhood. Symptoms often attenuate during late adolescence although a minority experience the full complement of symptoms into mid-adulthood. (From DSM-IV)','en',1,'2007-10-18 04:28:24',1,NULL,'14935FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14936,148143,'The unsuccessful attempt to kill oneself.','en',1,'2007-10-18 04:28:24',1,NULL,'14936FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14937,148174,'The physiological period following the MENOPAUSE, the permanent cessation of the menstrual life. Since in the United States the age of the menopause ranges between 48 and 55 years, generally conceived as middle age, the postmenopause often refers to women','en',1,'2007-10-18 04:28:24',1,NULL,'14937FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14938,148178,'A chronic form of rhinitis marked by wasting of the mucous membrane and the glands. It is usually associated with crusting and foul-smelling discharges.','en',1,'2007-10-18 04:28:24',1,NULL,'14938FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14939,148182,'An inflammatory, pruritic disease of the skin and mucous membranes, which can be either generalized or localized. It is characterized by distinctive purplish, flat-topped papules having a predilection for the trunk and flexor surfaces. The lesions may be discrete or coalesce to form plaques. Histologically, there is a \"saw-tooth\" pattern of epidermal hyperplasia and vacuolar alteration of the basal layer of the epidermis along with an intense upper dermal inflammatory infiltrate composed predominantly of T-cells. Etiology is unknown.','en',1,'2007-10-18 04:28:24',1,NULL,'14939FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14940,148191,'Impairment of conduction in heart excitation. It is often applied specifically to atrioventricular heart block. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,'2015-12-31 20:48:03','14940FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14941,148192,'Absence of hair from areas where it is normally present.','en',1,'2007-10-18 04:28:24',1,NULL,'14941FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14942,148195,'A spectrum of septal defects associated with persistence of the embryonic atrioventricular canal due to incomplete growth and fusion of the endocardial cushion.','en',1,'2007-10-18 04:28:24',1,NULL,'14942FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14943,148196,'Defects in the septum between the atria of the heart, due to failure of fusion between either the septum secundum or the septum primum and the endocardial cushions.','en',1,'2007-10-18 04:28:24',1,NULL,'14943FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14944,148197,'Premature contractions of the heart arising from an ectopic atrial focus. With ventricular premature complexes, they represent one of the most common causes of irregular pulse. They are more apt to occur if there is atrial or conduction system disease such as left atrial enlargement in mitral stenosis. In community prospective studies, atrial premature complexes are not related to sudden death, as are ventricular premature beats in coronary disease. (From Stedman, 25th ed; Braunwald, Heart Disease, 4th ed, p679; Sokolow, et al., Clinical Cardiology, 5th ed, p472)','en',1,'2007-10-18 04:28:24',1,NULL,'14944FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14945,148199,'Tumors or cancer of the endocrine glands in general or unspecified.','en',1,'2007-10-18 04:28:24',1,NULL,'14945FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14947,148202,'Rapid, irregular atrial contractions due to an abnormality of atrial excitation.','en',1,'2007-10-18 04:28:24',1,'2015-12-31 20:47:37','14947FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14948,148203,'Disorder of cardiac rhythm characterized by rapid, irregular atrial impulses and ineffective atrial contractions.','en',1,'2007-10-18 04:28:24',1,'2015-11-03 03:09:01','14948FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14949,148204,'Hypertrophy or enlargement of the heart.','en',1,'2007-10-18 04:28:24',1,NULL,'14949FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14950,148205,'Any variation from the normal rhythm or rate of the heart beat.','en',1,'2007-10-18 04:28:24',1,NULL,'14950FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14951,148206,'An aneurysmal dilatation of a portion of the wall of the ventricle, usually the left, or, rarely, a saccular protrusion through it (false aneurysm of the heart). It is usually consequent to myocardial infarction but other causes such as bacterial endocarditis or trauma have been described. (Dorland, 28th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14951FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14952,148209,'Congenital bony or membranous occlusion of one or both choanae, due to failure of the embryonic bucconasal membrane to rupture.','en',1,'2007-10-18 04:28:24',1,NULL,'14952FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
