(14954,148215,'Inflammation of the mucous membrane of the nose similar to that found in hay fever except that symptoms persist throughout the year. The causes are usually air-borne allergens, particularly dusts, feathers, molds, animal fur, etc.','en',1,'2007-10-18 04:28:24',1,NULL,'14954FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
