(14957,148230,'Gait abnormalities that are a manifestation of nervous system dysfunction. These conditions may be caused by a wide variety of disorders which affect motor control, sensory feedback, and muscle strength including: CENTRAL NERVOUS SYSTEM DISEASES; PERIPHER','en',1,'2007-10-18 04:28:24',1,NULL,'14957FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14958,148233,'A dyskinesia characterized by an inability to maintain the fingers, toes, tongue, or other body parts in a stable position, resulting in continuous slow, sinusoidal, and flowing involuntary movements. This condition is frequently accompanied by CHOREA, where it is referred to as choreoathetosis. Athetosis may occur as a manifestation of BASAL GANGLIA DISEASES or DRUG TOXICITY, NERVOUS SYSTEM. (From Adams et al., Principles of Neurology, 6th ed, p76)','en',1,'2007-10-18 04:28:24',1,NULL,'14958FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14959,148235,'A sac formed by the dilatation of the wall of an artery, a vein, or the heart.','en',1,'2007-10-18 04:28:24',1,NULL,'14959FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14960,148236,'Narrowing or occlusion of the renal arteries. It is due usually to atherosclerosis, fibromuscular dysplasia, thrombosis, embolism, or external pressure. It may result in renovascular hypertension.','en',1,'2007-10-18 04:28:24',1,NULL,'14960FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14962,148240,'A common form of arteriosclerosis characterized by deposits of plaques (atheromas) containing lipids, carbohydrates, blood and blood products, fibrous tissue, and calcium deposits. These plaques are found in the intima of large- and medium-sized arteries.','en',1,'2007-10-18 04:28:24',1,NULL,'14962FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
