(14967,148248,'Gait abnormalities that are a manifestation of nervous system dysfunction. These conditions may be caused by a wide variety of disorders which affect motor control, sensory feedback, and muscle strength including: CENTRAL NERVOUS SYSTEM DISEASES; PERIPHER','en',1,'2007-10-18 04:28:24',1,NULL,'14967FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14968,148250,'An autosomal recessive inherited disorder characterized by choreoathetosis beginning in childhood, progressive cerebellar ataxia, telangiectasis of conjunctiva and skin, dysarthria, B- and T-cell immunodeficiency, and sensitivity to ionizing radiation. Affected individuals are prone to recurrent sinobronchopulmonary infections, lymphoreticular neoplasms, and other malignancies. Serum ALPHA-FETOPROTEINS are usually elevated. (Menkes, Textbook of Child Neurology, 5th ed, p688)','en',1,'2007-10-18 04:28:24',1,NULL,'14968FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14969,148252,'Maladaptive reactions to identifiable psychosocial stressors occurring within a short time after onset of the stressor. They are manifested by either impairment in social or occupational functioning or by symptoms (depression, anxiety, etc.) that are in excess of a normal and expected reaction to the stressor.','en',1,'2007-10-18 04:28:24',1,NULL,'14969FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14970,148254,'Sudden and usually momentary cessation of the heart beat. This sudden cessation may, but not usually, lead to DEATH, SUDDEN, CARDIAC.','en',1,'2007-10-18 04:28:24',1,NULL,'14970FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14971,148255,'Impairment of the ability to perform smoothly coordinated voluntary movements. This condition may affect the limbs, trunk, eyes, pharnyx, larnyx, and other structures. Ataxia may result from impaired sensory or motor function. Sensory ataxia may result from posterior column injury or PERIPHERAL NERVE DISEASES. Motor ataxia may be associated with CEREBELLAR DISEASES; CEREBRAL CORTEX diseases; THALAMIC DISEASES; BASAL GANGLIA DISEASES; injury to the RED NUCLEUS; and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'14971FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14972,148257,'Infections of the central nervous system caused by TREPONEMA PALLIDUM which present with a variety of clinical syndromes. The initial phase of infection usually causes a mild or asymptomatic meningeal reaction. The meningovascular form may present acutely as BRAIN INFARCTION. The infection may also remain subclinical for several years. Late syndromes include general paresis; TABES DORSALIS; meningeal syphilis; syphilitic OPTIC ATROPHY; and spinal syphilis. General paresis is characterized by progressive DEMENTIA; DYSARTHRIA; TREMOR; MYOCLONUS; SEIZURES; and Argyll-Robertson pupils. (Adams et al., Principles of Neurology, 6th ed, pp722-8)','en',1,'2007-10-18 04:28:24',1,NULL,'14972FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14973,148265,'An abnormal response to a stimulus applied to the sensory components of the nervous system. This may take the form of increased, decreased, or absent reflexes.','en',1,'2007-10-18 04:28:24',1,NULL,'14973FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14974,148267,'Peripheral, autonomic, and cranial nerve disorders that are associated with DIABETES MELLITUS. These conditions usually result from diabetic microvascular injury involving small blood vessels that supply nerves (VASA NERVORUM). Relatively common conditions which may be associated with diabetic neuropathy include third nerve palsy (see OCULOMOTOR NERVE DISEASES); MONONEUROPATHY; mononeuropathy multiplex; diabetic amyotrophy; a painful POLYNEUROPATHY; autonomic neuropathy; and thoracoabdominal neuropathy. (From Adams et al., Principles of Neurology, 6th ed, p1325)','en',1,'2007-10-18 04:28:24',1,NULL,'14974FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14975,148271,'Unequal curvature of the refractive surfaces of the eye. Thus a point source of light cannot be brought to a point focus on the retina but is spread over a more or less diffuse area. This results from the radius of curvature in one plane being longer or shorter than the radius at right angles to it. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14975FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14976,148273,'A form of bronchial disorder associated with airway obstruction, marked by recurrent attacks of paroxysmal dyspnea, with wheezing due to spasmodic contraction of the bronchi.','en',1,'2007-10-18 04:28:24',1,'2013-05-07 14:23:38','14976FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14977,148274,'Diminished or absent ability of the male to effect conception.','en',1,'2007-10-18 04:28:24',1,NULL,'14977FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14978,148276,'Impairment of the ability to perform smoothly coordinated voluntary movements. This condition may affect the limbs, trunk, eyes, pharnyx, larnyx, and other structures. Ataxia may result from impaired sensory or motor function. Sensory ataxia may result from posterior column injury or PERIPHERAL NERVE DISEASES. Motor ataxia may be associated with CEREBELLAR DISEASES; CEREBRAL CORTEX diseases; THALAMIC DISEASES; BASAL GANGLIA DISEASES; injury to the RED NUCLEUS; and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'14978FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
