(14980,148307,'A form of bronchial disorder associated with airway obstruction, marked by recurrent attacks of paroxysmal dyspnea, with wheezing due to spasmodic contraction of the bronchi.','en',1,'2007-10-18 04:28:24',1,NULL,'14980FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14981,148310,'A type of pneumonia resulting from the aspiration of food, liquid, or gastric contents into the upper respiratory tract.','en',1,'2007-10-18 04:28:24',1,NULL,'14981FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14982,148321,'Respiratory failure in the newborn. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14982FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14983,148324,'A genus of mitosporic fungi containing about 100 species and eleven different teleomorphs in the family Trichocomaceae.','en',1,'2007-10-18 04:28:24',1,NULL,'14983FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14984,148335,'Aseptic or avascular necrosis of the femoral head. The major types are idiopathic (primary), as a complication of fractures or dislocations, and LEGG-PERTHES DISEASE.','en',1,'2007-10-18 04:28:24',1,NULL,'14984FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14985,148341,'A heterogeneous group of infections produced by COXSACKIEVIRUSES, including herpangina, aseptic meningitis, a common-cold-like syndrome, a non-paralytic poliomyelitis-like syndrome, epidemic pleurodynia, and a serious myocarditis.','en',1,'2007-10-18 04:28:24',1,NULL,'14985FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14986,148342,'A syndrome characterized by headache, neck stiffness, low grade fever, and CSF lymphocytic pleocytosis in the absence of an acute bacterial pathogen. Viral meningitis is the most frequent cause although MYCOPLASMA INFECTIONS; RICKETTSIA INFECTIONS; diagnostic or therapeutic procedures; NEOPLASTIC PROCESSES; septic perimeningeal foci; and other conditions may result in this syndrome. (From Adams et al., Principles of Neurology, 6th ed, p745)','en',1,'2007-10-18 04:28:24',1,NULL,'14986FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14987,148345,'A condition due to a dietary deficiency of ascorbic acid (vitamin C), characterized by malaise, lethargy, and weakness. As the disease progresses, joints, muscles, and subcutaneous tissues may become the sites of hemorrhage. Ascorbic acid deficiency frequently develops into SCURVY in young children fed unsupplemented cow''s milk exclusively during their first year. It develops also commonly in chronic alcoholism. (Cecil Textbook of Medicine, 19th ed, p1177)','en',1,'2007-10-18 04:28:24',1,NULL,'14987FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14988,148348,'A small round or oval, mostly subcutaneous nodule made up chiefly of a mass of Aschoff bodies and seen in cases of rheumatic fever. It is differentiated from the RHEUMATOID NODULE which appears in rheumatoid arthritis, most frequently over bony prominences. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'14988FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14989,148352,'Inflammation of a bile duct.','en',1,'2007-10-18 04:28:24',1,NULL,'14989FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14990,148353,'A genus of nematodes of the superfamily ASCARIDOIDEA whose species usually inhabit the intestine.','en',1,'2007-10-18 04:28:24',1,NULL,'14990FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14991,148355,'An autosomal recessive lysosomal storage disease caused by a deficiency of CEREBROSIDE-SULFATASE leading to an accumulation of cerebroside sulfate in the nervous system and other organs. Pathologic features include diffuse demyelination and metachromatically-staining granules within glial cells, macrophages, and free in tissue. Clinical subtypes include late infantile, juvenile, and adult forms. The late infantile form presents at 12-18 months of age with progressive psychomotor retardation, ATAXIA, spasticity, and OPTIC ATROPHY. The juvenile form has onset at 4-12 years and features behavioral alterations and ataxia followed by spasticity, DEMENTIA, and visual loss. The adult form presents in the second decade or later with psychiatric manifestations, gait difficulties, and less often as a peripheral neuropathy. (From Menkes, Textbook of Child Neurology, 5th ed, pp192-5)','en',1,'2007-10-18 04:28:24',1,NULL,'14991FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14992,148357,'Presence of an intraocular lens after cataract extraction.','en',1,'2007-10-18 04:28:24',1,NULL,'14992FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14993,148358,'A group of cognitive disorders characterized by the inability to perform previously learned skills that cannot be attributed to deficits of motor or sensory function. The two major subtypes of this condition are ideomotor (see APRAXIA, IDEOMOTOR) and ideational apraxia, which refers to loss of the ability to mentally formulate the processes involved with performing an action. For example, dressing apraxia may result from an inability to mentally formulate the act of placing clothes on the body. Apraxias are generally associated with lesions of the dominant PARIETAL LOBE and supramarginal gyrus. (From Adams et al., Principles of Neurology, 6th ed, pp56-7)','en',1,'2007-10-18 04:28:24',1,NULL,'14993FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14994,148359,'Arthritis, especially of the great toe, as a result of gout. Acute gouty arthritis often is precipitated by trauma, infection, surgery, etc. The initial attacks are usually monoarticular but later attacks are often polyarticular.','en',1,'2007-10-18 04:28:24',1,NULL,'14994FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14995,148373,'A dermal inflammatory reaction produced under conditions of antibody excess, when a second injection of antigen produces intravascular antigen-antibody complexes which bind complement, causing cell clumping, endothelial damage, and vascular necrosis.','en',1,'2007-10-18 04:28:24',1,NULL,'14995FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14996,148374,'Infections of the brain caused by arthopod-borne viruses (i.e., arboviruses) primarily from the families TOGAVIRIDAE; FLAVIVIRIDAE; BUNYAVIRIDAE; REOVIRIDAE; and RHABDOVIRIDAE. Life cycles of these viruses are characterized by ZOONOSES, with birds and lower mammals serving as intermediate hosts. The virus is transmitted to humans by the bite of mosquitoes (CULICIDAE) or TICKS. Clinical manifestations include fever, headache, alterations of mentation, focal neurologic deficits, and COMA. (From Clin Microbiol Rev 1994 Jan;7(1):89-116; Walton, Brain''s Diseases of the Nervous System, 10th ed, p321)','en',1,'2007-10-18 04:28:24',1,NULL,'14996FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14997,148435,'Pain in the joint.','en',1,'2007-10-18 04:28:24',1,NULL,'14997FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(14998,148437,'Pain in the joint.','en',1,'2007-10-18 04:28:24',1,NULL,'14998FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15000,148441,'An abnormal communication between an artery and a vein.','en',1,'2007-10-18 04:28:24',1,NULL,'15000FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
