(15002,148444,'General or unspecified diseases of the blood vessels outside the heart. It is for diseases of the peripheral as opposed to the cardiac circulation.','en',1,'2007-10-18 04:28:24',1,NULL,'15002FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15005,148450,'Arteriosclerosis in which proliferation of the intima leads to occlusion of the lumen of the arteries.','en',1,'2007-10-18 04:28:24',1,NULL,'15005FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15006,148451,'Inflammation of an artery.','en',1,'2007-10-18 04:28:24',1,NULL,'15006FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15007,148456,'A collective term for diseases characterized by the formation, development, or presence of a thrombus (THROMBOSIS) and the blocking of a vessel by the thrombus brought to its site by the blood current (EMBOLISM). (From Dorland, 28th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15007FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15008,148457,'Occlusion or closure of the central retinal artery causing sudden, usually nearly complete, loss of vision in one eye. Occlusion of the branch retinal artery causes sudden visual loss in only a portion of the visual field.','en',1,'2007-10-18 04:28:24',1,NULL,'15008FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15010,148459,'Brief reversible episodes of focal, nonconvulsive ischemic dysfunction of the brain having a duration of less than 24 hours, and usually less than one hour, caused by transient thrombotic or embolic blood vessel occlusion or stenosis. Events may be classified by arterial distribution, temporal pattern, or etiology (e.g., embolic vs. thrombotic). (From Adams et al., Principles of Neurology, 6th ed, pp814-6)','en',1,'2007-10-18 04:28:24',1,NULL,'15010FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15013,148466,'A compulsion to set fires.','en',1,'2007-10-18 04:28:24',1,NULL,'15013FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15014,148471,'The lack of sufficient energy or protein to meet the body''s metabolic demands, as a result of either an inadequate dietary intake of protein, intake of poor quality dietary protein, increased demands due to disease, or increased nutrient losses.','en',1,'2007-10-18 04:28:24',1,NULL,'15014FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15015,148472,'Localized destruction of the tooth surface initiated by decalcification of the enamel followed by enzymatic lysis of organic structures and leading to cavity formation. If left unchecked, the cavity may penetrate the enamel and dentin and reach the pulp. The three most prominent theories used to explain the etiology of the disase are that acids produced by bacteria lead to decalcification; that micro-organisms destroy the enamel protein; or that keratolytic micro-organisms produce chelates that lead to decalcification.','en',1,'2007-10-18 04:28:24',1,NULL,'15015FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15016,148473,'Failure of the uterus to contract with normal strength and duration and at normal intervals during labor. It is also called uterine atony.','en',1,'2007-10-18 04:28:24',1,NULL,'15016FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15017,148475,'A dietary deficiency of riboflavin causing a syndrome chiefly marked by cheilitis, angular stomatitis, glossitis associated with a purplish red or magenta-colored tongue that may show fissures, corneal vascularization, dyssebacia, and anemia. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15017FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15018,148476,'A permanent ashen-gray discoloration of the skin, conjunctiva, and internal organs resulting from long-continued use of silver salts. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15018FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15019,148479,'A rare autosomal recessive disorder of the urea cycle. It is caused by a deficiency of the hepatic enzyme type I ARGINASE. Arginine is elevated in the blood and cerebrospinal fluid, and periodic hyperammonemia may occur. Disease onset is usually in infancy or early childhood. Clinical manifestations include seizures, microcephaly, progressive mental impairment, hypotonia, ataxia, spastic diplegia, and quadriparesis. (From Hum Genet 1993 Mar;91(1):1-5; Menkes, Textbook of Child Neurology, 5th ed, p51)','en',1,'2007-10-18 04:28:24',1,NULL,'15019FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
