(15026,148487,'Infections of the brain caused by arthopod-borne viruses (i.e., arboviruses) primarily from the families TOGAVIRIDAE; FLAVIVIRIDAE; BUNYAVIRIDAE; REOVIRIDAE; and RHABDOVIRIDAE. Life cycles of these viruses are characterized by ZOONOSES, with birds and lower mammals serving as intermediate hosts. The virus is transmitted to humans by the bite of mosquitoes (CULICIDAE) or TICKS. Clinical manifestations include fever, headache, alterations of mentation, focal neurologic deficits, and COMA. (From Clin Microbiol Rev 1994 Jan;7(1):89-116; Walton, Brain''s Diseases of the Nervous System, 10th ed, p321)','en',1,'2007-10-18 04:28:24',1,NULL,'15026FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15027,148488,'Inflammation of the coverings of the brain and/or spinal cord, which consist of the PIA MATER; ARACHNOID; and DURA MATER. Infections (viral, bacterial, and fungal) are the most common causes of this condition, but subarachnoid hemorrhage (HEMORRHAGES, SUBARACHNOID), chemical irritation (chemical MENINGITIS), granulomatous conditions, neoplastic conditions (e.g., carcinomatous meningitis), and other inflammatory conditions may produce this syndrome. (From Joynt, Clinical Neurology, 1994, Ch24, p6)','en',1,'2007-10-18 04:28:24',1,NULL,'15027FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15028,148489,'Intracranial or spinal cavities containing a cerebrospinal-like fluid, the wall of which is composed of arachnoidal cells. They are most often developmental or related to trauma. Intracranial arachnoid cysts usually occur adjacent to arachnoidal cistern and may present with HYDROCEPHALUS; HEADACHE; SEIZURES; and focal neurologic signs. Spinal arachnoid cysts may be extradural, intradural, or perineural and tend to present with signs and symptoms indicative of a RADICULOPATHY. (From Joynt, Clinical Neurology, 1994, Ch44, pp105-115)','en',1,'2007-10-18 04:28:24',1,NULL,'15028FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15029,148490,'A hereditary disorder of connective tissue characterized by tall stature, elongated extremities, subluxation of the lens, dilatation of the ascending aorta, and \"pigeon breast.\" It is inherited as an autosomal dominant trait.','en',1,'2007-10-18 04:28:24',1,NULL,'15029FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15030,148493,'A subtype of epilepsy characterized by seizures that are consistently provoked by a certain specific stimulus. Auditory, visual, and somatosensory stimuli as well as the acts of writing, reading, eating, and decision making are examples of events or activities that may induce seizure activity in affected individuals. (From Neurol Clin 1994 Feb;12(1):57-8)','en',1,'2007-10-18 04:28:24',1,NULL,'15030FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15031,148494,'Decreased salivary flow.','en',1,'2007-10-18 04:28:24',1,NULL,'15031FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15032,148496,'Acquired or developmental conditions marked by an impaired ability to comprehend or generate spoken forms of language.','en',1,'2007-10-18 04:28:24',1,NULL,'15032FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15033,148497,'A malformation of the nervous system caused by failure of the anterior neuropore to close. Infants are born with intact spinal cords, cerebellums, and brainstems, but lack formation of neural structures above this level. The skull is only partially formed but the eyes are usually normal. This condition may be associated with folate deficiency. Affected infants are only capable of primitive (brain stem) reflexes and usually do not survive for more than two weeks. (From Menkes, Textbook of Child Neurology, 5th ed, p247)','en',1,'2007-10-18 04:28:24',1,NULL,'15033FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15034,148498,'A group of cognitive disorders characterized by the inability to perform previously learned skills that cannot be attributed to deficits of motor or sensory function. The two major subtypes of this condition are ideomotor (see APRAXIA, IDEOMOTOR) and ideational apraxia, which refers to loss of the ability to mentally formulate the processes involved with performing an action. For example, dressing apraxia may result from an inability to mentally formulate the act of placing clothes on the body. Apraxias are generally associated with lesions of the dominant PARIETAL LOBE and supramarginal gyrus. (From Adams et al., Principles of Neurology, 6th ed, pp56-7)','en',1,'2007-10-18 04:28:24',1,NULL,'15034FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15035,148499,'A group of cognitive disorders characterized by the inability to perform previously learned skills that cannot be attributed to deficits of motor or sensory function. The two major subtypes of this condition are ideomotor (see APRAXIA, IDEOMOTOR) and ideational apraxia, which refers to loss of the ability to mentally formulate the processes involved with performing an action. For example, dressing apraxia may result from an inability to mentally formulate the act of placing clothes on the body. Apraxias are generally associated with lesions of the dominant PARIETAL LOBE and supramarginal gyrus. (From Adams et al., Principles of Neurology, 6th ed, pp56-7)','en',1,'2007-10-18 04:28:24',1,NULL,'15035FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
