(15042,148529,'A group of hereditary disorders involving tissues and structures derived from the embryonic ectoderm. They are characterized by the presence of abnormalities at birth and involvement of both the epidermis and skin appendages. They are generally nonprogressive and diffuse. Various forms exist, including anhidrotic and hidrotic dysplasias, FOCAL DERMAL HYPOPLASIA, and aplasia cutis congenita.','en',1,'2007-10-18 04:28:24',1,NULL,'15042FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
