(15044,148531,'A recurrent disease of the oral mucosa of unknown etiology. It is characterized by small white ulcerative lesions, single or multiple, round or oval. Two to eight crops of lesions occur per year, lasting for 7 to 14 days and then heal without scarring. (From Jablonski''s Dictionary of Dentistry, 1992, p742)','en',1,'2007-10-18 04:28:24',1,'2015-07-17 21:16:34','15044FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
