(15067,148576,'The presence of antibodies directed against phospholipids (ANTIBODIES, ANTIPHOSPHOLIPID). The condition is associated with a variety of diseases, notably systemic lupus erythematosus and other connective tissue diseases, thrombopenia, and arterial or venous thromboses. In pregnancy it can cause abortion. Of the phospholipids, the cardiolipins show markedly elevated levels of anticardiolipin antibodies (ANTIBODIES, ANTICARDIOLIPIN). Present also are high levels of lupus anticoagulant (LUPUS COAGULATION INHIBITOR).','en',1,'2007-10-18 04:28:24',1,NULL,'15067FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15068,148580,'Diffuse or local inflammation and edema of the interstitial tissue of the kidney, including the tubules.','en',1,'2007-10-18 04:28:24',1,NULL,'15068FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15069,148590,'A condition marked by softening of the bones (due to impaired mineralization, with excess accumulation of osteoid), with pain, tenderness, muscular weakness, anorexia, and loss of weight, resulting from deficiency of vitamin D and calcium. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15069FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15070,148591,'A disorder characterized by reduction in the elements involved in blood coagulation due to their utilization in widespread blood clotting within the vessels. The activation of the clotting mechanism may arise from any of a number of disorders. In the late stages, it is marked by profuse hemorrhaging. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15070FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
