(15076,148605,'Conditions characterized by an alteration in gustatory function or perception. Taste disorders are frequently associated with OLFACTION DISORDERS. Additional potential etiologies include METABOLIC DISEASES; DRUG TOXICITY; and taste pathway disorders (e.g., TASTE BUD diseases; FACIAL NERVE DISEASES; GLOSSOPHARYNGEAL NERVE DISEASES; and BRAIN STEM diseases).','en',1,'2007-10-18 04:28:24',1,NULL,'15076FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15077,148606,'Rapid swelling, increased tension, pain, and ischemic necrosis of the muscles of the anterior tibial compartment of the leg, often following excessive exertion.','en',1,'2007-10-18 04:28:24',1,NULL,'15077FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15078,148616,'A localized infection of mucous membranes or skin caused by toxigenic strains of CORYNEBACTERIUM DIPHTHERIAE. It is characterized by the presence of a pseudomembrane at the site of infection. DIPHTHERIA TOXIN, produced by C. diphtheriae, can cause myocarditis, polyneuritis, and other systemic toxic effects.','en',1,'2007-10-18 04:28:24',1,NULL,'15078FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15079,148618,'Ischemic injury to the optic nerve which usually affects the optic disk (optic neuropathy, anterior ischemic) and less frequently the retrobulbar portion of the nerve (optic neuropathy, posterior ischemic). The injury results from occlusion of arterial blood supply which may result from TEMPORAL ARTERITIS; ATHEROSCLEROSIS; COLLAGEN DISEASES; EMBOLI; DIABETES MELLITUS; and other conditions. The disease primarily occurs in the sixth decade or later and presents with the sudden onset of painless and usually severe monocular visual loss. Anterior ischemic optic neuropathy also features optic disk edema with microhemorrhages. The optic disk appears normal in posterior ischemic optic neuropathy. (Glaser, Neuro-Ophthalmology, 2nd ed, p135)','en',1,'2007-10-18 04:28:24',1,NULL,'15079FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15080,148622,'An aphasia characterized by impairment of expressive language (speech, writing, signs) and relative preservation of receptive language abilities (i.e., comprehension). This condition is caused by lesions of the motor association cortex in the frontal lobe (Broca''s area and adjacent cortical and white matter regions). The deficits range from almost complete muteness to a reduction in the fluency and rate of speech. CEREBROVASCULAR ACCIDENTS (in particular INFARCTION, MIDDLE CEREBRAL ARTERY) are a relatively common cause of this condition. (From Adams et al., Principles of Neurology, 6th ed, pp478-9)','en',1,'2007-10-18 04:28:24',1,NULL,'15080FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15081,148624,'Disorder occurring in the central or peripheral area of the cornea. The usual degree of transparency becomes relatively opaque.','en',1,'2007-10-18 04:28:24',1,NULL,'15081FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15082,148639,'A reduction in brain oxygen supply. Severe hypoxia is referred to as anoxia, and is a relatively common cause of injury to the central nervous system. Prolonged brain anoxia may lead to BRAIN DEATH or a PERSISTENT VEGETATIVE STATE. Histologically, this condition is characterized by neuronal loss which is most prominent in the HIPPOCAMPUS; GLOBUS PALLIDUS; CEREBELLUM; and inferior olives. (From Adams et al., Principles of Neurology, 6th ed, pp1109-11)','en',1,'2007-10-18 04:28:24',1,NULL,'15082FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15083,148642,'A reduction in brain oxygen supply. Severe hypoxia is referred to as anoxia, and is a relatively common cause of injury to the central nervous system. Prolonged brain anoxia may lead to BRAIN DEATH or a PERSISTENT VEGETATIVE STATE. Histologically, this condition is characterized by neuronal loss which is most prominent in the HIPPOCAMPUS; GLOBUS PALLIDUS; CEREBELLUM; and inferior olives. (From Adams et al., Principles of Neurology, 6th ed, pp1109-11)','en',1,'2007-10-18 04:28:24',1,NULL,'15083FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
