(15177,148906,'Protrusion of the rectal mucous membrane through the anus. There are various degrees: incomplete with no displacement of the anal sphincter muscle; complete with displacement of the anal sphincter muscle; complete with no displacement of the anal sphincter muscle but with herniation of the bowel; and internal complete with rectosigmoid or upper rectum intussusception into the lower rectum.','en',1,'2007-10-18 04:28:24',1,NULL,'15177FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15178,148907,'Persistence of the anal membrane, so that the anus is closed. The defect is not always complete; sometimes a narrow opening permits the passage of the bowel contents. When completely imperforate, the anus is seen as a dimple (the proctodeal pit) in the skin of the perineum. The latter condition is often associated with atresia of the lower rectum. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15178FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
