(15180,148914,'A severe condition resulting from bacteria invading healthy muscle from adjacent traumatized muscle or soft tissue. The infection originates in a wound contaminated with bacteria of the genus CLOSTRIDIUM. C. perfringens accounts for the majority of cases (over eighty percent), while C. noyvi, C. septicum, and C. histolyticum cause most of the other cases.','en',1,'2007-10-18 04:28:24',1,NULL,'15180FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15181,148916,'A degenerative disorder affecting upper MOTOR NEURONS in the brain and lower motor neurons in the brain stem and SPINAL CORD. Disease onset is usually after the age of 50 and the process is usually fatal within 3 to 6 years. Clinical manifestations include progressive weakness, atrophy, FASCICULATION, hyperreflexia, DYSARTHRIA, dysphagia, and eventual paralysis of respiratory function. Pathologic features include the replacement of motor neurons with fibrous ASTROCYTES and atrophy of anterior SPINAL NERVE ROOTS and corticospinal tracts. (From Adams et al., Principles of Neurology, 6th ed, pp1089-94)','en',1,'2007-10-18 04:28:24',1,NULL,'15181FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15182,148917,'A degenerative disorder affecting upper MOTOR NEURONS in the brain and lower motor neurons in the brain stem and SPINAL CORD. Disease onset is usually after the age of 50 and the process is usually fatal within 3 to 6 years. Clinical manifestations include progressive weakness, atrophy, FASCICULATION, hyperreflexia, DYSARTHRIA, dysphagia, and eventual paralysis of respiratory function. Pathologic features include the replacement of motor neurons with fibrous ASTROCYTES and atrophy of anterior SPINAL NERVE ROOTS and corticospinal tracts. (From Adams et al., Principles of Neurology, 6th ed, pp1089-94)','en',1,'2007-10-18 04:28:24',1,NULL,'15182FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
