(15221,149011,'A nonspecific term referring to impaired vision. Major subcategories include stimulus deprivation-induced amblyopia and toxic amblyopia. Stimulus deprivation-induced amblopia is a developmental disorder of the visual cortex. A discrepancy between visual information received by the visual cortex from each eye results in abnormal cortical development. STRABISMUS and REFRACTIVE ERRORS may cause this condition. Toxic amblyopia is a disorder of the OPTIC NERVE which is associated with ALCOHOLISM, tobacco SMOKING, and other toxins and as an adverse effect of the use of some medications.','en',1,'2007-10-18 04:28:24',1,NULL,'15221FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15222,149012,'A nonspecific term referring to impaired vision. Major subcategories include stimulus deprivation-induced amblyopia and toxic amblyopia. Stimulus deprivation-induced amblopia is a developmental disorder of the visual cortex. A discrepancy between visual information received by the visual cortex from each eye results in abnormal cortical development. STRABISMUS and REFRACTIVE ERRORS may cause this condition. Toxic amblyopia is a disorder of the OPTIC NERVE which is associated with ALCOHOLISM, tobacco SMOKING, and other toxins and as an adverse effect of the use of some medications.','en',1,'2007-10-18 04:28:24',1,NULL,'15222FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15223,149014,'Occlusion or closure of the central retinal artery causing sudden, usually nearly complete, loss of vision in one eye. Occlusion of the branch retinal artery causes sudden visual loss in only a portion of the visual field.','en',1,'2007-10-18 04:28:24',1,NULL,'15223FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15224,149015,'The inability to see or the loss or absence of perception of visual stimuli. This condition may be the result of EYE DISEASES; OPTIC NERVE DISEASES; OPTIC CHIASM diseases; or BRAIN DISEASES affecting the VISUAL PATHWAYS or OCCIPITAL LOBE.','en',1,'2007-10-18 04:28:24',1,NULL,'15224FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15225,149019,'A degenerative disease of the brain characterized by the insidious onset of dementia. Impairment of memory, judgement, attention span, and problem solving skills are followed by severe APRAXIA and a global loss of cognitive abilities. The condition primarily occurs after age 60, and is marked pathologically by severe cortical atrophy and the triad of SENILE PLAQUES; NEUROFIBRILLARY TANGLES; and NEUROPIL THREADS. (From Adams et al., Principles of Neurology, 6th ed, pp1049-57)','en',1,'2007-10-18 04:28:24',1,NULL,'15225FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15226,149023,'A condition sometimes occurring after tooth extraction, particularly after traumatic extraction, resulting in a dry appearance of the exposed bone in the socket, due to disintegration or loss of the blood clot. It is basically a focal osteomyelitis without suppuration and is accompanied by severe pain (alveolalgia) and foul odor. (Dorland, 28th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15226FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15227,149025,'A form of RHABDOMYOSARCOMA occurring mainly in adolescents and young adults, affecting muscles of the extremities, trunk, orbital region, etc. It is extremely malignant, metastasizing widely at an early stage. Few cures have been achieved and the prognosis is poor.  \"Alveolar\" refers to its microscopic appearance simulating the cells of the respiratory alveolus. (Holland et al., Cancer Medicine, 3d ed, p2188)','en',1,'2007-10-18 04:28:24',1,NULL,'15227FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15228,149027,'Chronic inflammation and progressive fibrosis of the pulmonary alveolar walls, with steadily progressive dyspnea, resulting finally in death from oxygen lack or right heart failure.','en',1,'2007-10-18 04:28:24',1,NULL,'15228FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15229,149031,'A localized defect in the visual field bordered by an area of normal vision. This occurs with a variety of EYE DISEASES (e.g., RETINAL DISEASES and GLAUCOMA), OPTIC NERVE DISEASES, and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'15229FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15230,149032,'Partial or complete loss of vision in one half of the visual field(s) of one or both eyes. Subtypes include altitudinal hemianopsia, characterized by a visual defect above or below the horizontal meridian of the visual field. Homonymous hemianopsia refers to a visual defect that affects both eyes equally, and occurs either to the left or right of the midline of the visual field. Binasal hemianopsia consists of loss of vision in the nasal hemifields of both eyes. Bitemporal hemianopsia is the bilateral loss of vision in the temporal fields. Quadrantanopsia refers to loss of vision in one quarter of the visual field in one or both eyes.','en',1,'2007-10-18 04:28:24',1,NULL,'15230FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15231,149033,'A pathological condition that removes acid or adds base to the body fluids.','en',1,'2007-10-18 04:28:24',1,NULL,'15231FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15232,149047,'Deficiency of the protease inhibitor ALPHA 1-ANTITRYPSIN, leading primarily to degradation of elastin of the alveolar walls, as well as other structural proteins of a variety of tissues. (From Scriver, Beaudet, Sly, & Valle, The Metabolic and Molecular Bases of Inherited Disease, 7th ed, p4125)','en',1,'2007-10-18 04:28:24',1,NULL,'15232FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
