(15246,149088,'A form of nonthrombocytopenic purpura due to a hypersensitivity vasculitis associated with a variety of clinical symptoms including urticaria and erythema, arthropathy and arthritis, gastrointestinal symptoms, and renal involvement.','en',1,'2007-10-18 04:28:24',1,NULL,'15246FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
