(15249,149102,'An experimental animal model for central nervous system demyelinating disease. Inoculation with a white matter emulsion combined with FREUND''S ADJUVANT, myelin basic protein, or purified central myelin triggers a T cell-mediated immune response directed towards central myelin. The pathologic features are similar to MULTIPLE SCLEROSIS, including perivascular and periventricular foci of inflammation and demyelination. Subpial demyelination underlying meningeal infiltrations also occurs, which is also a feature of ENCEPHALOMYELITIS, ACUTE DISSEMINATED. Passive immunization with T-cells from an afflicted animal to a normal animal also induces this condition. (From Immunol Res 1998;17(1-2):217-27; Raine CS, Textbook of Neuropathology, 2nd ed, p604-5)','en',1,'2007-10-18 04:28:24',1,NULL,'15249FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
