(15251,149108,'Aspergillosis of the lung occurring in an individual with long-standing bronchial asthma. It is characterized by pulmonary infiltrates, eosinophilia, elevated serum IgE and immediate type skin reactivity to aspergillus antigen.','en',1,'2007-10-18 04:28:24',1,NULL,'15251FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15253,149121,'Cyst occurring in a persistent portion of the urachus, presenting as an extraperitoneal mass in the umbilical region. It is characterized by abdominal pain, and fever if infected. It may rupture, leading to peritonitis, or it may drain through the umbilicus.','en',1,'2007-10-18 04:28:24',1,NULL,'15253FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15254,149122,'An inborn error of amino acid metabolism resulting from a defect in the enzyme homogentisate 1,2-dioxygenase and causing an accumulation of homogentisic acid in the urine. The condition is characterized by ochronosis in various tissues and arthritis.','en',1,'2007-10-18 04:28:24',1,NULL,'15254FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
