(15258,149131,'A syndrome characterized by severe burning pain in an extremity accompanied by sudomotor, vasomotor, and trophic changes in bone without an associated specific nerve injury. This condition is most often precipitated by trauma to soft tissue or nerve complexes. The skin over the affected region is usually erythematous and demonstrates hypersensitivity to tactile stimuli and erythema. (Adams et al., Principles of Neurology, 6th ed, p1360; Pain 1995 Oct;63(1):127-33)','en',1,'2007-10-18 04:28:24',1,NULL,'15258FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15259,149133,'A slow progressive disease of mink caused by the ALEUTIAN MINK DISEASE VIRUS. It is characterized by poor reproduction, weight loss, autoimmunity, hypergammaglobulinemia, increased susceptibility to bacterial infections, and death from renal failure. The disease occurs in all color types, but mink which are homozygous recessive for the Aleutian gene for light coat color are particularly susceptible.','en',1,'2007-10-18 04:28:24',1,NULL,'15259FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
