(15263,149140,'Adrenocortical hypofunction includes all conditions in which adrenal steroid hormone secretion falls below the requirements of the body. Adrenal insufficiency may be divided into two general categories: (1) those associated with primary inability of the adrenal to elaborate sufficient quantities of hormone and (2) those associated with a secondary failure due to a primary failure in the elaboration of adrenocorticotropin. (Harrison''s Principles of Internal Medicine, 13th ed, p1970)','en',1,'2007-10-18 04:28:24',1,NULL,'15263FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15264,149145,'An acute organic mental disorder induced by cessation or reduction in chronic alcohol consumption. Clinical characteristics include CONFUSION; DELUSIONS; vivid HALLUCINATIONS; TREMOR; agitation; insomnia; and signs of autonomic hyperactivity (e.g., elevated blood pressure and heart rate, dilated pupils, and diaphoresis). This condition may occasionally be fatal. It was formerly called delirium tremens. (From Adams et al., Principles of Neurology, 6th ed, p1175)','en',1,'2007-10-18 04:28:24',1,NULL,'15264FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15265,149148,'A condition where damage to the peripheral nervous system (including the peripheral elements of the autonomic nervous system) is associated with chronic ingestion of alcoholic beverages. The disorder may be caused by a direct effect of alcohol, an associated nutritional deficiency, or a combination of factors. Clinical manifestations include variable degrees of weakness; ATROPHY; PARESTHESIAS; pain; loss of reflexes; sensory loss; diaphoresis; and postural hypotension. (From Arch Neurol 1995;52(1):45-51; Adams et al., Principles of Neurology, 6th ed, p1146)','en',1,'2007-10-18 04:28:24',1,NULL,'15265FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15266,149151,'Liver diseases associated with alcoholism. It usually refers to the coexistence of two or more subentities, i.e., alcoholic fatty liver, alcoholic hepatitis, and alcoholic liver cirrhosis, but may be the general entity when subentities are not specified.','en',1,'2007-10-18 04:28:24',1,NULL,'15266FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15267,149152,'A pathologic condition resulting from accumulation of acid or depletion of the alkaline reserve (bicarbonate) content of the blood and body tissues, and characterized by an increase in hydrogen ion concentration (decrease in pH). (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15267FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15268,149153,'An acute or chronic degenerative and inflammatory lesion of the liver in the alcoholic which is potentially progressive though sometimes reversible. It does not necessarily include steatosis, fibrosis, or cirrhosis of alcoholics, although it is frequently associated with these conditions. It is characterized by liver cell necrosis, infiltration by polymorphonuclear leukocytes and lymphocytes, and Mallory bodies. The morphologic changes of chronic alcoholic hepatitis are not likely to be confused with chronic hepatitis (HEPATITIS, CHRONIC).','en',1,'2007-10-18 04:28:24',1,NULL,'15268FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15269,149154,'Fatty liver in alcoholics. It is potentially reversible and may be associated with alcoholic hepatitis or cirrhosis.','en',1,'2007-10-18 04:28:24',1,NULL,'15269FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
