(15306,149235,'Congenital megacolon due to absence of myenteric ganglion cells in a distal segment of the large intestine.','en',1,'2007-10-18 04:28:24',1,NULL,'15306FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
