(15309,149241,'A disease endemic among people and animals in Central Africa. It is caused by various species of trypanosomes, particularly T. gambiense and T. rhodesiense. Its second host is the tsetse fly. Involvement of the central nervous system produces \"African sleeping sickness.\" Nagana is a rapidly fatal trypanosomiasis of horses and other animals.','en',1,'2007-10-18 04:28:24',1,NULL,'15309FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15310,149242,'A febrile disease of the Mediterranean area, the Crimea, Africa, and India, caused by infection with RICKETTSIA CONORII.','en',1,'2007-10-18 04:28:24',1,NULL,'15310FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15311,149243,'Disorders in the processing of iron in the body: its absorption, transport, storage, and utilization. (From Mosby''s Medical, Nursing, & Allied Health Dictionary, 4th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15311FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15312,149244,'A form of undifferentiated malignant lymphoma usually found in central Africa, but also reported in other parts of the world. It is commonly manifested as a large osteolytic lesion in the jaw or as an abdominal mass. B-cell antigens are expressed on the immature cells that make up the tumor in virtually all cases of Burkitt lymphoma. The Epstein-Barr virus (HERPESVIRUS 4, HUMAN) has been isolated from Burkitt lymphoma cases in Africa and it is implicated as the causative agent in these cases; however, most non-African cases are EBV-negative.','en',1,'2007-10-18 04:28:24',1,NULL,'15312FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15313,149247,'Conditions which affect the structure or function of the pupil of the eye, including disorders of innervation to the pupillary constrictor or dilator muscles, and disorders of pupillary reflexes.','en',1,'2007-10-18 04:28:24',1,NULL,'15313FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15314,149248,'A complication of gastrojejunostomy, caused by acute or chronic obstruction of the afferent loop due to hernia, intussusception, kinking, volvulus, etc. It is characterized by pain and vomiting of bile-stained fluid and includes acute afferent loop obstruction.','en',1,'2007-10-18 04:28:24',1,NULL,'15314FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15315,149249,'Spasmodic swallowing of air.','en',1,'2007-10-18 04:28:24',1,NULL,'15315FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15316,149251,'Gram-negative, non-motile, capsulated, gas-producing rods found widely in nature and associated with urinary and respiratory infections in man.','en',1,'2007-10-18 04:28:24',1,NULL,'15316FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15317,149297,'Gastrointestinal disturbances, skin eruptions, or shock due to allergic reactions to allergens ingested in food.','en',1,'2007-10-18 04:28:24',1,NULL,'15317FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15318,149327,'Increase in body weight beyond skeletal and physical standards as the result of an excessive accumulation of fat in the body. More than two times the ideal weight is considered OBESITY, MORBID.','en',1,'2007-10-18 04:28:24',1,NULL,'15318FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15319,149329,'A subacute or chronic inflammatory disease of muscle and skin, marked by proximal muscle weakness and a characteristic skin rash. The illness occurs with approximately equal frequency in children and adults. The skin lesions usually take the form of a purplish rash (or less often an exfoliative dermatitis) involving the nose, cheeks, forehead, upper trunk, and arms. The disease is associated with a complement mediated intramuscular microangiopathy, leading to loss of capillaries, muscle ischemia, muscle-fiber necrosis, and perifascicular atrophy. The childhood form of this disease tends to evolve into a systemic vasculitis. Dermatomyositis may occur in association with malignant neoplasms. (From Adams et al., Principles of Neurology, 6th ed, pp1405-6)','en',1,'2007-10-18 04:28:24',1,NULL,'15319FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15320,149330,'Aggressive T-Cell malignancy with adult onset, caused by HTLV-I. It is endemic in Japan, the Caribbean basin, Southeastern United States, Hawaii, and parts of Central and South America and sub-Saharan Africa.','en',1,'2007-10-18 04:28:24',1,NULL,'15320FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15321,149331,'A group of disorders marked by progressive degeneration of motor neurons in the spinal cord resulting in weakness and muscular atrophy, usually without evidence of injury to the corticospinal tracts. Diseases in this category include Werdnig-Hoffmann disease and later onset SPINAL MUSCULAR ATROPHIES OF CHILDHOOD, most of which are hereditary. The adult onset variant of this condition is referred to as progressive muscular atrophy. (Adams et al., Principles of Neurology, 6th ed, p1089)','en',1,'2007-10-18 04:28:24',1,NULL,'15321FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15322,149336,'A inherited degenerative disease characterized by neuronal cytoplasmic inclusions which stain positively for ceroid and lipofuscin. Affected individuals develop retinal degeneration, seizures, myoclonus, ataxia, rigidity, and progressive dementia. Clinically there are four subtypes, divided by age of onset of symptoms: infantile (Santavuori-Haltia type), late infantile (Jansky-Bielschowsky type), juvenile (Spielmeyer-Vogt type), and adult (Kuf''s disease). The late infantile and juvenile forms may both also be referred to as Batten Disease and Batten-Mayou Disease. (Adams et al., Principles of Neurology, 6th ed, p957)','en',1,'2007-10-18 04:28:24',1,NULL,'15322FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15323,149340,'Disorders in the processing of phosphorus in the body: its absorption, transport, storage, and utilization.','en',1,'2007-10-18 04:28:24',1,NULL,'15323FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15324,149341,'A form of gangliosidosis characterized by accumulation of G(M1) GANGLIOSIDE and oligosaccharides in lysosomes caused by an absence or severe deficiency of the enzyme BETA-GALACTOSIDASE (type A1). The three phenotypes of this disorder are infantile (generalized), juvenile, and adult. The infantile form is characterized by skeletal abnormalities, hypotonia, poor psychomotor development, hirsutism, hepatosplenomegaly, and facial abnormalities. The juvenile form features hyperacusis, seizures, and psychomotor retardation. The adult form features progressive intellectual deterioration, involuntary movements, ataxia, and spasticity. (From Menkes, Textbook of Child Neurology, 5th ed, pp96-7)','en',1,'2007-10-18 04:28:24',1,NULL,'15324FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15325,149342,'A form of gangliosidosis characterized by accumulation of G(M1) GANGLIOSIDE and oligosaccharides in lysosomes caused by an absence or severe deficiency of the enzyme BETA-GALACTOSIDASE (type A1). The three phenotypes of this disorder are infantile (generalized), juvenile, and adult. The infantile form is characterized by skeletal abnormalities, hypotonia, poor psychomotor development, hirsutism, hepatosplenomegaly, and facial abnormalities. The juvenile form features hyperacusis, seizures, and psychomotor retardation. The adult form features progressive intellectual deterioration, involuntary movements, ataxia, and spasticity. (From Menkes, Textbook of Child Neurology, 5th ed, pp96-7)','en',1,'2007-10-18 04:28:24',1,NULL,'15325FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15326,149348,'A disease characterized by intestinal malabsorption and precipitated by gluten-containing foods. The intestinal mucosa shows loss of villous structure.','en',1,'2007-10-18 04:28:24',1,NULL,'15326FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15327,149353,'Persistent abnormal dilatation of the bronchi.','en',1,'2007-10-18 04:28:24',1,NULL,'15327FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15328,149354,'A group of inherited disorders of adrenal steroidogenesis, the physical expression of which varies with the sex of the patient, the severity of the congenital enzyme defect, and the age at which the defect makes its presence felt. The most common form, the simple virilizing form, is due to a 21-hydroxylase deficiency. There is also a salt-losing form (a more complete 21-hydroxylase deficiency), a hypertensive form (11-hydroxylase deficiency), a 17-hydroxylase deficiency form, a desmolase deficiency form, and a 3-beta-hydroxysteroid deficiency form.','en',1,'2007-10-18 04:28:24',1,NULL,'15328FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15329,149356,'Adrenocortical hypofunction includes all conditions in which adrenal steroid hormone secretion falls below the requirements of the body. Adrenal insufficiency may be divided into two general categories: (1) those associated with primary inability of the adrenal to elaborate sufficient quantities of hormone and (2) those associated with a secondary failure due to a primary failure in the elaboration of adrenocorticotropin. (Harrison''s Principles of Internal Medicine, 13th ed, p1970)','en',1,'2007-10-18 04:28:24',1,NULL,'15329FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15330,149360,'Adrenocortical hypofunction includes all conditions in which adrenal steroid hormone secretion falls below the requirements of the body. Adrenal insufficiency may be divided into two general categories: (1) those associated with primary inability of the adrenal to elaborate sufficient quantities of hormone and (2) those associated with a secondary failure due to a primary failure in the elaboration of adrenocorticotropin. (Harrison''s Principles of Internal Medicine, 13th ed, p1970)','en',1,'2007-10-18 04:28:24',1,NULL,'15330FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15331,149361,'A benign neoplasm of adrenal cortical cells resembling normal adrenal cells histologically but possessing functional autonomy. In general it does not exceed 5 cm in its largest dimension, although benign tumors exceeding 20 cm have been reported. Adrenal cortical adenomas produce hypercortisolism and hyperaldosteronism, but seldom produce adrenogenital syndromes. For the most part the prognosis after surgery is reasonably favorable. (From DeVita Jr et al., Cancer: Principles & Practice of Oncology, 3d ed, p1286)','en',1,'2007-10-18 04:28:24',1,NULL,'15331FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15332,149362,'A malignant neoplasm of adrenal cortical cells demonstrating partial or complete histological and functional differentiation. They are rare, comprising between only 0.05% and 0.2% of all cancers. Women develop functional adrenal cortical carcinomas more commonly than men, but men develop nonfunctioning ones more often than women. Hypercortisolism is the most common presentation for this cancer. Virilism and Cushing''s syndrome may also result. (From DeVita Jr et al., Cancer: Principles & Practice of Oncology, 3d ed, p1286)','en',1,'2007-10-18 04:28:24',1,NULL,'15332FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15333,149375,'A personality disorder whose essential feature is a pervasive pattern of disregard for, and violation of, the rights of others that begins in childhood or early adolescence and continues into adulthood. The individual must be at least age 18 and must have a history of some symptoms of CONDUCT DISORDER before age 15. (From DSM-IV, 1994)','en',1,'2007-10-18 04:28:24',1,NULL,'15333FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
