(15340,149382,'Neoplastic, inflammatory, infectious, and other diseases of the hypothalamus. Clinical manifestations include appetite disorders; AUTONOMIC NERVOUS SYSTEM DISEASES; SLEEP DISORDERS; behavioral symptoms related to dysfunction of the LIMBIC SYSTEM; and neuroendocrine disorders.','en',1,'2007-10-18 04:28:24',1,NULL,'15340FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15341,149388,'Incoordination of voluntary movements that occur as a manifestation of CEREBELLAR DISEASES. Characteristic features include a tendency for limb movements to overshoot or undershoot a target (dysmetria), a tremor that occurs during attempted movements (intention TREMOR), impaired force and rhythm of rapidly alternating movements (adiadochokinesis), and GAIT ATAXIA. (From Adams et al., Principles of Neurology, 6th ed, p90)','en',1,'2007-10-18 04:28:24',1,NULL,'15341FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15342,149393,'Inflammation of a bursa, occasionally accompanied by a calcific deposit in the underlying supraspinatus tendon. The most common site is the subdeltoid bursa. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15342FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15343,149394,'Inflammation of the coverings of the brain and/or spinal cord, which consist of the PIA MATER; ARACHNOID; and DURA MATER. Infections (viral, bacterial, and fungal) are the most common causes of this condition, but subarachnoid hemorrhage (HEMORRHAGES, SUBARACHNOID), chemical irritation (chemical MENINGITIS), granulomatous conditions, neoplastic conditions (e.g., carcinomatous meningitis), and other inflammatory conditions may produce this syndrome. (From Joynt, Clinical Neurology, 1994, Ch24, p6)','en',1,'2007-10-18 04:28:24',1,NULL,'15343FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15344,149414,'Disorder occurring in the central or peripheral area of the cornea. The usual degree of transparency becomes relatively opaque.','en',1,'2007-10-18 04:28:24',1,NULL,'15344FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15345,149418,'Respiratory and conjunctival infections caused by 33 identified serotypes of human adenoviruses.','en',1,'2007-10-18 04:28:24',1,NULL,'15345FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15346,149421,'Viral infections of the leptomeninges and subarachnoid space. TOGAVIRIDAE INFECTIONS; FLAVIVIRIDAE INFECTIONS; RUBELLA; BUNYAVIRIDAE INFECTIONS; ORBIVIRUS infections; PICORNAVIRIDAE INFECTIONS; ORTHOMYXOVIRIDAE INFECTIONS; RHABDOVIRIDAE INFECTIONS; ARENAVIRIDAE INFECTIONS; HERPESVIRIDAE INFECTIONS; ADENOVIRIDAE INFECTIONS; POLYOMAVIRUS HOMINIS 2 infections; and RETROVIRIDAE INFECTIONS may cause this form of meningitis. Clinical manifestations include fever, headache, neck pain, vomiting, PHOTOPHOBIA, and signs of meningeal irritation. (From Joynt, Clinical Neurology, 1996, Ch26, pp1-3)','en',1,'2007-10-18 04:28:24',1,NULL,'15346FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
