(15354,149478,'A catarrhal disorder of the upper respiratory tract, which may be viral, a mixed infection, or an allergic reaction. It is marked by acute coryza, slight rise in temperature, chilly sensations, and general indisposition. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,'2012-06-11 23:13:53','15354FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
