(15357,149483,'Inflammatory disease of unknown cause which involves the mucosa of the colon. Onset may be acute and fulminant, and its course often continues chronically in an intermittent or continuous form. Diarrhea is a common symptom and bleeding an almost constant concomitant symptom.','en',1,'2007-10-18 04:28:24',1,NULL,'15357FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15358,149484,'DEF: An acute infectious disease of the liver caused by the hepatitis A virus. DESC: Most commonly transmitted by the faecal-oral route, such as contaminated food. Incubation period 4-6 weeks. REF: {http://en.wikipedia.org/wiki/Hepatitis_A }','en',1,'2007-10-18 04:28:24',1,NULL,'15358FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15359,149486,'Acute kidney failure resulting from destruction of tubular epithelial cells. It is commonly attributed to exposure to toxic agents or renal ischemia following severe trauma.','en',1,'2007-10-18 04:28:24',1,NULL,'15359FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15360,149490,'Inflammation of a transverse portion of the spinal cord characterized by acute or subacute segmental demyelination or necrosis. The condition may occur sporadically, follow an infection or vaccination, or present as a paraneoplastic syndrome (see also ENCEPHALOMYELITIS, ACUTE DISSEMINATED). Clinical manifestations include motor weakness, sensory loss, and incontinence. (Adams et al., Principles of Neurology, 6th ed, pp1242-6)','en',1,'2007-10-18 04:28:24',1,NULL,'15360FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
