(15369,149525,'A chronic inflammatory disease of the skin of unknown etiology. It is characterized by moderate erythema, dry, moist, or greasy scaling, and yellow crusted patches on various areas, especially the scalp. On the scalp, it generally appears first as small patches of scales, progressing to involve the entire scalp with exfoliation of excessive amounts of dry scales (dandruff).','en',1,'2007-10-18 04:28:24',1,NULL,'15369FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15370,149526,'Disorders in which there is a loss of ego boundaries or a gross impairment in reality testing with delusions or prominent hallucinations. (From DSM-IV, 1994)','en',1,'2007-10-18 04:28:24',1,NULL,'15370FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15371,149534,'A febrile disease occurring as a delayed sequela of infections with group A hemolytic streptococci and characterized by multiple focal inflammatory lesions of the connective tissue structures, especially of the heart, blood vessels, and joints (polyarthritis), and by the presence of Aschoff bodies in the myocardium and skin. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15371FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15372,149535,'Inflammation of the optic nerve. Commonly associated conditions include autoimmune disorders such as MULTIPLE SCLEROSIS, infections, and granulomatous diseases. Clinical features include retro-orbital pain that is aggravated by eye movement, loss of color vision, and contrast sensitivity that may progress to severe visual loss, an afferent pupillary defect (Marcus-Gunn pupil), and in some instances optic disc hyperemia and swelling. Inflammation may occur in the portion of the nerve within the globe (neuropapillitis or anterior optic neuritis) or the portion behind the globe (retrobulbar neuritis or posterior optic neuritis).','en',1,'2007-10-18 04:28:24',1,NULL,'15372FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15374,149537,'Failure to adequately provide oxygen to cells of the body and to remove excess carbon dioxide from them. (Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15374FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15375,149540,'A pathologic condition resulting from accumulation of acid or depletion of the alkaline reserve (bicarbonate) content of the blood and body tissues, and characterized by an increase in hydrogen ion concentration (decrease in pH). (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15375FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15376,149541,'A form of acute kidney disease characterized by necrosis of the renal papillae. It is most frequently associated with diabetes mellitus because of the severe vascular disease present in the arteries and capillaries, particularly in the kidney. There is usually a large component of infection present, and in non-diabetics pyelonephritis and obstructive uropathy are the usual etiologic agents.','en',1,'2007-10-18 04:28:24',1,NULL,'15376FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15377,149544,'An autoimmune disorder mainly affecting young adults and characterized by destruction of myelin in the central nervous system. Pathologic findings include multiple sharply demarcated areas of demyelination throughout the white matter of the central nervous system. Clinical manifestations include visual loss, extra-ocular movement disorders, paresthesias, loss of sensation, weakness, dysarthria, spasticity, ataxia, and bladder dysfunction. The usual pattern is one of recurrent attacks followed by partial recovery (see MULTIPLE SCLEROSIS, RELAPSING-REMITTING), but acute fulminating and chronic progressive forms (see MULTIPLE SCLEROSIS, CHRONIC PROGRESSIVE) also occur. (Adams et al., Principles of Neurology, 6th ed, p903)','en',1,'2007-10-18 04:28:24',1,NULL,'15377FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15379,149554,'Inflammation or infection of the kidney.','en',1,'2007-10-18 04:28:24',1,'2014-07-12 02:08:23','15379FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15381,149560,'Congenital hypoplastic anemia, probably hereditary, with multiple abnormalities.','en',1,'2007-10-18 04:28:24',1,NULL,'15381FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15382,149561,'Inflammation of the dental pulp, usually due to bacterial infection in dental caries, tooth fracture, or other conditions causing exposure of the pulp to bacterial invasion. Chemical irritants, thermal factors, hyperemic changes, and other factors may also cause pulpitis. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15382FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15383,149563,'Inflammation of the prostate. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,'2014-10-09 15:43:54','15383FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15384,149566,'Anemia characterized by decreased or absent iron stores, low serum iron concentration, low transferrin saturation, and low hemoglobin concentration or hematocrit value. The erythrocytes are hypochromic and microcytic and the iron binding capacity is increased.','en',1,'2007-10-18 04:28:24',1,'2013-10-30 13:34:00','15384FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15385,149568,'An acute infectious disease of humans, particularly children, caused by any of three serotypes of human poliovirus (POLIOVIRUSES, HUMAN 1-3). Usually the infection is limited to the gastrointestinal tract and nasopharynx, and is often asymptomatic. The central nervous system, primarily the spinal cord, may be affected, leading to rapidly progressive paralysis, coarse FASCICULATION and hyporeflexia. Motor neurons are primarily affected. Encephalitis may also occur. The virus replicates in the nervous system, and may cause significant neuronal loss, most notably in the spinal cord. A rare related condition, nonpoliovirus poliomyelitis, may result from infections with nonpoliovirus enteroviruses. (From Adams et al., Principles of Neurology, 6th ed, pp764-5)','en',1,'2007-10-18 04:28:24',1,NULL,'15385FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15386,149576,'A nonimmunologic, chemically induced type of photosensitivity producing a sometimes vesiculating dermatitis. It results in hyperpigmentation and desquamation of the light-exposed areas of the skin.','en',1,'2007-10-18 04:28:24',1,NULL,'15386FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
