(15451,149707,'A subgroup of PARAPSORIASIS itself divided into acute and chronic forms. The acute form is characterized by the abrupt onset of a generalized, reddish-brown, maculopapular eruption. Lesions may be vesicular, hemorrhagic, crusted, or necrotic. Histologically the disease is characterized by epidermal necrolysis. The chronic form shows milder skin changes with necrosis. An important variant of the chronic form is LYMPHOMATOID PAPULOSIS.','en',1,'2007-10-18 04:28:24',1,'2015-04-12 19:08:42','15451FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
