(15454,149719,'A group of disorders characterized by the excessive production of porphyrins or their precursors that arises from abnormalities in the regulation of the porphyrin-heme pathway. The porphyrias are usually divided into three broad groups, erythropoietic (PORPHYRIA, ERYTHROPOIETIC), hepatic (PORPHYRIA, HEPATIC), and erythrohepatic (PORPHYRIA, ERYTHROHEPATIC), according to the major sites of abnormal porphyrin synthesis.','en',1,'2007-10-18 04:28:24',1,NULL,'15454FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15455,149721,'Diseases of multiple peripheral nerves. The various forms are categorized by the type of nerve affected (e.g., sensory, motor, or autonomic), by the distribution of nerve injury (e.g., distal vs. proximal), by nerve component primarily affected (e.g., demyelinating vs. axonal), by etiology, or by pattern of inheritance.','en',1,'2007-10-18 04:28:24',1,'2013-05-12 16:43:48','15455FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15456,149722,'Arthritis caused by bacteria, rickettsiae, mycoplasmas, viruses, fungi, or parasites. Bacterial arthritis is frequently caused by Staphylococcus aureus, Streptococcus pneumoniae, Haemophilus influenzae, and Neisseria gonorrhoeae. Viral arthritis is less common than bacterial arthritis and may be a manifestation of such viral diseases as mumps, rubella, hepatitis, etc.','en',1,'2007-10-18 04:28:24',1,NULL,'15456FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15457,149736,'Abnormally low potassium concentration in the blood. It may result from potassium loss by renal secretion or by the gastrointestinal route, as by vomiting or diarrhea. It may be manifested clinically by neuromuscular disorders ranging from weakness to paralysis, by electrocardiographic abnormalities (depression of the T wave and elevation of the U wave), by renal disease, and by gastrointestinal disorders. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15457FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
