(15459,149738,'Abnormally high potassium concentration in the blood, most often due to defective renal excretion. It is characterized clinically by electrocardiographic abnormalities (elevated T waves and depressed P waves, and eventually by atrial asystole). In severe cases, weakness and flaccid paralysis may occur. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15459FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15460,149740,'A noninflammatory, usually bilateral protrusion of the cornea, the apex being displaced downward and nasally. It occurs most commonly in females at about puberty. The cause is unknown but hereditary factors may play a role. The -conus refers to the cone shape of the corneal protrusion. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15460FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
