(15526,149947,'Abnormal responses to sunlight or artificial light due to extreme reactivity of light-absorbing molecules in tissues. It refers almost exclusively to skin photosensitivity, including sunburn, reactions due to repeated prolonged exposure in the absence of photosensitizing factors, and reactions requiring photosensitizing factors such as photosensitizing agents and certain diseases. With restricted reference to skin tissue, it does not include photosensitivity of the eye to light, as in photophobia or photosensitive epilepsy.','en',1,'2007-10-18 04:28:24',1,NULL,'15526FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15527,149951,'Abnormal responses to sunlight or artificial light due to extreme reactivity of light-absorbing molecules in tissues. It refers almost exclusively to skin photosensitivity, including sunburn, reactions due to repeated prolonged exposure in the absence of photosensitizing factors, and reactions requiring photosensitizing factors such as photosensitizing agents and certain diseases. With restricted reference to skin tissue, it does not include photosensitivity of the eye to light, as in photophobia or photosensitive epilepsy.','en',1,'2007-10-18 04:28:24',1,NULL,'15527FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15528,149953,'A condition, more commonly seen in females, due to hyperadrenocorticism resulting from neoplasms of the adrenal cortex or the anterior lobe of the pituitary, or to prolonged excessive intake of glucocorticoids for therapeutic purposes. The symptoms and signs may include rapidly developing adiposity of the face, neck, and trunk, kyphosis caused by osteoporosis of the spine, hypertension, diabetes mellitus, amenorrhea, hypertrichosis in females, impotence in males, dusky complexion with purple markings, polycythemia, pain in the abdomen and back, and muscular wasting and weakness. When secondary to excessive pituitary secretion of adrenocorticotropin, it is known as Cushing''s disease. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'15528FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15529,149957,'A disorder caused by excessive secretion of SOMATOTROPIN, characterized by bony enlargement of the face (especially prognathism), hands, feet, head, and thorax. Impaired glucose tolerance; HYPERTENSION; ARTHRITIS; diffuse hyperplasia of soft tissues; CARPAL TUNNEL SYNDROME; visceromegaly; and MUSCULAR WEAKNESS are frequently associated with this condition. The most common etiology is a somatotropin secreting pituitary ADENOMA (see also PITUITARY NEOPLASMS). (From Joynt, Clinical Neurology, 1992, Ch36, pp79-80)','en',1,'2007-10-18 04:28:24',1,NULL,'15529FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15530,149960,'Group of mostly hereditary disorders characterized by thickening of the palms and soles as a result of excessive keratin formation leading to hypertrophy of the stratum corneum (hyperkeratosis).','en',1,'2007-10-18 04:28:24',1,NULL,'15530FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15531,149962,'A condition seen primarily in childhood, most often resulting from chronic exposure to MERCURY COMPOUNDS which may result in ENCEPHALOPATHY and POLYNEUROPATHY. Clinical features include pain, swelling and pinkish discoloration of the fingers and toes, weakness in the extremities, extreme irritability, HYPERESTHESIA, and alterations in level of consciousness. (From Menkes, Textbook of Child Neurology, 5th ed, p603)','en',1,'2007-10-18 04:28:24',1,NULL,'15531FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15532,149965,'Inflammation involving the skin of the extremities, especially the hands and feet. Several forms are known, some idiopathic and some hereditary. The infantile form is called Gianotti-Crosti syndrome.','en',1,'2007-10-18 04:28:24',1,NULL,'15532FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15533,149967,'Premature closure of one or more sutures of the skull.','en',1,'2007-10-18 04:28:24',1,NULL,'15533FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15534,149969,'Congenital malformations of the central nervous system and adjacent structures related to defective neural tube closure during the first trimester of pregnancy generally occurring between days 18-29 of gestation. Ectodermal and mesodermal malformations (mainly involving the skull and vertebrae) may occur as a result of defects of neural tube closure. (From Joynt, Clinical Neurology, 1992, Ch55, pp31-41)','en',1,'2007-10-18 04:28:24',1,NULL,'15534FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15535,149970,'A malignant neoplasm derived from cells that are capable of forming melanin, which may occur in the skin of any part of the body, in the eye, or, rarely, in the mucous membranes of the genitalia, anus, oral cavity, or other sites. It occurs mostly in adults and may originate de novo or from a pigmented nevus or malignant lentigo. Melanomas frequently metastasize widely, and the regional lymph nodes, liver, lungs, and brain are likely to be involved. The incidence of malignant skin melanomas is rising rapidly in all parts of the world. (Stedman, 25th ed; from Rook et al., Textbook of Dermatology, 4th ed, p2445)','en',1,'2007-10-18 04:28:24',1,NULL,'15535FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15536,149971,'Group of hemorrhagic disorders in which the von Willebrand factor (Factor VIII-related antigen) is either quantitatively or qualitatively abnormal. They are usually inherited as an autosomal dominant trait though rare kindreds are autosomal recessive. Symptoms vary depending on severity and disease type but may include prolonged bleeding time, deficiency of factor VIII, and impaired platelet adhesion.','en',1,'2007-10-18 04:28:24',1,NULL,'15536FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
