(15622,150524,'A childhood seizure disorder characterized by rhythmic electrical brain discharges of geneneralized onset. Clinical features include a sudden cessation of ongoing activity usually without loss of postural tone. Rhythmic blinking of the eyelids or lip smacking frequently accompanies the seizure. The usual duration is 5-10 seconds, and multiple episodes may occur daily. Juvenile absence epilepsy is characterized by the juvenile onset of absence seizures and an increased incidence of myoclonus and tonic-clonic seizures. (Menkes, Textbook of Child Neurology, 5th ed, p736)','en',1,'2007-10-18 04:28:24',1,NULL,'15622FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
