(15698,150652,'The pathologic wearing away of the tooth substance by brushing, bruxism, clenching, and other mechanical causes. It is differentiated from TOOTH ATTRITION in that this type of wearing away is the result of tooth-to-tooth contact, as in mastication, occurring only on the occlusal, incisal, and proximal surfaces. It differs also from TOOTH EROSION, the progressive loss of the hard substance of a tooth by chemical processes not involving bacterial action. (From Jablonski, Dictionary of Dentistry, 1992, p2)','en',1,'2007-10-18 04:28:24',1,NULL,'15698FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15699,150737,'Scaly papule or warty growth, caused by five fungi, that spreads as a result of satellite lesions affecting the foot or leg. The extremity may become swollen and, at its distal portion, covered with various nodular, tumorous, verrucous lesions that resemble cauliflower. In rare instances, the disease may begin on the hand or wrist and involve the entire upper extremity. (Arnold, Odom, and James, Andrew''s Diseases of the Skin, 8th ed, p362)','en',1,'2007-10-18 04:28:24',1,NULL,'15699FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
