(15706,150818,'A parasomnia characterized by a partial arousal that occurs during stage IV of non-REM sleep. Affected individuals exhibit semipurposeful behaviors such as ambulation and are difficult to fully awaken. Children are primarily affected, with a peak age range of 4-6 years.','en',1,'2007-10-18 04:28:24',1,NULL,'15706FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15707,150820,'Conditions which affect the structure or function of the pupil of the eye, including disorders of innervation to the pupillary constrictor or dilator muscles, and disorders of pupillary reflexes.','en',1,'2007-10-18 04:28:24',1,NULL,'15707FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15708,150827,'An extra tooth, erupted or unerupted, resembling or unlike the other teeth in the group to which it belongs. Its presence may cause malposition of adjacent teeth or prevent their eruption.','en',1,'2007-10-18 04:28:24',1,NULL,'15708FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15709,150831,'A group of disorders characterized by the excessive production of porphyrins or their precursors that arises from abnormalities in the regulation of the porphyrin-heme pathway. The porphyrias are usually divided into three broad groups, erythropoietic (PORPHYRIA, ERYTHROPOIETIC), hepatic (PORPHYRIA, HEPATIC), and erythrohepatic (PORPHYRIA, ERYTHROHEPATIC), according to the major sites of abnormal porphyrin synthesis.','en',1,'2007-10-18 04:28:24',1,NULL,'15709FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15710,150838,'General term for syndromes of malnutrition due to failure of normal intestinal absorption of nutrients.','en',1,'2007-10-18 04:28:24',1,NULL,'15710FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15711,150839,'An autosomal disorder of the peripheral and autonomic nervous systems limited to individuals of Ashkenazic Jewish descent. Clinical manifestations are present at birth and include diminished lacrimation, defective thermoregulation, orthostatic hypotension (HYPOTENSION, ORTHOSTATIC), fixed pupils, excessive SWEATING, loss of pain and temperature sensation, and absent reflexes. Pathologic features include reduced numbers of small diameter peripheral nerve fibers and autonomic ganglion neurons. (From Adams et al., Principles of Neurology, 6th ed, p1348; Nat Genet 1993;4(2):160-4)','en',1,'2007-10-18 04:28:24',1,NULL,'15711FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15712,150848,'Either symptomatic diabetes or impaired glucose tolerance induced by pregnancy but resolved at the end of pregnancy. It does not include previously diagnosed diabetics who become pregnant (PREGNANCY IN DIABETES).','en',1,'2007-10-18 04:28:24',1,NULL,'15712FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15713,150873,'Dyssomnias associated with disruption of the normal 24 hour sleep wake cycle secondary to travel (e.g., JET LAG SYNDROME), shift work, or other causes.','en',1,'2007-10-18 04:28:24',1,NULL,'15713FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15714,150876,'Noises, normal and abnormal, heard on auscultation over any part of the respiratory tract.','en',1,'2007-10-18 04:28:24',1,NULL,'15714FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15715,150878,'A disease marked by repeated episodes of increased bone resorption followed by excessive attempts at repair, resulting in weakened, deformed bones of increased mass. The resultant architecture of the bone assumes a mosaic pattern in which the fibers take on a haphazard pattern instead of the normal parallel symmetry.','en',1,'2007-10-18 04:28:24',1,NULL,'15715FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15716,150879,'A collagen disorder resulting from defective biosynthesis of type I collagen and characterized by brittle, osteoporotic, and easily fractured bones. It may also present with blue sclerae, loose joints, and imperfect dentin formation. There are four major types, I-IV.','en',1,'2007-10-18 04:28:24',1,NULL,'15716FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15717,150880,'A repetitive and persistent pattern of behavior in which the basic rights of others or major age-appropriate societal norms or rules are violated. These behaviors include aggressive conduct that causes or threatens physical harm to other people or animals, nonagressive conduct that causes property loss or damage, deceitfulness or theft, and serious violations of rules. The onset is before age 18. (From DSM-IV, 1994)','en',1,'2007-10-18 04:28:24',1,NULL,'15717FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
