(15722,150892,'A premature contraction of the heart that is initiated somewhere other than the sinoatrial node.','en',1,'2007-10-18 04:28:24',1,NULL,'15722FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15723,150895,'Diseases of the sixth cranial (abducens) nerve or its nucleus in the pons. The nerve may be injured along its course in the pons, intracranially as it travels along the base of the brain, in the cavernous sinus, or at the level of superior orbital fissure or orbit. Dysfunction of the nerve causes lateral rectus muscle weakness, resulting in horizontal diplopia that is maximal when the affected eye is abducted and ESOTROPIA. Common conditions associated with nerve injury include INTRACRANIAL HYPERTENSION; CRANIOCEREBRAL TRAUMA; ISCHEMIA; and INFRATENTORIAL NEOPLASMS.','en',1,'2007-10-18 04:28:24',1,NULL,'15723FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(15724,150896,'Diseases of the sixth cranial (abducens) nerve or its nucleus in the pons. The nerve may be injured along its course in the pons, intracranially as it travels along the base of the brain, in the cavernous sinus, or at the level of superior orbital fissure or orbit. Dysfunction of the nerve causes lateral rectus muscle weakness, resulting in horizontal diplopia that is maximal when the affected eye is abducted and ESOTROPIA. Common conditions associated with nerve injury include INTRACRANIAL HYPERTENSION; CRANIOCEREBRAL TRAUMA; ISCHEMIA; and INFRATENTORIAL NEOPLASMS.','en',1,'2007-10-18 04:28:24',1,NULL,'15724FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
