(15728,150908,'A subtype of vascular headaches characterized by periodic unilateral pulsatile headaches which begin in childhood, adolescence, or early adult life and recur with diminishing frequency during advancing years. The two major subtypes are CLASSIC MIGRAINE (i.e., migraine with aura) and COMMON MIGRAINE (i.e., migraine without aura). Migrainous episodes may be associated with alterations in cerebral blood flow. (From Adams et al., Principles of Neurology, 6th ed, p172)','en',1,'2007-10-18 04:28:24',1,NULL,'15728FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
