(16702,160327,'No organic pathology or patients in whom the pathological process is localized and does not cause any systemic disturbance or abnormality.\r\nExamples: This includes patients suffering with fractures unless shock, blood loss, emboli or systemic signs of injury are present in an individual who would otherwise fall in Class 1. It includes congenital deformities unless they are causing systemic disturbance. Infections that are localized and do not cause fever, many osseous deformities, and uncomplicated hernias are included. Any type of operation may fall in this class since only the patient''s physical condition is considered. REF: http://en.wikipedia.org/wiki/ASA_physical_status_classification_system','en',1,'2012-04-30 18:37:23',1,'2012-04-30 18:40:00','16702FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(16703,160327,'Patient sain, en bonne santé, C''est-à-dire sans atteinte organique, physiologique, biochimique ou psychique. REF: http://fr.wikipedia.org/wiki/Score_ASA','fr',1,'2012-04-30 18:37:23',1,'2012-04-30 18:40:00','16703FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(16704,160328,'A moderate but definite systemic disturbance, caused either by the condition that is to be treated or surgical intervention or which is caused by other existing pathological processes, forms this group.\r\nExamples: Mild diabetes. Functional capacity I or IIa. Psychotic patients unable to care for themselves. Mild acidosis. Anemia moderate. Septic or acute pharyngitis. Chronic sinusitis with postnasal discharge. Acute sinusitis. Minor or superficial infections that cause a systemic reaction. (If there is no systemic reaction, fever, malaise, leukocytosis, etc., aid in classifying.) Nontoxic adenoma of thyroid that causes but partial respiratory obstruction. Mild thyrotoxicosis. Acute osteomyelitis (early). Chronic osteomyelitis. Pulmonary tuberculosis with involvement of pulmonary tissue insufficient to embarrass activity and without other symptoms. Ref: http://fr.wikipedia.org/wiki/Score_ASA','en',1,'2012-04-30 18:39:30',1,NULL,'16704FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(16705,160328,'Maladie systémique légère, patient présentant une atteinte modérée d''une grande fonction, par exemple: légère hypertension, anémie, bronchite chronique légère. REF: http://fr.wikipedia.org/wiki/Score_ASA','fr',1,'2012-04-30 18:39:30',1,NULL,'16705FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(16706,160329,'Maladie systémique sévère ou invalidante, patient présentant une atteinte sévère d''une grande fonction qui n''entraine pas d''incapacité, par exemple : angine de poitrine modérée, diabète, hypertension grave, décompensation cardiaque débutante. REF: http://fr.wikipedia.org/wiki/Score_ASA','fr',1,'2012-04-30 18:41:17',1,NULL,'16706FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(16707,160329,'Severe systemic disturbance from any cause or causes. It is not possible to state an absolute measure of severity, as this is a matter of clinical judgment. The following examples are given as suggestions to help demonstrate the difference between this class and Class 2.\r\nExamples: Complicated or severe diabetes. Functional capacity IIb. Combinations of heart disease and respiratory disease or others that impair normal functions severely. Complete intestinal obstruction that has existed long enough to cause serious physiological disturbance. Pulmonary tuberculosis that, because of the extent of the lesion or treatment, has induced vital capacity sufficiently to cause tachycardia or dyspnea. Patients debilitated by prolonged illness with weakness of all or several systems. Severe trauma from accident resulting in shock, which may be improved by treatment. Pulmonary abscess. REF: http://en.wikipedia.org/wiki/ASA_physical_status_classification_system','en',1,'2012-04-30 18:41:17',1,NULL,'16707FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(16708,160330,'Extreme systemic disorders which have already become an eminent threat to life regardless of the type of treatment. Because of their duration or nature there has already been damage to the organism that is irreversible. This class is intended to include only patients that are in an extremely poor physical state. There may not be much occasion to use this classification, but it should serve a purpose in separating the patient in very poor condition from others.\r\nExamples: Functional capacity III -(Cardiac Decompensation). Severe trauma with irreparable damage. Complete intestinal obstruction of long duration in a patient who is already debilitated. A combination of cardiovascular-renal disease with marked renal impairment. Patients who must have anesthesia to arrest a secondary hemorrhage where the patient is in poor condition associated with marked loss of blood. Emergency Surgery: An emergency operation is arbitrarily defined as a surgical procedure which, in the surgeon''s opinion, should be performed without delay. REF: http://en.wikipedia.org/wiki/ASA_physical_status_classification_system','en',1,'2012-04-30 18:42:50',1,NULL,'16708FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(16709,160330,'Patient présentant une atteinte sévère d''une grande fonction, invalidante, et qui met en jeu le pronostic vital, par exemple : angine de poitrine au repos, insuffisance systémique prononcée (pulmonaire, rénale, hépatique, cardiaque...) REF: http://fr.wikipedia.org/wiki/Score_ASA','fr',1,'2012-04-30 18:42:50',1,NULL,'16709FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
