(16717,160353,'Electroclinical syndromes:  An electroclinical syndrome is a complex of clinical features, signs and symptoms that together define a distinctive, recognizable clinical disorder.   These often become the focus of treatment trials as well as of genetic, neuropsychological, and neuroimaging investigations (e.g. Guerrini R et al., 2007, Ottman et al., 2008, Scheffer IE et al., 1998, Scheffer IE et al., 2008)).\r\nUse of the term “syndrome,” and more precisely “electro-clinical syndrome,” will be restricted to a group of clinical entities that are reliably identified by a cluster of electro-clinical and developmental characteristics. These are largely but not exclusively genetic in origin, and tend to have a strong relationship to developmental aspects of the brain.  These are distinctive disorders identifiable on the basis of a typical age onset, specific EEG characteristics, seizure types, and often other features which, when taken together, permit a specific diagnosis.  The diagnosis in turn often has implications for treatment, management, and prognosis. The term for these entities is “Electro-clinical Syndromes.”  While ultimately common usage will likely shorten the term again to “syndrome” alone, this is still specifically defined to mean entities that can be considered electro-clinical syndromes. REF: http://www.ice-epilepsy.org/new-ice-terminology-from-ilae.html','en',1,'2012-05-22 00:57:35',1,'2013-02-20 19:58:06','16717FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(16718,160357,'Submental and submandibular triangles. Ia is the submental triangle bound by the anterior bellies of the digastric and the mylohyoid. Ib is the triangle formed by the anterior and posterior bellies of the digastric and body of mandible. REF: http://en.wikipedia.org/wiki/Neck_dissection#Division_of_the_Neck_into_Levels_and_Sublevels','en',1,'2012-05-22 13:53:07',1,'2012-06-28 13:31:48','16718FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
