(16728,160367,'Posterior triangle group of lymph nodes located along the lower half of the spinal accessory nerve and the transverse cervical artery. The supraclavicular nodes are also included in this group. The posterior boundary is the anterior border of the trapezius muscle, the anterior boundary is the posterior border of the sternocleidomastoid muscle, and the inferior boundary is the clavicle.  REF: http://en.wikipedia.org/wiki/Neck_dissection#Division_of_the_Neck_into_Levels_and_Sublevels','en',1,'2012-05-22 17:35:50',1,'2012-06-28 14:57:29','16728FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(16729,160368,'Posterior triangle group of lymph nodes located along the lower half of the spinal accessory nerve and the transverse cervical artery. The supraclavicular nodes are also included in this group. The posterior boundary is the anterior border of the trapezius muscle, the anterior boundary is the posterior border of the sternocleidomastoid muscle, and the inferior boundary is the clavicle.  Sublevel VA includes the spinal accessory nodes. REF: http://en.wikipedia.org/wiki/Neck_dissection#Division_of_the_Neck_into_Levels_and_Sublevels','en',1,'2012-05-22 17:38:14',1,'2012-06-28 14:57:45','16729FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(16730,160369,'Posterior triangle group of lymph nodes located along the lower half of the spinal accessory nerve and the transverse cervical artery. The supraclavicular nodes are also included in this group. The posterior boundary is the anterior border of the trapezius muscle, the anterior boundary is the posterior border of the sternocleidomastoid muscle, and the inferior boundary is the clavicle.  Sublevel\r\nVB includes the nodes following the transverse cervical vessels and the supraclavicular nodes. REF: http://en.wikipedia.org/wiki/Neck_dissection#Division_of_the_Neck_into_Levels_and_Sublevels','en',1,'2012-05-22 17:39:20',1,'2012-06-28 14:57:58','16730FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(16731,160370,'Anterior compartment group comprises lymph nodes surrounding the midline visceral structures of the neck extending from the level of the hyoid bone superiorly to the suprasternal notch inferiorly. On each side, the lateral boundary is the medial border of the carotid sheath. Located within this compartment are the perithyroidal lymph nodes, paratracheal lymph nodes, lymph nodes along the recurrent laryngeal nerves, and precricoid lymph nodes.  REF: http://en.wikipedia.org/wiki/Neck_dissection#Division_of_the_Neck_into_Levels_and_Sublevels','en',1,'2012-05-22 17:40:27',1,'2012-06-28 14:58:10','16731FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
